INSERT INTO `exploits` (`id`, `title`, `organization`, `campus`, `visibility`, `body`, `image_1`, `created_by`, `time_created`, `date_created`, `hash_id`, `thumbnail`) VALUES
(21, 'ENACT ENGINE; THE FUTURE OF SUSTAINABLE POWER SUPPLY', 'Enactus Ekiti State University', '2KS877626U546E', 'show', '<p>Electricity is the backbone of small scale businesses, and large ones too. But many businesses have failed due to the epileptic power supply in Nigeria.</p>\r\n\r\n<p>Enactus Ekiti State University students brainstormed on how to proffer solutions to the challenge of epileptic power supply in Nigeria with poultry farmers our present target audience, we came up with a system called Enact Engine.</p>\r\n\r\n<p>Enact Engine will be creating clean and affordable energy through the production of Biogas from an anaerobic digester filled with slurry (Poultry waste) from a poultry farm. The gas generated is channeled into a modified generator that uses a gas carburetor instead of the regular petrol carburetor which supplies electricity to the poultry house.</p>\r\n\r\n<p>The good news is that, this system is eco-friendly, the cost incurred on petrol can be channelled into other productive activities and the digestate of the biogas is also used as a fertilizer helping our target audience to generate an alternative source of income. &nbsp;</p>\r\n\r\n<p>We have successfully installed this system on a poultry farm in Ekiti State and we will be installing this system on 100 farms before the end of 2018.</p>', 'uploads/3836435PicsArt_05-05-03.21.52.jpg', 'admin6561856488', '14:31:04', '2018-05-05', 'article9ct24ne258a439', '');
