(15, 'Software Development Training.', 'http://www.swapspacesystems.com', 'show', '<p><strong>Introducing...Swap Space Systems Ltd.</strong></p><p>We transform people\'s lives by teaching them how to code and helping them develop a successful career in Software Development</p><p>Irrespective of your academic background, as long as you can read, write and comprehend, we can groom you from novice to entry-level Software Developer or Front End Developer or User Experience Designer(within a space of 3 to 4 months)</p><p>Our next batch of coding classes begins 7th May, 2018. Registration Fee is N10,000. Training fee for each course(Web Development Immersive, Front End Development Immersive, User Experience Design) is N200,000.</p><p>Please visit <a href=\"https://www.swapspacesystems.com\">www.swapspacesystems.com</a> for more enquiries and register on the apply page.</p><p>To talk to our representative(s): 07039069923, 08078650258</p><p>Please go a step further and join us to transform more lives by sharing this information with your contacts. Someday, they will thank you for it.</p>', 'uploads/4177981DbIv2qqWAAAPnCO.jpg', 'admin7115698293', '09:40:01', '2018-04-30', 'reporta19spp71se057a5w39c', 'thumb/4643758thumb1535204877.jpg', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(16, 'Front-End Development Training', 'http://www.swapspacesystems.com', 'show', '<p><strong>Introducing...Swap Space Systems Ltd.</strong></p><p>We transform people\'s lives by teaching them how to code and helping them develop a successful career in Software Development</p><p>Irrespective of your academic background, as long as you can read, write and comprehend, we can groom you from novice to entry-level Software Developer or Front End Developer or User Experience Designer(within a space of 3 to 4 months)</p><p>Our next batch of coding classes begins 7th May, 2018. Registration Fee is N10,000. Training fee for each course(Web Development Immersive, Front End Development Immersive, User Experience Design) is N200,000.</p><p>Please visit www.swapspacesystems.com for more enquiries and register on the apply page.</p><p>To talk to our representative(s): 07039069923, 08078650258</p><p>Please go a step further and join us to transform more lives by sharing this information with your contacts. Someday, they will thank you for it.</p>', 'uploads/7507556DbIwDgQX0AE3uNP.jpg', 'admin7115698293', '10:40:41', '2018-04-30', 'reportf0-8o2nnr61d7025et5', 'thumb/5507524thumb1535204866.jpg', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(18, 'CREATING THE FUTURE', 'Check out \"Creating the future 3.0\" https://www.eventbrite.com/e/creating-the-future-30-tickets-47622893356?utm-medium=discovery&utm-campaign=social&utm-content=attendeeshare&utm-source=wa&utm-term=listing', 'show', '<p>Youth development is important in ensuring that unemployment is reduced to its bearest minimal and to achieve this Oakland Foundation in partnership with Enactus FUTA will be organizing a day symposium on the 6th of July 2018 at the T.I Francis Hall, Federal University of Technology, Akure.</p>\r\n\r\n<p>This event is with the main aim of enlightening undergraduates about the labour market either as an entrepreneur or one who wants to be job employable.&nbsp;<br />\r\nBe sure not to miss out if you&#39;re in Akure!!!!<br />\r\n#BuildingCompetentYouths<br />\r\n#CreatingTheFuture3.0<br />\r\n#FutaEdition</p>', 'uploads/129119IMG_20180701_011046_007.jpg', '5t6Bub675an0d1234ae', '14:44:15', '2018-07-01', 'rrc2n9e99t7po80ei4rgta02', 'thumb/2007339thumb1535204856.jpg', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(20, 'Wealth Master Class Training', 'https://twitter.com/fmgplatform', 'show', '<p>Keep a date with us on 9th/11th August, 2018 for the next Wealth Master Class training. For it all begins with your thought process...Come See How!</p>\r\n\r\n<p>VENUE: No. 11 Dakala Street, opp. First Forty Hotel, off Parakou Street, Wuse II Abuja.</p>\r\n\r\n<p>TIME: 10.00 am Prompt</p>\r\n\r\n<p>CALL: 08103910237</p>', 'uploads/3448751Djgp2QPXoAAEuem.jpg', 'j90819542aBn72i', '13:04:29', '2018-08-01', '5wl16erp07oe18rta4t55h', 'thumb/9099655thumb1536918727.jpg', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(21, 'ICT-Centric 3Depoxy Training', 'https://ictcentric.com', 'show', '<p>Improve your 3Depoxy skills. Register now for free <a data-query-source=\"hashtag_click\" dir=\"ltr\" href=\"https://twitter.com/hashtag/ict_centric?src=hash\"><s>#</s><strong>ict_centric</strong></a> <a data-query-source=\"hashtag_click\" dir=\"ltr\" href=\"https://twitter.com/hashtag/3Depoxytraining?src=hash\"><s>#</s><strong>3Depoxytraining</strong></a> <a data-query-source=\"hashtag_click\" dir=\"ltr\" href=\"https://twitter.com/hashtag/umsNigeria?src=hash\"><s>#</s><strong>umsNigeria</strong></a> <a data-query-source=\"hashtag_click\" dir=\"ltr\" href=\"https://twitter.com/hashtag/umsteam?src=hash\"><s>#</s><strong>umsteam</strong></a> <a data-query-source=\"hashtag_click\" dir=\"ltr\" href=\"https://twitter.com/hashtag/happynewmonth?src=hash\"><s>#</s><strong>happynewmonth</strong></a> <a data-query-source=\"hashtag_click\" dir=\"ltr\" href=\"https://twitter.com/hashtag/lagos?src=hash\"><s>#</s><strong>lagos</strong></a> <a data-query-source=\"hashtag_click\" dir=\"ltr\" href=\"https://twitter.com/hashtag/ikeja?src=hash\"><s>#</s><strong>ikeja</strong></a></p>', 'uploads/5976900Djg7e6mW4AEZozm.jpg', 'j90819542aBn72i', '13:30:55', '2018-08-01', 'i-er8et3t969ic8p9cc7ntr2or', 'thumb/516171thumb1535204830.jpg', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
