(23, 'Summer Skill Acquisition  Program', 'https://twitter.com/ibe_lydiabeauty/status/1024619878760808449', 'show', '<p>Summer time!&nbsp;</p>\r\n\r\n<p>Training time!</p>\r\n\r\n<p>Get a skill. <a data-query-source=\"hashtag_click\" dir=\"ltr\" href=\"https://twitter.com/hashtag/noknowledgeisawaste?src=hash\"><s>#</s><strong>noknowledgeisawaste</strong></a></p>', 'uploads/6328073DjguVjgXoAAQglq.jpg', 'j90819542aBn72i', '13:43:17', '2018-08-01', 'm61r16485se4otrup61emr', 'thumb/4486656thumb1535204805.jpg', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(24, 'Entrepreneurship Training for Young Ladies and Women in Ado Ekiti', 'https://bit.ly/2oFb1cu', 'show', '<p>ME INITIATIVES presents Entrepreneurship Training for Young Ladies and Women in Ado Ekiti.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Date: October 18 - 19, 2018.</p>\r\n\r\n<p>Time: 9am Daily.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Register <a href=\"https://bit.ly/2oFb1cu\" target=\"_blank\">Here</a></p>\r\n\r\n<p>&nbsp;</p>', 'uploads/1536689200490181315366884026447258IMG-20180911-WA0025.jpg', 'j90819542aBn72i', '18:05:46', '2018-09-11', '1536689146srerpe858r1tu8enp3etren0ip1h7ro', 'thumb/4497667thumb1536911570.jpg', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(25, 'Professional Pest Control & Funmigation Training (5th Edition)', 'http://training.rotimax.com', 'show', '<p>Rotimax Integrated Services Ltd offers comprehensive pest control and fumigation training throughout Nigeria. Over the years, we have established a solid reputation for effective and quality training. Our pest control and fumigation training solutions are tailored to allow you to become proficient with the latest methods in pest control and pest management, providing you with detailed manuals and practical training on how to safely and legally exterminate rats,mice, mosquitoes ,bed bugs, cockroaches, snakes, tick,lice,flies and the rest.<br />\r\n<br />\r\nOur fumigation and pest control training is endorsed by Environmental health association of Nigeria (E.H.O.A.N) and Pest control association of Nigeria (P.E.C.A.N). We have previously collaborated with government agencies and private bodiesalso i.e Lagos state ministry of Environment, Cleaning practitioners of Nigeria (CPAN) in conjunction with Alcochem Hygiene, Netherlands.</p>', 'uploads/15369183119776789DmgaBMNWsAAZToH.jpg', 'j90819542aBn72i', '09:44:40', '2018-09-14', '15369182809rto49sp9nf7rle9o7sr4o5e3iap', 'thumb/6627602thumb1536918754.jpg', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(26, 'Reporting the Illegal Internet Trade in Wildlife', 'https://www.surveygizmo.com/s3/4567137/Reporting-the-Illegal-Internet-Trade-in-Wildlife-Workshop', 'show', '<p>Thomson Reuters Foundation is offering a training scheme on Reporting the Illegal Internet Trade in Wildlife for journalists from Africa and Asia, in partnership with The Global Initiative Against Organized Crime (GIATOC) funded by the Government of Norway.</p>\r\n\r\n<p>In marketplaces across the world the illegal wildlife trade is booming, and enormous, irreparable damage to biodiversity is occurring. Hundreds of thousands of endangered and legally protected plants, insects and animals are harvested and traded every day to consumers interested in their medical, ornamental, cultural properties, or to keep them as live pets or plants.</p>\r\n\r\n<p>The marketplaces for illegal wildlife products are increasingly virtual and there is an important shift to the marketing and sale of environmental commodities on the internet. As the &lsquo;online&rsquo; aspect of the illegal wildlife trade grows in importance, we will bring together journalists from Africa and Asia to attend this workshop aimed to enable journalists to tell the story of the illegal online wildlife trade.</p>\r\n\r\n<p>The intensive five-day workshop, taking place in Bangkok, Thailand from Monday, 05 November &ndash; Friday, 09 November will build the capacity of journalists to report on the issue of illegal online wildlife trade &ndash; improving both knowledge and skills and also help journalists to present new viewpoints, promote discussion and dialogue on the most strategic areas for intervention.</p>\r\n\r\n<p><strong>WORTH</strong></p>\r\n\r\n<p>Successful applicants will receive a full bursary that will cover air travel expenses (economy class), accommodation, local transfers and meals. Please note that you need to check visa requirements and ensure you have the necessary documentation required. The cost of your visa and any other related costs will be the responsibility of the participant.</p>\r\n\r\n<p><strong>ELIGIBILITY</strong></p>\r\n\r\n<ul>\r\n	<li>This is an opportunity for journalists from across Africa and Asia working for established media organisations.</li>\r\n	<li>Applicants must be full-time journalists or regular contributors to a media organisation.</li>\r\n	<li>Applicants must be able to demonstrate a commitment to a career in journalism in their country, should have at least five years&rsquo; professional experience and have a good level in spoken and written English.</li>\r\n</ul>\r\n\r\n<p><strong>DEADLINE:</strong>&nbsp;September 24 2018</p>', 'uploads/15369191481955119pic-1-5.jpg', 'j90819542aBn72i', '09:57:18', '2018-09-14', '1536919038pr8g2otrror4ein7466p60e4t', 'thumb/7434184thumb1536919211.jpg', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(28, 'Advance Digital Marketing Master Class', 'https://facebook.com/fmgplatform', 'show', '<p>Recession has devalued all forms of money. Come and see how you can advance your career and double the profit of your business. FMG PLATFORM presents DIGITAL MARKETING FOR SMALL BUSINESSES.</p>\r\n\r\n<p>Friday 21st September 2018.</p>\r\n\r\n<p>10am to 3pm<br />\r\nFor inquiries call us on 08109764875.</p>', 'uploads/15372649241633076IMG_20180918_105004.jpg', 'j90819542aBn72i', '09:55:50', '2018-09-18', '1537264550560d36vp9earn3tc7erao49', 'uploads/15372649243025495IMG_20180918_105004.jpg', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(29, 'Greenergie Executive Business Masterclass', 'http://www.greenergie.com.ng', 'show', '<p>Do you wish to start a business, but you don\'t know how to start? Ã°Å¸Â¤â€</p><p>&nbsp;</p><p>Have you started your business, but you are having difficulties in growing it?Ã°Å¸ËœÂ«</p><p>&nbsp;</p><p>Do you want to know proven methods to attract investors to your business?Ã°Å¸â€™Âª</p><p>&nbsp;</p><p>Register now for the upcoming Executive Masterclass in Osun State</p><p>&nbsp;</p><p>Learn more: <a href=\"https://bit.ly/2xkhHBO\">https://bit.ly/2xkhHBO</a></p><p>&nbsp;</p><p>Deadline: 30th Sept, 2018</p><p>&nbsp;</p><p>Limited slots available</p><p>&nbsp;</p><p>Contact us <a href=\"https://api.whatsapp.com/send?phone=2347033239180 \">https://api.whatsapp.com/send?phone=2347033239180&nbsp;</a></p>', 'uploads/15373626415219509IMG-20180917-WA0013.jpg', 'admin7851792597', '12:29:54', '2018-09-19', '153736019452ergeeoeei0trngr74p0r948', 'uploads/15373626411471467IMG-20180917-WA0013.jpg', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(30, 'Web Design Training  ', NULL, 'show', '<p>Boost Your Skills Discover how to be a web developer Join our Web Design Training It\'s 100% Practical</p><p>&nbsp;</p><p>&nbsp;Date: 1st. Ã¢â‚¬â€œ 3rd November 2018 Venue: The Cedar Centre, Lagos Limited seat available Register now at&nbsp;</p><p><a href=\"https://t.co/5iXH8e0q2g\">https://buff.ly/2RJOxVi</a></p><p>&nbsp;Enquiries: 08139112519</p><p>&nbsp;</p>', 'uploads/15396193157479247lonadekweb.jpg', '15396186570fi87788e78m94', NULL, '2018-10-15', '15396193151iegi5rna1t2b14n24w23', 'thumb/15396193155240782lonadekweb.jpg', 0, 'Lonadek', '<p>Boost Your Skills Discover how to be a web developer Join our Web Design Training It\'s 100% Practical</p><p>Date: 1st. Ã¢â‚¬â€œ 3rd November 2018 Venue: The Cedar Centre, Lagos Limited seat available Register now at&nbsp;</p><p><a href=\"https://t.co/5iXH8e0q2g\">https://buff.ly/2RJOxVi</a></p><p>&nbsp;Enquiries: 08139112519</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(32, 'AFRICA OIL & GAS LOCAL CONTENT', NULL, 'show', '<p>The ALC is leaving no stone unturned in <strong>#ALC2018</strong> as it seeks to make a bold statement with this Conference &amp; Exhibition, talking on how the industry can drive increasing actions toward the achievement of the tenants in Oil &amp; Gas.</p><p>&nbsp;</p><p>Date: 26th - 27th November 2018</p><p>&nbsp;</p><p>Venue: Epic Sana Hotel Luanda, Republic of Angola</p><p>&nbsp;</p><p>Sign up today for a 10% coupon at https://bit.ly/2PEyHKr</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 'uploads/15399477685299169ALC.jpeg', '15396186570fi87788e78m94', NULL, '2018-10-19', '1539947768i1c3a4nn0aigirt9ar550f19', 'thumb/15399477682518384ALC.jpeg', 0, 'Lonadek', '<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(33, 'AFRICA OIL & GAS LOCAL CONTENT', NULL, 'show', '<p>The ALC is holding its 2nd Conference &amp; Exhibitions from 26th - 27th Nov. 2018 &nbsp; &nbsp;Venue: Epic Sana Hotel Luanda, Republic of Angola &nbsp; &nbsp;Sign up today for a 10% discount at The African Oil and Gas Local Content Conference and Exhibition in Angola. From 26th - 27th November 2018. register https://bit.ly/2PEyHKr</p>', 'uploads/15401914525716762ALC.jpeg', '15396186570fi87788e78m94', NULL, '2018-10-22', '15401914525c727i3tnfri9agrn052aa3i', 'thumb/15401914523730781ALC.jpeg', 0, 'Lonadek', '<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(34, 'Document Control and Management', NULL, 'show', '<p>Our Lead Document Control and Management training is certified by <a href=\"https://twitter.com/ILM_UK\">@<strong>ILM_UK</strong></a>Ã¢Â â‚¬ This training will hold from Oct.29th-Nov.2nd, 2018 @ the Cedar Centre, Yaba, Lagos. Take charge of your career. For registration Call 08139112519 or Email training@lonadek.com&nbsp;</p>', 'uploads/15402101834059175Document_Control_and_Management_001.jpg', '15396186570fi87788e78m94', NULL, '2018-10-22', '15402101830d1n6rmnctt1u68an257oigie', 'thumb/1540210183808187Document_Control_and_Management_001.jpg', 0, 'Lonadek', '<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(36, 'Learn to Code at Thecodecenter.org', 'http://www.thecodecenter.org', 'show', '<p><strong>FRONT WEB DEVELOPMENT </strong>Duration: &nbsp; &nbsp; &nbsp; 4 Months</p><p>Registration: N20,000</p><p>Training Fee: N300,000</p><p>A Front End Web Developer is responsible for implementing visual and interactive elements that web users engage with through their browsers when using web applications. They work alongside Web Developers, who are responsible for server-side application logic and integration of the work Front End Developers do.</p><p>By the end of this programme, our participants would be able to tick the following boxes as success metrics:</p><p>Possess solid understanding of Web Mark-up Languages Ã¢â‚¬â€œ HTML and CSS</p><p>Can translate Mockups designed by UI/UX people into actual codes</p><p>Solid understanding of server-side CSS pre-processing platforms such as LESS and SASS</p><p>Solid understanding of code versioning tools such as GIT</p><p>Robust portfolio of about 4 to 6 projects that are presentable during job interviews or project bids</p><p>&nbsp;</p><p><strong>SOFTWARE DEVELOPMENT IMMERSIVE</strong></p><p>&nbsp;Duration: &nbsp; &nbsp; &nbsp; 6 Months</p><p>Registration: N20,000&nbsp;</p><p>Training Fee: N600,000</p><p>Our flagship course Ã¢â‚¬â€œ specially designed for school leavers aspiring to study Computer Science or related courses in the University (or any Higher Institution). The goal is to turn them into professional Software Developers such that they would be able to take advantage of the opportunities that await them by the time they eventually gain admission. (However, any interested person can also apply). As with all of our programs intended to turn participants to skilled experts, successful participants of this program are guaranteed an easy navigation of the Computer Science course throughout the University. Feedback from some of the alumni of this course has it that the program helped position them several steps ahead of their colleagues in the University.</p><p><strong>WEB DEVELOPMENT IMMERSIVE</strong></p><p>Duration: &nbsp; &nbsp; &nbsp; 4 Months</p><p>Registration N20,000&nbsp;</p><p>Training Fee: N300,000</p><p>As the online World is largely powered by some vast Internet Technologies, the knowledge of how to develop, deploy and manage Web applications is in such a high demand. As a Web Developer, you use your skills to build Websites and Web Applications; creating products that meet clientsÃ¢â‚¬â„¢ needs. Our Web Development curriculum has been thoughtfully crafted to initiate participants (irrespective of their academic background) into the world of Web Applications development within a space of 16weeks such that by the time they are done, they would be able to tick the following boxes as success metrics</p><p>Can function as an entry-level developer</p><p>Possess hands on knowledge of how to architect the components of an application</p><p>Can elicit project requirements from clients and users</p><p>Can convert ideas into digital form (having worked on multiple projects in the course of their training.</p><p>Can develop and maintain/manage databases</p><p>Can build and test APIs (Application Programming Interfaces) for exchange of data between applications</p><p>Robust portfolio of about 4 to 6 projects that are presentable during job interviews or project bids</p><p>Possession/Development of analytical thinking skills and problem solving mindset</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>USER EXPERIENCE DESIGN</strong></p><p>Duration: &nbsp; &nbsp; &nbsp; 6 Months</p><p>Registration: N20,000&nbsp;</p><p>Training Fee: N300,000</p><p>In this course, we first teach you how to create and style Web Pages using HTML and CSS. Thereafter, we introduce you to design concepts such as how to conduct&nbsp;User Research, how to illustrate design ideas using&nbsp;story boards&nbsp;&amp;&nbsp;process flows, translating these concepts into&nbsp;wireframes,&nbsp;mockups&nbsp;and&nbsp;prototypes&nbsp;that lead to&nbsp;intuitive user experiences; helping you unleash your design creativity. And then, you begin to apply the knowledge obtained so far on real life projects Ã¢â‚¬â€œ both at an individual level and alongside a team of designers and developers</p><p>By the end of this program, our participants would be able to tick the following boxes as success metrics:</p><p>Solid understanding of HTML,&nbsp;CSSand JavaScript</p><p>Ability to create mockups/prototypes using Photoshop, Invision, Adobe XD, Figma for Web and Mobile Applications</p><p>Robust portfolio of about 4 to 6 projects that are presentable during job interviews or project bids</p><p>Possession/Development of analytical thinking skills and problem solving mindset</p><p>Possession of some of the soft skills required to work with a team</p><p>&nbsp;</p><p><strong>JAVA PROGRAMMING</strong></p><p>Duration: &nbsp; &nbsp; &nbsp; 4 Months</p><p>Registration: N20,000&nbsp;</p><p>Training Fee: N300,000</p><p>The Java Programming Language is one of the worldÃ¢â‚¬â„¢s most widely used Computer Programming Language Ã¢â‚¬â€œ ItÃ¢â‚¬â„¢s application most found in Enterprise Software, Embedded Systems and the likes. &nbsp;Our foundational Java Programming Course is a 4-month program designed to help participants establish a solid foundation in the languageÃ¢â‚¬â„¢s paradigm; placing them on a good pedestal for a successful career in Software Development.&nbsp;</p><p>By the end of the program, participants will be able to tick the following boxes as success metrics:</p><p>Possess solid understanding of the J2EE framework, Relational Databases, Object Oriented Analysis and Design</p><p>Develop applications (software) using the Java Programming Language</p><p>Gather requirements/analyze user specifications for Software Projects</p><p>Develop logic flowcharts for Java Programs</p><p>&nbsp;</p><p><strong>ANDROID DEVELOPMENT</strong></p><p>Duration: &nbsp; &nbsp; &nbsp; 3 Months</p><p>Registration: N20,000&nbsp;</p><p>Training Fee: N200,000</p><p>An Android Developer is responsible for developing applications for mobile devices powered by the Android Operating System Ã¢â‚¬â€œ one of the most popular mobile operating systems.</p><p>Our Android Development course is a 3-month intensive program by the end of which participants would be able to tick the following boxes as success metrics&nbsp;</p><p>Participants would be well grounded in the knowledge of Android SDK, its different versions and how to handle different screen sizes</p><p>Participants would possess sound knowledge of Android UI design principles and patterns</p><p>Participants can translate mobile app specification/requirements into codes</p><p>Participants would be familiar with RESTful APIs required to connect Android applications to back-end services</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 'uploads/15402870517313780IMG-20181023-WA0003.jpg', 'e238t723ts7106', NULL, '2018-10-23', '1540287051t38ganir5i1el847364narn', 'thumb/15402870518258608IMG-20181023-WA0003.jpg', 0, 'TheCodeCenter', '<p>TheCodeCenter is a knowlegde factory where we take in people as raw materials and turn them into sought-after technology talents by the end of there program with us.</p><p>Build Lifelong Relationship</p><p>Our learning atmosphere is characterized by strong inter-personal relationships among everyone - more like home away from home.</p><p>Learn Under Veteran Instructors/Practitioners</p><p>Our Instructors are veteran practitioners in their field / naturally talented teachers</p><p>An Eye For The Future</p><p>At the heart of our operations is an obligation to help our participants build a successful career in their chosen course of study with us.</p>', NULL, NULL, 1, NULL, NULL, 'http://www.thecodecenter.org/registration.php', 'thecodecenter'),
(37, 'Women ICTpreneurs Nigeria', 'https://techmeng.org', 'show', '<p>Women ICTpreneurs Nigeria (WIN) is a program by Tech ME is aimed at empowering unemployed young Nigerian women with ICT skills for them to start an income-generating activity. Over a 6 month period, Tech ME will deliver web development and graphic designing training to 60 underserved women. Women ICTpreneurs Nigeria will also bridge the technology gender gap in Nigeria by training more women to be techpreneurs.</p><p>Women ICTpreneurs Nigeria supports the UN Sustainable Development Goal 1 (No Poverty) Goal 5 (Gender Equality), Goal 8 (Decent Work and Economic Growth).</p>', 'uploads/15404988365768505IMG_20181025_211400_108.JPG', 'e238t723ts7106', NULL, '2018-10-25', '15404986449wita1626em0g76irn67onn', 'uploads/15404988368727824IMG_20181025_211400_108.JPG', 0, 'TECH Me', '<p>Tech ME is a non-profit organisation leveraging technology to solve social issues. Our core focus areas are; education, entrepreneurship and civic engagement. Since inception, we have implemented coding training for teenagers and empowered youth and women with ICT skills to start their own business. Our programs have directly imparted more than 1000 lives.</p>', 'techmeicthub', 'techmeicthub', NULL, NULL, NULL, NULL, NULL),
(38, 'AFRICA OIL & GAS LOCAL CONTENT', NULL, 'show', '<p>Become acquainted with key terminologies and techniques in addition to obtaining international certification, through our training in Integrated Cost Engineering, Estimating, Planning &amp; Scheduling Register now call 08139112519 or enquiries.</p>', 'uploads/15405494842569733AACE_Cost_Scheduling_Training_002.jpg', '15396186570fi87788e78m94', NULL, '2018-10-26', '1540549484aa7r1ainngf58919it36r2ic', 'thumb/15405494847018334AACE_Cost_Scheduling_Training_002.jpg', 0, 'Lonadek', '<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(39, 'Document Control and Management', NULL, 'show', '<p>We offers value-adding, expertly facilitated, and cost-friendly training in Lead Document Control and Management Training for all interested participants. Call us today on +2348139112519 for more info.</p>', 'uploads/15405495558796200Document_Control_and_Management_001.jpg', '15396186570fi87788e78m94', NULL, '2018-10-26', '15405495553giec15a9r5mt6ntndo0n5i9u', 'thumb/15405495555623791Document_Control_and_Management_001.jpg', 0, 'Lonadek', '<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(41, 'ENTREPRENEURSHIP, INTRAPRENUERSHIP AND DIGITAL SKILLS FOR BUSINESSES AND CAREER (For Women)', NULL, 'show', '<p>HEIR WOMEN DEVELOPMENT</p><p>In view of the World Entrepreneurship Week, HEIR WOMAN is organizing a workshop for women development which is Focused on ENTREPRENEURSHIP, INTRAPRENUERSHIP AND DIGITAL SKILLS FOR BUSINESSES AND CAREER.&nbsp;</p><p>Venue : American Corners Abuja. National Center for Women Development. Central Business District, Abuja.</p>', 'uploads/15416393145121040DraO1soW4AA_Q7A.jpg', 'e238t723ts7106', NULL, '2018-11-08', '1541639314n50nuene9rhrs66r3p3niii7agt5repe5t', 'thumb/15416393148805041DraO1soW4AA_Q7A.jpg', 0, 'HEIR WOMEN DEVELOPMENT', '<p>HEIR WOMEN DEVELOPMENT</p><p>In view of the World Entrepreneurship Week, HEIR WOMAN is organizing a workshop for women development which is Focused on ENTREPRENEURSHIP, INTRAPRENUERSHIP AND DIGITAL SKILLS FOR BUSINESSES AND CAREER.&nbsp;</p><p>Venue : American Corners Abuja. National Center for Women Development. Central Business District, Abuja.</p>', NULL, NULL, 1, NULL, NULL, 'https://docs.google.com/forms/d/e/1FAIpQLSdloTySUaWfBw-uXLqD10dvFY2EzouvhruO5GoqjahYK_HQ-g/viewform', 'HeirWomen'),
(42, 'Sedab Skill Acquisition Programme', NULL, 'show', '<p>Sedab Impact House brings a Great Opportunity to all ADO-EKITI residents to become a PRO in TWO Months on one of these Skills:.</p><p>- Bag Design<br>- Fashion Design<br>- Shoe Design<br>- Makeup &amp; Auto Gele<br>- Hair Making<br>- Cake Baking and Design<br>- Graphics Design<br>- Web Design<br>- Solar Power Building<br>- Wall Painting</p><p>Embrace this Affordable and Reformable opportunity to Master a SKILL.</p><p>Training Date: 26th November, 2018 - 2nd February, 2019.</p><p>Training Venue: Sedab House, 8 Orire Hospital Lane, By the New Total Filling Station, Adebayo - Ado Ekiti.</p><p>Training Schedule:<br>Weekdays: Monday\'s - Thursday\'s.</p><p>Weekends: Friday\'s &amp; Saturdays ( For Students and Working Class).</p><p>Pick your Registration Form for #1,000 @ Sedab House, Along Orire Hospital Road, Adebayo, Ado-Ekiti.</p><p>Training Fee: #10,000.</p><p>Call: 08123804028 or 08068610522 for more details...</p><p>Terms and Conditions Apply...</p>', 'uploads/1541664148576557DrbwKNWXcAI0rP7.jpeg', 'e238t723ts7106', NULL, '2018-11-08', '1541664148i86d5rnn0gb3a8aes71i0t9', 'thumb/15416641483685459DrbwKNWXcAI0rP7.jpeg', 0, 'Sedab Impact House', '<p>Sedab Impact House is a seasoned human capital and business enhancement impact based NGO geared with a vision to discover, equip and position individuals with business entrepreneurial skills and deploying them as assets to the society.</p><p>Sedab Skill Acquisition Programme started since 2012 with our first training in Ekiti State University and has since also held multiple trainings in Lagos, Ogun and Ondo State, deeply touching thousands of lives and has lots of testimonies resulting from this vision.</p><p>Our goal transform every individual we come in contact with from knowing little or nothing to becoming a Businesspreneur.</p>', 'sedabimpacthouse', 'sedabimpact', 1, 1000, '2019-01-31', NULL, 'SedabMasterClass'),
(43, 'Global Entrepreneurship Week Digital Training', NULL, 'show', '<p>Google inc is organizing a free 1 day digital training on the 12th November 2018 @ AEA Entrepreneurial Complex, Plot 74, Zone B15, Jahi, Abuja. CONTACT 08160307118</p>', 'uploads/15416671334103606Dra6OMwWkAYX97O.jpg', 'e238t723ts7106', NULL, '2018-11-08', '1541667133i6an0l85n3a1bito6r2gl5g', 'thumb/15416671333437542Dra6OMwWkAYX97O.jpg', 0, 'Abuja Enterprise Agency', '<p>Abuja Enterprise Agency (AEA) is the FCT vehicle for Small and Medium Enterprise (SME) development and poverty reduction. It was set up by the Federal Capital Territory Administration (FCTA) in collaboration with the Small and Medium Enterprises Development Agency of Nigeria (SMEDAN), and with support of the United KingdomÃ¢â‚¬â„¢s Department for International Development (DFID). The Agency as a fall out of implementing the FCT Economic Empowerment and Development Strategy (FEEDS) agenda was established in 2005 and was officially commissioned in February 2006. The Agency focuses on the development of micro, small and medium enterprises within the Federal Capital Territory (FCT), and aims to assist new and existing entrepreneurs to overcome obstacles to growth through access to finance, proper business planning, developing entrepreneurship skills, suitable work-space etc.</p><p>&nbsp;</p><h4>OUR MISSION</h4><p>To provide excellent support services by developing relevant programmes and activities to start and nurture Micro, Small and Medium Enterprises (MSMEs)</p><h4>OUR VISION</h4><p>To be the symbol of Entrepreneurial Development in Africa</p><h4>OUR CORE VALUES</h4><p>Integrity, Respect, Innovation, Excellence</p>', NULL, 'AEAtwit', NULL, NULL, NULL, NULL, 'AEADIGITALTRAINING'),
(44, 'Digital Marketing Training Class 12.0 [DMTClassNG]', 'http://bit.ly/dmtclassng', 'show', '<p>Digital Marketing Training Class (DMTClassNG) is an intensive practical training geared toward expatiating what Digital Marketing is all about, how it works, how it can be used for brand awareness and increase business sales and profit.</p><p>Digital marketing is soaring in popularity because it is not only a rapidly growing force in the current marketing playing field but it is set to be the future of marketing in general.</p><p>Digital Marketing Training Class (DMTClassNG) aims at enabling Small and Medium Scale business owners know the important of Digital Marketing and how it can be used at attract prospective clients and turning these clients into loyal paying customers.</p><p>Digital Marketing Training Class (DMTClassNG) also aims at grooming individuals who will become world class Digital Marketing Experts.</p><p>Digital Marketing Training Class (DMTClassNG) is powered by Absolute Hearts Media, Nigeria\'s foremost Digital Marketing and Online Media company.</p><p>Courses to be taught include:<br>1. Introduction to Digital &amp; Social Media Marketing<br>2. SMS &amp; WhatsApp Marketing<br>3. Information Marketing<br>4. Email Marketing</p><p>5. SOCIAL MEDIA MARKETING:<br>a. Gaining Marketing edge with Social Media Marketing<br>b. Learning how to deploy social media tools (and automation tools) for business profit<br>c. The Social Media selling approach<br>d. Influencer marketing<br>e. Practicals on how to launch effective Social Media Sponsored Ads (Campaigns).<br>f. Intensive practical session on Social Media marketing, how to build social media pages to get huge followership &amp; social media optimization<br>g. Understanding Social Media analytics to measure business growth</p><p>6. SEARCH ENGINE OPTIMIZATION&nbsp;<br>a. Strategies to bring your website/brand on Google\'s first page&nbsp;<br>b. Pay Per Click Advertising (Google Adwords)</p><p>7. Blogging &amp; Content Marketing<br>a. Introduction to Blogging and Content Marketing<br>b. Practicals on setting up a professional blog<br>c. Managing a professional blog<br>d. Tools needed for Blogging<br>e. Monetizing your blog (making money from your blog)<br>f. Using Blogging a grow your business sales and awareness</p><p>8. In-depth revelation on opportunities in digital marketing and the digital space at large and how to start a profitable career in any of them (including social media marketing, Mobile Marketing/Bulk SMS, Blogging, Web Designing, SEO, Affiliate Marketing, Information Marketing, Email Marketing, etc).</p><p>9. How to build your own Digital Marketing Agency in 30 days and how to make Digital Marketing Agency profitable, bankable and trustworthy.</p><p>Bonus Courses (NEW)<br>1. Imagery (Designing images on your own)<br>2. Video creation (Creating videos on your own)</p><p>Other benefits of the training:<br>1. Participants will be awarded certificates at completion of the training.<br>2. Participants will be given access to private Digital Marketing mentoring Whatsapp and Facebook groups<br>3. Participants will also be given learning materials at the end of the training.</p><p>Date: January 26th and 27th 2019.<br>Saturday: 9am | Sunday: 2pm.<br>Venue: The Glass House. 1, Adegbeyeni Street, Behind Old Alade Market, Allen, Ikeja, Lagos.</p><p>Training fee: N20,000 (If payment is made on or before January 18th and N40,000 thereafter or at training venue)<br>You also get a FREE DATABASE GIFT worth N10,000 at the training venue.</p><p>For inquiries: 08027922363 (Call, WhatsApp)</p><p>Register here <a href=\"http://bit.ly/dmtclassng\">http://bit.ly/dmtclassng </a>&amp; proceed to make your payment. (You\'ll receive payment details via email after registering).</p>', 'uploads/15447951454886746DMTC.png', '1544793563df6a5lb09e3a74ze6hu5', NULL, '2018-12-14', '1544795145a2rn1igi0aldn378tit09i4g5', 'thumb/15447951457726184DMTC.png', 1, 'Absolute Hearts Media', '<p>Absolute Hearts Media is a full blown Digital Marketing, Online Media and Brand Strategising company located in Lagos, Nigeria. We are also the owners of: 1. Digital Marketing Training Class (DMTClassNG) - A Digital Marketing Training Institute 2. Absolute Hearts Blog - A lifestyle and entertainment website (www,absolutehearts.com)</p>', 'dmtclassng', 'dmtclassng', 1, NULL, NULL, 'http://bit.ly/dmtclassng', 'DMTClassNG'),
(45, 'Continuous Professional Development Training', NULL, 'show', '<p><a href=\"https://twitter.com/LonadekInc\"><strong>LonadekInc</strong></a> is bringing you another productive training session in Continuous Professional Development This training is to enhance the knowledge and skills you need to deliver a professional service to your clients Registration send email to training@lonadek.com</p>', 'uploads/1548063499357528Continuous_Professional_Development.jpg', '15396186570fi87788e78m94', NULL, '2019-01-21', '15480634992591ot2canu9inrt2n1so3nuigi8', 'thumb/15480634994987140Continuous_Professional_Development.jpg', 0, 'Lonadek', '<p><a href=\"https://twitter.com/LonadekInc\"><strong>LonadekInc</strong></a> is bringing you another productive training session in Continuous Professional Development This training is to enhance the knowledge and skills you need to deliver a professional service to your clients Registration send email to training@lonadek.com</p>', NULL, NULL, NULL, NULL, NULL, NULL, 'LonadekInc'),
