(47, 'NEBOSH', NULL, 'show', '<p>Become international <a href=\"https://twitter.com/hashtag/safety?src=hash\">#<strong>safety</strong></a> expert. Get a <a href=\"https://twitter.com/hashtag/global?src=hash\">#<strong>global</strong></a> <a href=\"https://twitter.com/hashtag/certification?src=hash\">#<strong>certification</strong></a> in <a href=\"https://twitter.com/hashtag/health?src=hash\">#<strong>health</strong></a> and <a href=\"https://twitter.com/hashtag/safety?src=hash\">#<strong>safety</strong></a> skills Register at <a href=\"https://t.co/PiBEcVPUsk\">http://bit.ly/2A3XIsF</a> Enquiry call 08139112519 or send email to training@lonadek.com</p>', 'uploads/15480637219056136Lonadek_NEBOSH_Advert_0000002.jpg', '15396186570fi87788e78m94', NULL, '2019-01-21', '15480637211iohn80a5brenn4t17sg15i5', 'thumb/15480637216155447Lonadek_NEBOSH_Advert_0000002.jpg', 0, 'Lonadek', '<p>Become international <a href=\"https://twitter.com/hashtag/safety?src=hash\">#<strong>safety</strong></a> expert. Get a <a href=\"https://twitter.com/hashtag/global?src=hash\">#<strong>global</strong></a> <a href=\"https://twitter.com/hashtag/certification?src=hash\">#<strong>certification</strong></a> in <a href=\"https://twitter.com/hashtag/health?src=hash\">#<strong>health</strong></a> and <a href=\"https://twitter.com/hashtag/safety?src=hash\">#<strong>safety</strong></a> skills Register at <a href=\"https://t.co/PiBEcVPUsk\">http://bit.ly/2A3XIsF</a> Enquiry call 08139112519 or send email to training@lonadek.com</p>', NULL, NULL, NULL, NULL, NULL, NULL, 'safetylonadek'),
(48, 'Up Your Game', NULL, 'show', '<p>Learn digital marketing skills Discover how to run Facebook camping How to target the right audience How to run cheap ads How to boost your business online and many more To attend, register at <a href=\"https://t.co/91uUV1P6CP\">https://bit.ly/2MmaSG8</a> Date: 9th Feb. 2019 Inquiry call: 08164339275</p>', 'uploads/15482352444044380Up_Your_Game_Advert__005.jpg', '15396186570fi87788e78m94', NULL, '2019-01-23', '1548235244ningi0pt334a6u69r199', 'thumb/15482352448052964Up_Your_Game_Advert__005.jpg', 0, 'Lonadek', '<p>Learn digital marketing skills Discover how to run Facebook camping How to target the right audience How to run cheap ads How to boost your business online and many more To attend, register at <a href=\"https://t.co/91uUV1P6CP\">https://bit.ly/2MmaSG8</a> Date: 9th Feb. 2019 Inquiry call: 08164339275</p>', NULL, NULL, NULL, NULL, NULL, NULL, 'UpYourGame'),
(49, 'IBM D-NA workshop', NULL, 'show', '<p>WeÃ¢â‚¬â„¢re pleased to announce IBM D-NA workshop.&nbsp;<br>Let\'s help you reach your 2019 goals by growing your career and businesses using digital skills.&nbsp;<br>Lonadek\'s Cedar STEM &amp; Entrepreneurship Hub (CSEH) is hosting IBM D-NA workshop. &nbsp;<br><br><br>Learn skills like;&nbsp;<br>- Cloud Technology&nbsp;<br>- Data Analytics&nbsp;<br>- BlockChain&nbsp;<br><br>- Internet of Things&nbsp;<br><br>- Artificial Intelligence etc.&nbsp;<br>IBM D-NA workshop is a 3 hour workshop facilitated by Lonadek Incorporated. If you are interested in acquiring 21st century skills for employability, &nbsp;<br><br><br><br>business growth or you are just looking to expand your skills in emerging technologies, then you should apply for this opportunity.&nbsp;<br>For every course you successfully complete, an IBM Digital Badge will be issued, which you can share on social media platforms like LinkedIn. &nbsp;<br><br><br><br>More importantly, as a registered D - NA user, you are entitled to a free IBM Cloud Lite account.&nbsp;<br>Opportunities are available to register for the Morning OR Afternoon Sessions.&nbsp;<br>Date: 8th February 2019&nbsp;<br>Venue:The Cedar stem and Entrepreneurship Hub 12, Jibowu street Yaba Lagos.&nbsp;<br><br><br><br>To attend, kindly register at https://lnkd.in/d63sqtP&nbsp;<br>For enquires call 08164339275 or send an email to info@thecedarcentre.org&nbsp;<br>#Cloudtechnology #Dataanalytics #digitalskills #blockchain #WednesdayMotivation #wednesdaywisdom #wednesdaythoughts #MellowWednesday #IBMCloud&nbsp;</p>', 'uploads/15488345715832269Dx5uOvxWsAAl6Ot_(1).jpg', '15396186570fi87788e78m94', NULL, '2019-01-30', '1548834571t45n0bnr1gi0m9ia703i6', 'thumb/2948139thumb1551395028.jpg', 1, 'Lonadek', '<p>WeÃ¢â‚¬â„¢re pleased to announce IBM D-NA workshop.&nbsp;<br>Let\'s help you reach your 2019 goals by growing your career and businesses using digital skills.&nbsp;<br>Lonadek\'s Cedar STEM &amp; Entrepreneurship Hub (CSEH) is hosting IBM D-NA workshop. &nbsp;<br><br><br>Learn skills like;&nbsp;<br>- Cloud Technology&nbsp;<br>- Data Analytics&nbsp;<br>- BlockChain&nbsp;<br><br>- Internet of Things&nbsp;<br><br>- Artificial Intelligence etc.&nbsp;<br>IBM D-NA workshop is a 3 hour workshop facilitated by Lonadek Incorporated. If you are interested in acquiring 21st century skills for employability, &nbsp;<br><br><br><br>business growth or you are just looking to expand your skills in emerging technologies, then you should apply for this opportunity.&nbsp;<br>For every course you successfully complete, an IBM Digital Badge will be issued, which you can share on social media platforms like LinkedIn. &nbsp;<br><br><br><br>More importantly, as a registered D - NA user, you are entitled to a free IBM Cloud Lite account.&nbsp;<br>Opportunities are available to register for the Morning OR Afternoon Sessions.&nbsp;<br>Date: 8th February 2019&nbsp;<br>Venue:The Cedar stem and Entrepreneurship Hub 12, Jibowu street Yaba Lagos.&nbsp;<br><br><br><br>To attend, kindly register at https://lnkd.in/d63sqtP&nbsp;<br>For enquires call 08164339275 or send an email to info@thecedarcentre.org&nbsp;<br>#Cloudtechnology #Dataanalytics #digitalskills #blockchain #WednesdayMotivation #wednesdaywisdom #wednesdaythoughts #MellowWednesday #IBMCloud&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, NULL, 'Lonadekibmworkshop'),
