INSERT INTO `insight` (`id`, `title`, `author`, `category`, `visibility`, `body`, `image_1`, `created_by`, `time_created`, `date_created`, `hash_id`, `thumbnail`, `notification_status`) VALUES
(12, 'WORKPLACE ETHICS: 9 THINGS YOU SHOULD KNOW', 'TheAATS', 'f429639e6Ltiyel5s06', 'show', '<p>What comes to your mind when you hear Workplace Ethics? Some big laid down rules or an inexhaustible list of DOs and DONTs? Well, it could be either.</p><p>In this piece, we would help you unbox the whole big confusing grammar around workplace ethics, give you better understanding of how it would help you as an individual and then proceed to rub off on your team/organisation.</p><p>To start off, <strong>Ethics in the workplace</strong> is a set of guidelines, rules, values and standards based on what have been agreed to be good or bad. These are considered to be inexcusable and would contribute to the success of the company or achieving goals of the department. It is not impossible to have different set of moral codes for various departments in the same organisation, all not falling out of place from what have been stated as vision and mission of the organisation.</p><p>Just like it is for the whole organisation, itÃ¢â‚¬â„¢s the same for the department, as values and codes reflect the beliefs of the business owner or team lead.</p><p>&nbsp;</p><p>Guidelines and set of codes differ from one business to another, however, as an employee, your first display of Workplace Ethics is adapting to and following the rules made available in your place of your work.</p><p>&nbsp;</p><p>Before I proceed to share with you how it would help you as an individual, letÃ¢â‚¬â„¢s see a checklist of some things to avoid.</p><p>&nbsp;</p><p><strong>Be punctual and attend meetings promptly.</strong> Always get to work very early, if you are primed for it, get to work few minutes earlier than everyone else. It gives you enough time to get into your stride. Brian Tracy advised that this can make you a millionaire if you practice it well. See his 21 rules for making Millionaires on that advise. Ensure you are not the reason meetings would end late because they are doing Ã¢â‚¬Ëœrecap for those that missed the first sessionÃ¢â‚¬â„¢.</p><p><strong>DonÃ¢â‚¬â„¢t joke with deadlines.&nbsp;</strong>Always meet your deadline and when you canÃ¢â‚¬â„¢t, send a prior notice. Deadlines are the soul of work. How well you deliver them shapes how well business would move. This would in turn increase clientÃ¢â‚¬â„¢s confidence. In case you wonÃ¢â‚¬â„¢t be able to deliver as promised, send a notice before the deadline.</p><p><strong>No Gossip.&nbsp;</strong>Avoid office gossip as much as you can. No one is saying donÃ¢â‚¬â„¢t make friends. Please, donÃ¢â‚¬â„¢t come and talk about co-workerÃ¢â‚¬â„¢s failed relationship or failed sport bet in the office. It would sapp! your energy.</p><p><strong>ItÃ¢â‚¬â„¢s Official&nbsp;</strong>DonÃ¢â‚¬â„¢t go home with official files. Did I hear you say really? Yes, really. The official files should be left in the office. ItÃ¢â‚¬â„¢s called <i>official</i> for a reason. Oh, yes, soft copies not included.</p><p><strong>Partners?&nbsp;</strong>DonÃ¢â‚¬â„¢t brood about a partner you donÃ¢â‚¬â„¢t like. You know how you complain about this partner while working together? How you try to avoid the person at all cost? No! File an official complaint if your partner is not diligent.</p><p><strong>Office romance?</strong> How can I tell you not to fall in love? Well, we canÃ¢â‚¬â„¢t tell our hearts some things but avoid it.</p><p>&nbsp;</p><p><strong>DonÃ¢â‚¬â„¢t use</strong> office items for personal endeavours. Seek permission from relevant office if you must.</p><p><strong>Chain of command?&nbsp;</strong>DonÃ¢â‚¬â„¢t joke with hierarchy even if you are the one who interviewed the person that is now your boss.</p><p>Unless you have started your own thriving business, donÃ¢â‚¬â„¢t show your boss the middle finger.</p><p><i><strong>How Workplace Ethics help you.&nbsp;</strong></i></p><p>A major constituent of workplace ethics and behaviour is integrity, or being honest and doing the right thing at all times. Integrity is not doing the right thing only when people are watching. It is also doing the right thing when the boss is not around and you probably wonÃ¢â‚¬â„¢t have a direct gain from the result. After all, itÃ¢â‚¬â„¢s right, do it and do it right.</p><p>Often times, we want to get carried away with the arrogant fact that we are helping our boss to get paid without due recourse to the fact that we get paid for what we do and get better at them. This is to mean whatever we do in our places of work, they help us grow, gain expertise and Ã¢â‚¬Å“increase our shareÃ¢â‚¬Â in the revenue sharing.</p><p>Adhering religiously to our workplace ethics helps to build character and develop the strength we need to face challenges in life.</p><p>A worker that loves her co-workers and push them to do better would definitely raise a fantastic family and become a great CEO one day, if she so desires.</p><p>It also helps us to manage resources Ã¢â‚¬â€œ human and capital very well and boosts oneÃ¢â‚¬â„¢s emotional intelligence.</p><p>The above importance rubs off on our team/organisation and increases our client base through referrals from satisfied customers and more revenue.</p><p>It is important to note, that workplace ethics goes beyond the rules we have pinned on the walls or boards. They are more of what we communicate by actions than what we shout about at the top of our voices.</p><p>Refine your workplace ethics and grow steadily to the level you want in your career.</p><p>Source: <a href=\"https://aatsarumi.com.ng\">TheAATS</a></p>', 'uploads/3286155business_ethics.jpg', 'admin7115698293', '12:06:05', '2018-04-18', 'insight4PER5L0K5CW26O83A12', '', NULL),
(13, 'YOUR PAST AND THE FUTURE: STEPPING STONES FOR SUCCESS Ã¢â‚¬â€œ FEMI FOLORUNSHO (PROTEGE)', 'TheAATS', 'n237is81073p54inOo', 'show', '<p>Just by having the mind set, you create the money-set. By making your wealth a priority and treating it with the same care and concern you would treat those people or organization closest to you, you foster new growth. Imagine what it would be like to inherit #2billion.</p><p>Find an old check book and actually write out checks to spend or invest the entire #2billion of your imaginary inheritance. Let your heart make the decision. DonÃ¢â‚¬â„¢t read further until youÃ¢â‚¬â„¢ve done this. I also hope you have read the previous <a href=\"https://aatsarumi.com.ng/2018/01/01/your-past-and-the-future-stepping-stones-for-success-femi-folorunsho-protege/\">discussion.</a>&nbsp; &nbsp;Then Join us in the next paragraph.</p><p>WeÃ¢â‚¬â„¢ve got a secret to share. HereÃ¢â‚¬â„¢s the secret. That two billion is not just an imaginary wish. YouÃ¢â‚¬â„¢ve already inherited it. Yes. YouÃ¢â‚¬â„¢re already worth at least a hundred million. What?! &nbsp;You say. Ã¢â‚¬Å“Where is it? Show me the money!Ã¢â‚¬Â You already possess it. ItÃ¢â‚¬â„¢s inside you and all around you. Now! Your fortune is hidden in plain sight. Sound crazy? Okay. Scale that number down.</p><p>Strike off two or three zeroes. How much would that leave you? &nbsp; Look around you, add up the profits made by people who sold you stuff thatÃ¢â‚¬â„¢s in your House right now and youÃ¢â‚¬â„¢re looking at a minimum of #1million naira. Doubt that? How much profit did the company that sold you your carpets and flooring make in the past ten years? What about your cell phone? Just off that one device alone. In fact, if you really tracked it down, the companies that were responsible for creating all of the stuff in your current lifestyle have generated billions on profit over the years. &nbsp; Why canÃ¢â‚¬â„¢t you peel off just a silver of that for yourself? Not just imaginary money. WeÃ¢â‚¬â„¢re talking cash! In your pocket, Interested? Every single thing you see in your current living space made someone a fortune. You might be barely making ends meet at this time. Maybe youÃ¢â‚¬â„¢re unemployed. Or deep in debt. But the stuff all around you (even if you live in a cramped apartment) made someone a fortune. ItÃ¢â‚¬â„¢s probably still making them fortunes.</p><p>Hold that thought. As an entrepreneur, youÃ¢â‚¬â„¢re on the lookout for things that you can sell to people. &nbsp; &nbsp;</p><p>&nbsp;</p><p><strong>SOURCE:</strong> <a href=\"https://aatsarumi.com.ng/2018/01/18/your-past-and-the-future-stepping-stones-for-success-femi-folorunsho-protege-2/\">TheAATS</a></p>', 'uploads/85844621_Q70hUe5dAZD3gz9GG1HH5w.jpeg', 'admin7115698293', '12:57:54', '2018-04-18', 'insight730RUO753Y425', '', NULL),
(14, '#YOUTHNOW: 3 THINGS WE MUST DO TO MAKE OUR VOICES HEARD', 'The AATS', 'f429639e6Ltiyel5s06', 'show', '<p>Today, all across the globe, young people in my age bracket are celebrating. We are celebrating our involvement in democratic systems. We are celebrating the opportunity to participate in democratic processes Ã¢â‚¬â€œ the little chance we have had to contribute our quota to strengthen systems in our various capacities around the world.&nbsp;</p><p>Today, there is victory for my generation around the globe and we do not take it for granted. As much as we can, we celebrate with them and we celebrate ourselves. As much as we might not have Macrons in Nigeria or a kurz in my country, we have young people who are braving the odds to ensure that our voices are heard, individually and also as a nation of greats.&nbsp;</p><p>While the environment, as made by the government, has ensured that we get constrained, many young people are rising above hate, religion and ethnic bigotry to ensure that our efforts are not drowned in the thick of NigeriaÃ¢â‚¬â„¢s unfortunate leadership system.&nbsp;</p><p>If we must rise beyond rhetorics into a true place of leadership and political involvement and show that it is truly YOUTH NOW, we must focus on these three (3) things as we go forth.&nbsp;</p><p>GET EDUCATION:&nbsp;</p><p>In Nigeria today and most nations of the African continent, the people are beginning to downplay the importance of education. Our society now focus on making money in whatever means possible, promote pop culture and celebrate wealth in place of merit and values. The society has also taken pride in putting down efforts of those trying to make ends meet in a tough terrain.&nbsp;</p><p>In Nigeria of today, people refer to the Bill Gates that dropped out of school and became world richest man without exploring all parts of the story.&nbsp;</p><p>If the Nigerian youth must have a voice that canÃ¢â‚¬â„¢t be buried in the hues of the world, we must focus on educating our generation. Drive one another to acquire skills and knowledge, we must learn how economies work, understand human resource management and ensure that we learn how to be disciplined and focused.&nbsp;</p><p>If we must ensure that the world trust us to manage our own affairs, we must put all our efforts, as much as we can afford, into learning. We must also be able to provide solutions to varying world problems, starting from the ones in our immediate environments.&nbsp;</p><p>While it might sound like getting education, it is actually a different rope. As young people, with time fading away fast, we cant wait until we are Ã¢â‚¬Å“readyÃ¢â‚¬â„¢Ã¢â‚¬â„¢ to start making our moves. Right from today, we must take opportunities available to show our competencies while we also use that time to learn about the things we have little knowledge.</p><p>It is advisable that we volunteer for leadership roles when such are needed. We have seen that youth led groups are waxing stronger in Nigeria and around the world and these groups are viable platforms for us to get better. PICK A SIDE You wonder if there is a side to pick? Of course, there are two sides and we must pick one, I sincerely hope that we would all be on the same side Ã¢â‚¬â€œ the side of the youth who trust in the leadership abilities of the youth.&nbsp;</p><p>We must trust in one another to help move Nigeria, Africa and the world at large, to a better place. The youth must see themselves as one and ignore the battles generations before them are trying to draw into. We are not part of it and we want none of it. If our voices must be heard, across board, we must join forces together and encourage one another. It is YOUTH NOW and we must be a part of it.</p><p>&nbsp;</p><p><strong>SOURCE:</strong> <a href=\"https://aatsarumi.com.ng/2017/10/18/youthnow-3-things-we-must-do-to-make-our-voices-heard/\">TheAATS</a></p>', 'uploads/1219852FB_IMG_1508309748742-810x456.jpg', 'admin7115698293', '13:51:17', '2018-04-18', 'insight4Y691OOH229N6UT71W', '', NULL),
(15, 'What Exactly Are Doctors Doing In Nigeria?', 'MAYOWA TIJANI', 'n237is81073p54inOo', 'show', '<p><i>It was the night of December 22, 2002. I was rushed to the University College Hospital (UCH), Ibadan. I was terribly sick; the hospital had no oxygen as at the time I was admitted, and I was severely low on oxygen. I missed a date with death by a few seconds. I needed a miracle and God showed up -- it was a medical miracle.</i></p><p>My packed cell volume (PCV), which is the volume percentage of red blood cells in blood, was at five percent, about seven times less than what was expected. I was medically damaged. I had suffered in the days leading to this eventual admission. I was only 12.</p><p>I remember all that pain and trauma like it happened yesterday. The sickness was not all that was wrong; the tears flowing down my strong mother\'s eyes broke my spirit. My father braved it all, but I knew he was hurt beyond words. My favourite&nbsp;aunt, was a nurse at UCH, she helped in ways she could, and periodically told me to be strong. She too was torn beyond words. My family was in pain, and I was the cause of it. I blamed myself.</p><p>I was one of the eldest children at Otunba Tunwase Children\'s Emergency Ward. I was not scared of death, but I was scared of the pain it would put all these people through. The money my parents had spent, the love my siblings had shown, the care my aunt and cousins showered to this dying boy -- I was scared of letting all that go to waste. So I fought for my life, and begged that God kept me strong and healthy for them. I survived, thanks to God and his messengers, who were in the form of skilled doctors.</p><p>My survival was made possible through the seasoned hands and steady minds of the likes of Professor&nbsp;Yetunde Aken\'ova, Dr. Taiwo Kotila and many other medical specialists who beat the conditions of their employment to save lives in Nigeria\'s under-served hospitals.</p><p>Based on this, and some other social experiences,&nbsp;Nigeria is personal for me; it is not my ambition to see a better Nigeria, it is a calling, a responsibility. So when I am making demands on government and policymakers to act on one issue or the other, I am not being political, I am not trying to be correct, I am just simply asking that they put facilities in place to make Nigerians need fewer miracles.</p><p><strong>THE CRISIS ON OUR HANDS</strong></p><p>Today,&nbsp;<a href=\"http://saharareporters.com/2018/05/07/updated-buhari-spend-four-days-uk-his-doctor\">President Muhammadu&nbsp;Buhari is in the United Kingdom</a>, treating an unknown ailment. I want to believe it is not just because he is president. As a former head of state, if he was not president today, and he takes ill, he would most probably go to the same doctors in the UK -- because he has little or no faith in our medical system, and then we may not blame him as much as we do today.</p><p>But Buhari is really not my worry today. My grouse is with the system that produces his ilk.</p><p>There is a crisis in Nigeria\'s healthcare system, and for today, my focus will be on the doctors. As far back as 2010,&nbsp;<a href=\"https://data.worldbank.org/indicator/SH.MED.PHYS.ZS?locations=NG\">World Bank data</a>&nbsp;have shown that Nigeria has one doctor to 2,531 people. The World Health Organisation prescribes one doctor to 600 people. The likes of Mexico, Mongolia, Australia, United States, United Kingdom, Italy, Spain and even Libya meet the WHO requirement. And many of them do so on the backs of Nigerian doctors abroad.</p><p>This means that the Nigerian doctor works at least four times more than his counterpart in any of these countries and earns way less than they do. The numbers are even worse today. We have about one doctor to over 6,000 Nigerians.</p><p>There is, therefore, no reason to wonder why a poll conducted by NOI polls and Nigeria Health Watch in 2017 found that&nbsp;<a href=\"http://www.noi-polls.com/root/index.php?pid=447&amp;ptid=1&amp;parentid=14\">88 percent -- almost nine in 10 -- Nigerian doctors were actively seeking an opportunity to go abroad</a>&nbsp;to practice. At the time the survey was conducted, a majority of Nigerian doctors were -- and are currently -- registered for medical exams like PLAB in the UK, USMLE for the United States, MCCE for Canada, AMC for Australia and DHA for Dubai. Most of our best minds are leaving!</p><p><strong>5,264 NIGERIAN DOCTORS WORKING IN THE UK</strong></p><p>Most recently, Chief Emeka Anyaoku, former Commonwealth Secretary-General, said 4,795 Nigerian doctors were currently working in the UK. Making specific reference to July, 2017. According to the UK General Medical Council, holding data on doctors in the UK, 5,250 Nigerian doctors were working in the UK as at April 25, 2018.</p><p><a href=\"https://data.gmc-uk.org/gmcdata/home/#/reports/The%20Register/Stats/report\">Checking the same data today</a>, May 5, 2018, that number has grown to 5,264 -- an increase of 14 doctors in 10 days. Africa Checks has shown that&nbsp;<a href=\"https://africacheck.org/spot-check/nigeria-losing-about-a-dozen-doctors-to-the-uk-every-week/\">an average of 12 doctors move to the UK every week</a>! Every seven days -- or five working days -- 12 Nigeria-trained doctors move to the UK!</p><p>After the same order, thousands of Nigerian doctors are working in the US, Canada, Australia, United Arab Emirates, and many other nations of the world. More than half of the 72,000 registered doctors in Nigeria now work abroad.</p><p><strong>A LAND WITHOUT DOCTORS</strong></p><p>In 2017, a friend of mine, who is a fresh doctor from UCH, told me about his plans to move to Canada by 2018. I attempted convincing him to stay, and was making some progress until I said: \"Nigeria needs you\". He laughed and said \"Nigeria does not need its own president, so how will Nigeria need him, an ordinary doctor\". This was at the time the president was in the UK for medical care.</p><p>Recently, I asked him some questions, and while answering, he said: \"What is a doctor doing in Nigeria?\"</p><p>And that is my question today: What exactly is a doctor doing in Nigeria? When he can get 10 times his Nigerian pay by moving to Canada, US, UK or UAE, to do almost 10 times less work! What exactly is a doctor doing in Nigeria, when the government will call him names, and ask him to respect the Hippocratic oath when the same government has not respected the oath it swore to the people?</p><p>What is a doctor doing in Nigeria, when he knows what to do to save a life but is handicapped by the absence of oxygen, blood, sterile needles, and the very basic needs of his profession.</p><p>I think of what would have happened to me if the likes of Professor Aken\'ova and her team of young doctors were not available that night in December 2002. Your guess is as good as mine. So today, I ask that Nigeria must act, lest she becomes a land without doctors.</p><p><i>Follow Tijani on Twitter and other major social media platforms&nbsp;</i><a href=\"https://twitter.com/OluwamayowaTJ\"><i>@OluwamayowaTJ</i></a></p><p>Source: Sahara Reporters</p>', 'uploads/6639918Doctors-653x365.jpg', 'admin7115698293', '17:56:30', '2018-05-09', 'ht13w3t3a753ghnis659i', '', NULL),
(16, 'The 8th Senate, Not IGP Idris Is The Real Enemy Of Democracy', 'BALA IBRAHIM', 'n237is81073p54inOo', 'show', '<blockquote><p>In the heat of Police investigations into the crimes Mr. Melaye was being accused of, he was intercepted at the Airport trying to leave the country and was detained by the men of the Nigerian Immigration Service, his passport having been seized. The Ã¢â‚¬Å“distinguishedÃ¢â‚¬Â Senator snatched his passport from the Immigration officers and ran out of the custody of the Immigration Service to the residence of the Senate President who harbored him for some time before he sneaked to his house.</p></blockquote><p>The Senate of the Federal Republic of Nigeria, on Wednesday the 9th of May, 2018, said it made a resolution declaring the Inspector General of Police (IGP) Ã¢â‚¬Å“Enemy of DemocracyÃ¢â‚¬Â. The Senate said by this resolution, the IGP has been rendered unfit to hold any public office henceforth in Nigeria or elsewhere.</p><p>Obviously, the Senate was irked by the inability of the IGP to appear personally before it in response to its invitation to him in relation to the arrest, escape from custody, hospitalization, and arraignment of one of its own, Senator Dino Melaye.</p><p>Mr. Melaye was invited by the Nigeria Police in connection with a criminal offense, and he refused to honor the invitation. A letter was written by the Police to the President of the Senate, Bokola Saraka to intervene and convince Mr. Melaye to respond to the invitation. Still, Mr. Melaye refused to respond.</p><p>In the heat of Police investigations into the crimes Mr. Melaye was being accused of, he was intercepted at the Airport trying to leave the country and was detained by the men of the Nigerian Immigration Service, his passport having been seized. The Ã¢â‚¬Å“distinguishedÃ¢â‚¬Â Senator snatched his passport from the Immigration officers and ran out of the custody of the Immigration Service to the residence of the Senate President who harbored him for some time before he sneaked to his house.</p><p>Mr. Melaye was later arrested at his home and was being taken to court in Lokoja when the convoy was waylaid by hoodlums who distracted the Police and paved way for him to jump out and escape from Police custody. He was later Re-arrested the same way the hoodlums who masterminded his escape were arrested. They turned out to be his brother and cousin. Both are already facing prosecution at the appropriate courts.</p><p>He was taken to the National Hospital where he stayed for days before doctors officially certified him fit to be discharged. In fact, doctorsÃ¢â‚¬â„¢ report has it that there was virtually no health issue that could hinder any of his activities. But the Senator deliberately refused to leave the hospital, causing the Police to take him to the court on a stretcher. The Police were convinced that he was only playing tricks, having observed him to be entertaining his visitors with songs and delirious dance steps.</p><p>It was over this matter that the Senate wanted the IGP to appear before it. At a time when the country is being faced with so much security issues that require the rapt attention of the Police chief, he decided to send a representative, a Deputy Inspector General of Police in charge of Operation. The Senate was not impressed; they wanted the man who at that time was in Kaduna state, where over 60 Nigerians lost their lives to gunmen attacks.</p><p>Why the Senate would not want a representative of the IGP beats the imagination. These are people who are in the red chambers as representatives of about 180 million Nigerians. One would have expected that the principle of representation is already part of their system.</p><p>It is also clear, by virtue of the provisions of the Police Act, that a Deputy Inspector General of Police and an Assistant Inspector General of Police are technically IGPs. Since the letter to the IGP was not addressed Ibrahim Idris as an individual, but to the office of the IGP, any of the designated IGPs can as well do. In fact, the DIG in charge of operations is surely the most appropriate to provide all relevant information regarding the Melaye saga.</p><p>Now, by declaring the IGP Ã¢â‚¬Å“Enemy of DemocracyÃ¢â‚¬Â and unfit to hold public office henceforth, the Senate is only treading a familiar rough ground. It did same in a matter involving it and the incumbent governor of Kaduna state. The Nigerian courts, in 2004 declared such a resolution null and void. Today, the same El-Rufai that the Senate said is unfit to hold public office is a sitting governor, validly elected by the people of Kaduna state.</p><p>This 8th Senate, which has the highest number of docked members so far in the history of the Nigerian Senate, including its president Bukola Saraki, has a worrisome penchant for unruly behavior and disregard for law and order. Otherwise, how does one explain away the refusal of a Senator to honor invitation over an alleged crime? More dramatic was the commissioning of hoodlums to obstruct the process of justice. And most unexpected was the attempt to escape from lawful custody, itself a criminal act. From the same Senate came a senator, who stormed the plenary, wreak havoc, and abduct the Mace. This says a lot about the level of seriousness, sanity and lawful conduct of our Senate members. How does a Senate that perpetrates thuggery and refused to pass the budget, six months after it was presented to them, expect to be taken seriously by serious people?</p><p>It is important that our Senators do everything within their capacity to uphold the sanctity of the Senate of the Federal Republic by abstaining from uncultured, uncivilized, undemocratic and immature behavior. When they do that, they will command the respect of all.</p><p>Mr. Ibrahim writes from Abuja</p><p>&nbsp;</p><p>SOURCE: SAHARA REPORTERS</p>', 'uploads/3838450Bala-Ibrahim.jpg', 'admin7115698293', '11:17:48', '2018-05-10', 'i6sgtn44t8125hh2ei30', '', NULL),
(17, 'Constituents Declare Federal Law maker Personal Non Grata:', 'Mr Damilare Adeniyi', 'is7t6615o4cli57P37', 'show', '<p>Wole Oke, Member House of Reps, Declared Persona Non Grata by Constituent.<br />\r\nHon. Wole Oke, Member of House of Representatives representing the people of Oriade/OBOKUN Federal Constituency in the National Assembly had been declared persona non grata by his people.<br />\r\nSpeaking on behalf of youths in Ijebu Ijesa, the headquarters of the constituency, Mr.&nbsp;Damilare Adeniyi accuse the Honourable for insulting the sensibilities of the people he represents on facebook. In his statement;<br />\r\nWe are shocked by the public post of Mr. Wole Oke, member representing Oriade/Obokun in the House of Representatives on his Facebook platform just recently. Said post brazenly insults the sensibilities of the people of Ijebu Ijesa Land and must be condemned for its condescending insinuations.<br />\r\nWole Oke, in his Facebook post, boasted about a N7.5million &#39;donation&#39; at the Egboro Day he made to the people of Ijebu Ijesa and insinuated that the people of Ijebu Ijesa had no real value because their love for him was premised on his cash gifts to them. He even boasts and asks, &quot;Can someone love Egboro land more better than me with such a huge amount of money?&quot;.<br />\r\nWe make bold to say that the people of Ijebu Ijesa are not beggars and do not sell their affections or love for money. Our people are honourable even if Mr. &#39;Honourable&#39; has dishonoured them publicly, bringing insults and ridicule to our leaders, parents and hardworking youths.<br />\r\nWe also want Wole Oke to wake up from his slumber. Egboro land is blessed with so many great men and women who have selflessly contributed to its development and continue to do so. These are great men and women who are not interested in buying the love and affection of the people but are driven by a noble heart and sincere intentions.&nbsp;<br />\r\nWole Oke &#39;s claims on Facebook is proof that whatever he does for the society is not selfless but borne out of &nbsp;a desire to purchase the people&#39;s goodwill for his electoral successes and ego. It is truly disappointing to see a representative of the people quantify their affections in such a ridiculous way, and undermine their feelings. The people of Egboro land have done absolutely nothing to be treated this way. Let us place it on record that the constitutency has given him more than what he could ever pay back or achieve by himself.&nbsp;<br />\r\nIt is our considered opinion that Wole Oke should very quickly tender a public apology to the people. I will personally write a letter to the Kabiesi of Ijebu and other leaders to ensure we don&#39;t continue to take such insults from politicians again.<br />\r\nLet it be clear to Hon. Wole Oke that we the youths of Ijebu Ijesa do not recognise him again as we are irritated by his insults on us and our people. There is no knowledge of how else he wrongly perceives our people or what this perception will lead him to do.<br />\r\nIn fact, what he personalises as a donation may be little out of the people&#39;s constituency entitlement.&nbsp;</p>\r\n\r\n<p>We simply refuse to identify with Wole Oke henceforth. His Facebook post has revealed his sinister mind and how he sees us all. We refuse to be objectified and quantified for ego and personal gains.</p>', 'uploads/2459003hqdefault[1].jpg', 'admin7115698293', '12:39:07', '2018-05-16', '1i60iet8g5t403nhun0t1nsciosts', '', NULL),
(18, 'a', 'a', 'n237is81073p54inOo', 'hide', '<p>aaaaaaa<iframe allowfullscreen=\"\" frameborder=\"0\" height=\"480\" src=\"https://www.youtube.com/embed/3zxliD5oIZk\" width=\"854\"></iframe></p>', 'uploads/1105675IMG-20180516-WA0007.jpg', 'admin7115698293', '14:19:58', '2018-05-17', '6t3i7ngh6i1s729a90', '', NULL),
(19, 'Ã¢â‚¬ËœGod Decided To Be My BarberÃ¢â‚¬â„¢, Banky W Says As He Shares Childhood Photo', 'Akashat Ochuwa', '09t4teinr61ea2nEt6nm036', 'show', '<p>Nigerian singer and actor Olubankole Wellington better known as Banky W, has spotted his bald head as the only feature missing on his childhood photo.</p>\r\n\r\n<p>Banky posted a throwback of his childhood photo with a full Afro, while saying, &ldquo;God decided to be his barber.&rdquo;</p>\r\n\r\n<p>The singer who is married to prominent actress Adesua Etomi, posted a photo and captioned it, &ldquo;Same mischevious smirk, same shaped eyebrows. It&rsquo;s a throwback but some things never change. However, God decided to be my barber and took care of the afro sharply.</p>\r\n\r\n<p>Source: Concise News</p>', 'uploads/5200809Banky-in-Red[1].jpg', 'admin7115698293', '16:00:12', '2018-05-17', '0hgo3lt65o7iq72g-s57usd8in', '', NULL),
(20, 'WATCH Ã¢â‚¬ËœCCTVÃ¢â‚¬â„¢ BY KING PROMISE FEAT. SARKODIE X MUGEEZ - Video', 'Soundcity Tv', '09t4teinr61ea2nEt6nm036', 'show', '<p>Heavy Ghanaian collaboration alert!</p>\r\n\r\n<p>King Promise shares a new single titled &lsquo;CCTV&rsquo;. He follows up the impressive single with an official music video which features Mugeez of R2Bees and rapper Sarkodie. The music video was shot and directed on set in Nungua by Justin Campos.</p>\r\n\r\n<p>Check on the video by the Legacy Life Entertainment ensigned:</p>\r\n\r\n<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/QEFvjxeQxqk\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\r\n\r\n<p>&nbsp;</p>', 'uploads/3541003King-Promise-CCTV-ft.-Mugeez-Sarkodie-Official-Video-660x330.jpg', 'admin7115698293', '16:10:33', '2018-05-17', '5ina7330cs6tw1ht2gh5i5', '', NULL),
(21, 'Depression in men may lower chances for pregnancy, NIH study suggests', 'Ariana Eunjung Cha', '1lH38907eth50a3', 'show', '<p>Women having trouble getting pregnant sometimes try yoga, meditation or mindfulness, and some research suggests that psychological stress may affect infertility. But what about men: Does their mental state affect a couple&#39;s ability to conceive?</p>\r\n\r\n<p>The latest research on this subject was published Thursday in the journal Fertility and Sterility and suggests that a link between mental health and fertility may exist for women and men.</p>\r\n\r\n<p>The study involved data from 1,650 women and 1,608 men who were recruited through the National Institutes of Health&#39;s Reproductive Medicine Network at six sites in the United States. Most of the participants were couples, and they were undergoing some kind of fertility treatment, such as ovarian stimulation medication or artificial insemination, but not in vitro fertilization. Based on a questionnaire, about 6 percent of the women and 2 percent of the men were rated as having major depression.</p>\r\n\r\n<p>While the number of men with major depression in the analysis was small - just 34 - an analysis found differences between them and the other men in the study. Those with major depression were 60 percent less likely to have a live birth than men who did not have major depression.</p>\r\n\r\n<p>More specifically, of the 34, only three of the couples, or less than 9 percent, achieved a live birth. That compares with nearly 25 percent having a live birth for couples in which the male partner did not have major depression.</p>\r\n\r\n<p>Researcher Esther Eisenberg of the NIH&#39;s Eunice Kennedy Shriver National Institute of Child Health and Human Development and her co-authors theorized that there are many possible reasons male depression may interfere with fertility, including sexual dysfunction due to reduced libido, erectile dysfunction or delayed or inhibited ejaculation; a decrease in the frequency of intercourse; or even a negative change in sperm quality.</p>\r\n\r\n<p>While the exact link may still be unknown, the authors wrote, &quot;our study provides infertility patients and their physicians with new information to consider when making treatment decisions.&quot;</p>\r\n\r\n<p>The study complements previous research that has looked at sperm and semen quality and stress. In a 2014 paper, researchers from Columbia University &#39;s Mailman School of Public Health and the Rutgers School of Public Health looked at 193 men, ages 38 to 49. They were given tests that measured stress in their work and home life and found that men who had gone through two or more stressful events in the previous year had lower sperm motility (the ability to move) and a lower percentage of normal sperm. Those with a lot of job-related stress had lower levels of testosterone, a hormone that could affect fertility.</p>\r\n\r\n<p>Source: Chicagotribune.com</p>', 'uploads/3552326ct-depression-men-lower-pregnancy-20180517-001.jpg', 'admin7115698293', '17:27:13', '2018-05-17', 'ehrs2271n1iste8idsip30ng84o', '', NULL),
(22, 'DEADPOOL 2 | Doubling down with Manchester United to beat Infinity War - Video', 'FilmIsNow Movie Trailers', '09t4teinr61ea2nEt6nm036', 'show', '<p>When you make a sequel you have to double down to beat Avengers: Infinity War&quot; When Manchester United opened the doors of Old Trafford to Deadpool they had no idea how far he&rsquo;d go to promote his new film, Deadpool 2. Jesse Lingard, Michael Carrick, Luke Shaw, Alexis Sanchez and Juan Mata aren&rsquo;t too impressed. Watch Deadpool&rsquo;s reaction from the stands when he sees that the players aren&rsquo;t wearing the official Deadpool knee pads</p>\r\n\r\n<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\">\r\n<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/Ir7ctioZapM\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\r\n\r\n<p>&nbsp;</p>\r\n</div>', 'uploads/8238774sei_3039621.jpg', 'admin2023731819', '18:26:36', '2018-05-17', 'o266d8lenih8383gdisat9p5o', '', NULL),
(23, 'ON MENTORS AND THEIR INFLUENCES', 'Dara Falade', '25o915mCitano5i14cu1mn3', 'show', '<p>Dear Entrepreneur,</p>\r\n\r\n<p>If you don&#39;t have a mentor or a life coach, well... today&#39;s article is for those who have or are about to find one for themselves but I think it&#39;s a great thing to be accountable to someone who has geniune interest and passion for your growth.</p>\r\n\r\n<p>So I&#39;ve had a few of them in my life from around 2009 and I&#39;ve learnt a few lessons which I want to share with you.</p>\r\n\r\n<p>First, you outgrow your mentors, sometimes.<br />\r\nIt happens that you need someone&#39;s influence to move to the next level of your life and you can get to that point and they&#39;ve fulfilled their role. If you continue the relationship thereafter, you might begin to experience some friction. One important thing you have to note however is that you cannot totally discard them, their overall relevance to you will never be exhausted and you must continue to appreciate them for their contribution because you wouldn&#39;t be where you are without their help.</p>\r\n\r\n<p>Second, mentors or coaches have the tendency to guide you in the direction of their own dreams or aspiration or interest or field of expertise. This is not a bad thing in itself because if we look at it closely, one cannot give what one doesn&#39;t have. It is from the abundance of their own knowledge that they can teach you hence, the tendency for them to gear you in the direction of their field.<br />\r\nTo avoid a situation like this, go for a mentor who is in the exact same field you want to grow.<br />\r\nPlease note that this is different from role-models like Richard Branson or David Oyedepo. Models can be selected from any field and any country.</p>\r\n\r\n<p>Third, to gain the most from your mentor, be the runner-after. Quite usually, they don&#39;t have the time so the onus falls on you to make them make time for you. You will begin to attract their commitment by the level of progress you yourself are making so you want to work hard and be serious about your growth.</p>\r\n\r\n<p>Dara Falade<br />\r\nCommunication Trainer<br />\r\nEntrepreneurship Leader</p>\r\n\r\n<p>Author:&nbsp;<a href=\"https://web.facebook.com/dara.falade\" target=\"_blank\">Dara Falade</a></p>', 'uploads/263203332661378_1694162187285616_8821062729411330048_n[1].jpg', 'j90819542aBn72i', '12:56:11', '2018-05-18', 'ng51s1n32545o90ithi', '', NULL),
(24, 'COM101', 'Dara Falade', '25o915mCitano5i14cu1mn3', 'show', '<h1>Welcome to Communication with Dara Falade!&nbsp;</h1>\r\n\r\n<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/YDPScWgCYP4\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\r\n\r\n<p><br />\r\n<br />\r\nYo fam, we have to take our communication and interpersonal skills to the next level because in the 21st century business space, your most important asset is your relationship with people (NETWORK).&nbsp;<br />\r\nYou heard that right.&nbsp;<br />\r\n<br />\r\nWe can&#39;t say it enough, to get the best out of any body, show them love and it all begins with the power of a smile<img alt=\"\" height=\"16\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/fd8/1.5/16/1f60a.png\" width=\"16\" />Ã°Å¸ËœÅ .&nbsp;</p>\r\n\r\n<p>Email us- <a href=\"mailto:info@semanticspro.com\">info@semanticspro.com</a> for your brand or personal communication needs.&nbsp;</p>\r\n\r\n<p><a href=\"https://web.facebook.com/dara.falade\" target=\"_blank\">Dara Falade</a></p>\r\n\r\n<p>Communications Expert<br />\r\nCommunications Trainer&nbsp;<br />\r\nIt&#39;s #LoveandBusiness</p>', 'uploads/3155742hqdefault_(1).jpg', 'j90819542aBn72i', '14:50:17', '2018-05-18', 'm2t91n5c97is118h9g0oi63', '', NULL),
