(27, 'COMM104 - Truth', 'Dara Falade', '25o915mCitano5i14cu1mn3', 'show', '<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/aJTiiOeqUIk\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\r\n\r\n<p>Hey Fam!&nbsp;<br />\r\nHow&#39;s the week starting?&nbsp;<br />\r\nHere&#39;s your weekly dose of Communication with Dara Falade. (Comm 104). Today we&#39;re talking about &#39;truth&#39;.&nbsp;<br />\r\n<br />\r\nIt&#39;s exciting talking about these things and I look forward to your training invitation.&nbsp;<br />\r\n<br />\r\nWorkplace communication&nbsp;<br />\r\nInternal communication&nbsp;<br />\r\nExternal communication&nbsp;<br />\r\nInterpersonal skills<br />\r\nMake people fall in love with you<br />\r\nCommunication and Leadership&nbsp;<br />\r\nBuilding eternal relationships&nbsp;<br />\r\nRelationship Management&nbsp;<br />\r\nSustainable developments&nbsp;<img alt=\"\" height=\"16\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f29/1.5/16/1f602.png\" width=\"16\" />Ã°Å¸Ëœâ€š<img alt=\"\" height=\"16\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f29/1.5/16/1f602.png\" width=\"16\" />Ã°Å¸Ëœâ€š<img alt=\"\" height=\"16\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f29/1.5/16/1f602.png\" width=\"16\" />Ã°Å¸Ëœâ€š</p>\r\n\r\n<p>Email us- <a href=\"mailto:info@semanticspro.com\">info@semanticspro.com</a> for your brand or personal communication needs.&nbsp;<br />\r\n<br />\r\n<a href=\"https://web.facebook.com/dara.falade\" target=\"_blank\">Dara Falade&nbsp;</a><br />\r\nCommunication Trainer&nbsp;<br />\r\nEntrepreneurship Leader</p>\r\n\r\n<p>It&#39;s #LoveandBusiness</p>', 'uploads/4889592comm4.jpg', 'j90819542aBn72i', '15:03:15', '2018-05-18', 'io3