(28, 'COMM105 - The Maxim of Quantity', 'Dara Falade', '25o915mCitano5i14cu1mn3', 'show', '<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/OS02iIX1p-s\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\r\n\r\n<p>Effective communication entails you share only relevant information.&nbsp;<br />\r\nJoin me every week to learn communication tools that can enhance your productivity and help you sustain critical relationships.&nbsp;</p>\r\n\r\n<p>Email us- <a href=\"mailto:info@semanticspro.com\">info@semanticspro.com</a> for your brand or personal communication needs.&nbsp;</p>\r\n\r\n<p><br />\r\n<a href=\"https://web.facebook.com/dara.falade\" target=\"_blank\">Dara Falade</a><br />\r\nCommunication Trainer&nbsp;<br />\r\nEntrepreneurship Leader&nbsp;<br />\r\n#LoveandBusiness</p>', 'uploads/7244621comm5.jpg', 'j90819542aBn72i', '15:06:47', '2018-05-18', '2353i1t0h4c40926iosmgmn0', '', NULL),
(29, 'COMM106', 'Dara Falade', '25o915mCitano5i14cu1mn3', 'show', '<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/4PQ-giX07l4\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\r\n\r\n<p>Do you sometimes feel like you should have said something differently?&nbsp;<br />\r\nDo you even review your thoughts before talking?&nbsp;<br />\r\nMore importantly do you retrospect after important speaking engagements?&nbsp;<br />\r\nWelcome to Communication with Dara Falade, this is Comm 106!&nbsp;</p>\r\n\r\n<p>Email us- <a href=\"mailto:info@semanticspro.com\">info@semanticspro.com</a> for your brand or personal communication needs.&nbsp;</p>\r\n\r\n<p><br />\r\n<a href=\"https://web.facebook.com/dara.falade\" target=\"_blank\">Dara Falade&nbsp;</a><br />\r\nCommunication Trainer&nbsp;<br />\r\nEntrepreneurship Leader&nbsp;<br />\r\n#LoveandBusiness</p>', 'uploads/8836913comm6.jpg', 'j90819542aBn72i', '15:17:08', '2018-05-18', '8nm64g088651cimo0hit4s76', '', NULL),
(30, 'COMM107 - Connection', 'Dara Falade', '25o915mCitano5i14cu1mn3', 'show', '<p>&nbsp;</p>\r\n\r\n<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/M945m62aDBQ\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This is very integral for effective communication. Here are three quick tips to help you create the connection you need to communicate effectively.&nbsp;<br />\r\n<br />\r\nEmail us- <a href=\"mailto:info@semanticspro.com\">info@semanticspro.com</a> for your brand or personal communication needs.&nbsp;<br />\r\n<br />\r\n<a href=\"http://web.facebook.com/dara.falade\" target=\"_blank\">Dara Falade&nbsp;</a><br />\r\nCommunication Trainer&nbsp;<br />\r\nEntrepreneurship Leader&nbsp;<br />\r\n#LoveandBusiness</p>', 'uploads/107802hqdefault.jpg', 'j90819542aBn72i', '15:18:24', '2018-05-18', '60ot7hm7sng20i12855m60ci', 'thumb/8145955thumb1535205130.jpg', NULL),
(31, 'COMM108 - First Impression', 'Dara Falade', '25o915mCitano5i14cu1mn3', 'show', '<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/lwvLGaENmkI\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Don&#39;t make a habit of saying too much the first time.&nbsp;<br />\r\nWhen you meet a person, give them a chance to talk, it arms you with adequate information on how you should approach them.&nbsp;<br />\r\nAsides business communication even, you don&#39;t bare your Soul on your first date, don&#39;t!<br />\r\n<br />\r\n#firstimpressions</p>\r\n\r\n<p><a href=\"https://www.facebook.com/dara.falade\" target=\"_blank\">Dara Falade</a><br />\r\nCommunication Trainer&nbsp;<br />\r\nEntrepreneurship Leader&nbsp;<br />\r\n#LoveandBusiness</p>', 'uploads/1793120hqdefault_(2).jpg', 'j90819542aBn72i', '15:07:22', '2018-05-22', 'g18c3165i659s0o9mnhm3it4', 'thumb/1076799thumb1535205115.jpg', NULL),
(32, 'COM109', 'Dara Falade', '25o915mCitano5i14cu1mn3', 'show', '<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/wn93Ir9Ck2U\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Communication is the foundation of everything we do and say especially in the 21st century Workplace.&nbsp;<br />\r\n<br />\r\nFollow this series to learn tips on how to communicate effectively with your peers, direct reports, managers and executives.&nbsp;<br />\r\n<br />\r\nThey say hard skills get you hired but soft skills get you fired. Sustain your productivity by communicating effectively.&nbsp;<br />\r\n<br />\r\nI&#39;d be delighted to answer your questions on this topic as I look forward to sharing the full course with you and your team.&nbsp;<br />\r\n<br />\r\n#Communication #CommunicationTraining #WorkplaceCommunication #LoveandBusiness #CareerSuccess&nbsp;<br />\r\n#21stCenturySkills #SkillsthatMatter&nbsp;<br />\r\n<br />\r\n<a href=\"https://www.facebook.com/dara.falade\" target=\"_blank\">Dara Falade</a>&nbsp;<br />\r\nCommunication Trainer&nbsp;<br />\r\nEntrepreneurship Leader&nbsp;<br />\r\n#LoveandBusiness</p>', 'uploads/1186931.jpg', 'j90819542aBn72i', '13:34:47', '2018-06-19', '3nc9isim6319t02035ho7g1', 'thumb/8938582thumb1535205110.jpg', NULL);
