(33, 'EkitiDecides2018', 'Ord Jide Kol', 'n237is81073p54inOo', 'show', '<p>Civil Society Groups are my thing really but if we must effect any kind of change, everyone must quit talking and join the business of actually fixing our state.</p>\r\n\r\n<p>Men! the way our people reason ehn, if I&#39;m allowed to state issues without sentiments, this state might be in hardship for much longer.</p>\r\n\r\n<p>Creating a new political order has been so tedious and let&#39;s not even blame the gods.</p>\r\n\r\n<p>Thank God for posterity, she&#39;ll record how we came with sincerity of purpose, how we did our bit to take off the chains, how they SOLD THE KEY TO THEIR OWN FREEDOM, how the warriors sold their values for porridge, how the people poisoned each other to gain prison recognition and how EVERY OTHER PERSON WAS INDIFFERENT, we are not indifferent, its the victory of our conscience.</p>\r\n\r\n<p>Thank God for posterity, she does it.</p>\r\n\r\n<p><a data-ft=\"{&quot;tn&quot;:&quot;*N&quot;,&quot;type&quot;:104}\" href=\"https://web.facebook.com/hashtag/irapadaekiti?source=feed_text\">#IrapadaEkiti</a></p>', 'uploads/768085627868109_1869689853043334_6528414958691070105_n.jpg', 'j90819542aBn72i', '14:23:20', '2018-07-06', 'i2is0c84et7seni0e4id8i8h1td275g4k', 'thumb/2135002thumb1535205106.jpg', NULL),
(34, 'SATIRE: EPL - Nigeria\'s Silver Lining', 'Peter Oyebanji', 'n237is81073p54inOo', 'show', '<p>Jose with his negativity, Sarri with his cigarettes, Guardiola with his overthinking, Kloop with his &quot;Robin Hood&quot; act. Ladies and Gentlemen, I will like to tell you that it&#39;s that time of the year when nobody will really care whether it was Saraki that arranged DSS or it was DSS that wanted to arrange Saraki. The Nigeria&#39;s political transfer might have clashed with football&#39;s own but its season hasn&#39;t commenced. In the last couple of weeks, we have witnessed both predicted and unpredicted transfers. From Ronaldo&#39;s unexpected move to Juventus to Saraki and Co&#39;s expected move to PDP. It hasn&#39;t been a boring one, except if you are a political United fan. As enjoyable as it was, there is hardly anyone that will antagonize the point that one of the transfer session is a perpetual banal ocuurence.</p>\r\n\r\n<p>Every transfer session in Nigeria&#39;s politics has always been the same process. Most political half-conscious people saw the Saraki and Co&#39;s signing coming more than a year ago unlike the football transfer.</p>\r\n\r\n<p>More than half of Chelsea&#39;s supporters would have banked against Kepa Arrizabalaga being a name of a goal keeper, it sounds preety much like a mountain in East Africa, eh? Well, I don&#39;t have to tell Nigerian politicians that Nigeria has most of the ardent football fans in the world.</p>\r\n\r\n<p>President Buhari might decide to stage the OPC in NASS at the next plenary and make us believe it&#39;s Kwankwaso&#39;s doing, he will be more than fooling himself. Osinbajo could decide to pick up a broom and sweep the whole of Gwagwalada so as to make us believe he is the most active vice president ever, he will definitely end up as the most used meme this season. Saraki can keep kidding, Buhari can keep up the &quot;Buharism,&quot; Osinbajo can keep &#39;jobbing&#39;, EPL will keep &#39;lising&#39;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;Peter Oyebanji is a student journalist at Obafemi Awolowo University and can be reached through Gmail: adewuyipeter50@gmail.com Twitter: @anderpeter2</p>', 'uploads/153520509257010282018_6$large_EPL[1].jpg', 'j90819542aBn72i', '16:07:01', '2018-08-12', 't959ei4ns85ihsg3a1tr6i4', 'thumb/327392thumb1535205099.jpg', NULL),
(35, 'BUSINESS CASUAL STYLES FOR THE FASHION GIRL', 'Napoko Annet', 'f429639e6Ltiyel5s06', 'show', '<p>Hey Lovelies</p>\r\n\r\n<p>Not everyone works in an office that requires them to wear business formal or business professional outfits. Many women out there own their own businesses and dictate their lives so also many women work in office environments that require them to dress in comfy casual business styles.</p>\r\n\r\n<p>The fashion world (across all platforms) has agreed and concluded that wearing clothes makes people happy and gives one confidence. You know this is true because when you look good you feel good and that&rsquo;s why we share tips, guides and images with you.</p>\r\n\r\n<p>If you are a woman and your outfit for the week is a business casual look then don&rsquo;t be fooled by the &ldquo;casual&rdquo; after the word &ldquo;Business&rdquo;. Owing to the fact that the word casual means relaxed and unconcerned does not mean your look to your office or for a meeting should be such.</p>\r\n\r\n<p>A business casual look is not unconcerned rather its just a more relaxed form from the traditional corporate wear however the intent is still to maintain a professional and businesslike impression.</p>\r\n\r\n<p>Seeing that you are inclined to avoid frumpy and shapeless pieces in the name of &ldquo;business casual&rdquo; what then should you be wearing?</p>\r\n\r\n<p>We&rsquo;ve got a look book below that you need to scroll through, from colorful frocks to length pieces there are amazing styles that are perfect and would suit your need, all you have to do is scroll through;</p>\r\n\r\n<p><img alt=\"\" src=\"http://img.eagleee.com/v2-EagleNews/Eagle-NewsImage/DetailImage/NonRealNews/20180626/b975ec61830576c4da833775c5d58a60.jpg\" /></p>\r\n\r\n<p>@jadorefashion</p>\r\n\r\n<p><img alt=\"\" src=\"http://img.eagleee.com/v2-EagleNews/Eagle-NewsImage/DetailImage/NonRealNews/20180626/20f86e4dfe010de5190013622f3765ef.jpg\" /></p>\r\n\r\n<p>@jadorefashion</p>\r\n\r\n<p><img alt=\"\" src=\"http://img.eagleee.com/v2-EagleNews/Eagle-NewsImage/DetailImage/NonRealNews/20180626/44d20a912cad62273c2e5aece9decf8d.jpg\" /></p>\r\n\r\n<p>@prissysavvy</p>\r\n\r\n<p><img alt=\"\" src=\"http://img.eagleee.com/v2-EagleNews/Eagle-NewsImage/DetailImage/NonRealNews/20180626/47f36bed7951e15582e9e1d58a3c7901.jpg\" /></p>\r\n\r\n<p>@rantiinreview</p>\r\n\r\n<p><img alt=\"\" src=\"http://img.eagleee.com/v2-EagleNews/Eagle-NewsImage/DetailImage/NonRealNews/20180626/490814803e58176dadbf3dde98fbdc41.jpg\" /></p>\r\n\r\n<p>@stylepantry</p>\r\n\r\n<p><img alt=\"\" src=\"http://img.eagleee.com/v2-EagleNews/Eagle-NewsImage/DetailImage/NonRealNews/20180626/eb0be8b7a6bfcb538b5293b2bbb76ac6.jpg\" /></p>\r\n\r\n<p>@stylepantry</p>\r\n\r\n<p>The above looks are definitely worth every fashion girls time, you should try to recreate them using what you have in your closet or perhaps its time for one or two new additions</p>', 'uploads/8802882IMG_20180817_155913_171.JPG', 'j90819542aBn72i', '15:03:25', '2018-08-17', 'ensbs028nisu89th5g5i32s5i', 'thumb/8025574thumb1535204935.jpg', NULL),
(37, 'Female Genital Mutilation (What you should know)', 'Olabintan Odunola', '1lH38907eth50a3', 'show', '<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/5PKLfxftjbk\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\r\n\r\n<p>Did you know that at least 200 million girls and women have experienced Female Genital Mutilation (erroneously called female Circumcision) in 30 countries across three continents of the world?</p>\r\n\r\n<p>And the recent estimate by UNICEF states that unless the current trends are reversed, some 30 million more women and girls could be cut in the next 10 years.</p>\r\n\r\n<p>This vlog is to give basic knowledge of Female Genital Mutilation (FGM) and to explain why it is such a harmful practice.</p>\r\n\r\n<p>Be sure to like, share and subscribe too!.. Gracias!</p>\r\n\r\n<p>Instagram @thelifesaversapprentice</p>', 'uploads/15393597806091358IMG_20181012_163911_067.JPG', 'j90819542aBn72i', '15:56:22', '2018-10-12', '1539359782i4h1g4tlam09f93en8s3ie4', 'thumb/15393597801861774IMG_20181012_163911_067.JPG', 1),
(38, 'The Juju Syndrome', 'Olabintan Odunola', '1lH38907eth50a3', 'show', '<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/xiX1nSRPVZ0\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\r\n\r\n<p>In Nigeria, we&#39;re deeply religious people and the village people play a huge role in how most people perceive/judge situations including Health issues.</p>\r\n\r\n<p>It sometimes gets to the extent that some people instead of going to the hospital to receive proper healthcare when they&#39;re sick will rather light candles to ward off the spirit of their village people chasing them!.. This matter is very serious and needs to be addressed Ã°Å¸Ëœâ€™</p>\r\n\r\n<p>This vlog is more of a rant and I know you&#39;ll be able to relate with it(especially if you&#39;re African).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I ended this 7minutes vlog with a Story that I&#39;ll like your opinion on, be sure to drop your opinion in the comment section and don&#39;t forget to Subscribe, Like , Share and Comment.</p>\r\n\r\n<p>Love always,&nbsp;<br />\r\n&#39;Biodun Ã¢ÂÂ¤Ã¯Â¸ÂÃ°Å¸ËœËœ</p>', 'uploads/15405773523478461IMG-20181026-WA0011.jpg', 'j90819542aBn72i', '18:09:14', '2018-10-26', '1540577354t16thii4s942e50h5ng4', 'thumb/15405773526476617IMG-20181026-WA0011.jpg', 1),
(39, '5 Urban Menstrual Myth', 'Olabintan Odunola', '1lH38907eth50a3', 'show', '<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/odVV2QStZKg\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\r\n\r\n<p>Ever heard you can&#39;t get pregnant while on your period?</p>\r\n\r\n<p>Well, this like many others are many others are urban menstrual myths!<br />\r\n<br />\r\nIn this vlog highlighted some of these myths and discussed if they&#39;re true or not.. Very interesting stuffz.. Be sure to check it out.. Gracias Ã°Å¸ËœÅ </p>', 'uploads/15419712839281286IMG-20181110-WA0015.jpg', 'j90819542aBn72i', '21:21:25', '2018-11-11', '1541971285n2225h72its8117gi9', 'thumb/1541971283842568IMG-20181110-WA0015.jpg', 1),
(40, 'THE STORY IN MY HEAD: IT HURTS(Day 1 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>It hurts to know that those who hurt me are free<br>Leaving life like they didnÃ¢â‚¬â„¢t commit anything like sin<br>I donÃ¢â‚¬â„¢t know! When did the world become this<br>Wolf-in-men clothing now saunter on our streets, proud of their vile deeds</p><p>Aunty, you broke me<br>Your junior brother just because I told you, Ã¢â‚¬Å“I want to weeÃ¢â‚¬Â<br>I never knew you would turn wee to becoming we<br>For what did you rape me?</p><p>Uncle, you shattered me<br>Was it because Aunty wasnÃ¢â‚¬â„¢t around<br>Did I force you to take V.I.A.G.R.A or be in the mood?<br>So why did you have to hurt me?</p><p>I am but a little spirit<br>But you turned m thing into a sinful thing<br>I fear so bad, and I canÃ¢â‚¬â„¢t talk about it<br>For you scare me</p><p>Ã¢â‚¬Å“Shh, if you say anything about what transpired on Tuesday,<br>I will chase you out and without food, youÃ¢â‚¬â„¢d say<br>Of course I donÃ¢â‚¬â„¢t want that<br>But how will I sleep well I know I was hurt by my father?</p><p>The man, whoÃ¢â‚¬â„¢s under I came from<br>Cut me into shattered pieces<br>So bad that I no longer know where my peace is<br>But who do I tell?</p><p>Of the traumatic nights,<br>Looking at you in the eye is too hard<br>Eating with you nauseates me<br>I feel like vomiting each time you touch.</p><p>I am hurt, for there are many more who will still be like me today,<br>Hurt and can do zilch about what the people around them tag, FATE</p><p>Please would you help me<br>Reach out to those who are hurt, like me?<br>Before they do something drastic<br>And get tagged WITCH?</p><p>I beg of you, letÃ¢â‚¬â„¢s reduce the pain together<br>and make the world better for us, forever.</p><p>No to RAPE<br>#MeToo</p><p>From a friend that cares,<br>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15436787864251408WhatsApp_Image_2018-12-01_at_4.27.48_PM_(1).jpeg', 'j90819542aBn72i', '15:39:48', '2018-12-01', '15436787887e0253hgn2tt92iis7h6', 'thumb/7907275thumb1543680001.jpg', 1),
(41, 'THE STORY IN MY HEAD: THE MAN SITTING IN FRONT OF YOU (Day 2 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>&nbsp;</p>\r\n\r\n<p>He&rsquo;s not a human being &ndash; No, he is less of that<br />\r\nHe might&rsquo;ve been the one through whose sperm I permeated into my mother&rsquo;s vagina<br />\r\nBut would you believe me if I told you that he deflowered his product?<br />\r\nAnd tags it a righteous conduct</p>\r\n\r\n<p>To take a bite of the material to know it&rsquo;s worth<br />\r\nAnd to be the first person to know what&rsquo;s what and what&rsquo;s not<br />\r\nThat man sitting in front of you was the one who&rsquo;s made me a shame<br />\r\nSince Mum caught him on me the second time, life&rsquo;s never remained the same</p>\r\n\r\n<p>I can&rsquo;t even call my natal vehicle &ldquo;Mom&rdquo;<br />\r\nShe&rsquo;d say &ldquo;I am not the mother of a whore&rdquo;<br />\r\nI cannot give birth to a lady<br />\r\nWho&rsquo;s only dream is to give birth as a baby</p>\r\n\r\n<p>But what am I to do when that man sitting in front of you caused all these?&nbsp;<br />\r\nI can&rsquo;t even tell you the pain I feel when someone calls me by his last name<br />\r\nI have to hold it in each time, in school I have to be called upon by the teacher with that name while being sane<br />\r\nBut to whom am I to explain all these?</p>\r\n\r\n<p>That the man you call my Father,&nbsp;<br />\r\nhas committed murder<br />\r\ntowards myself and my mother,<br />\r\nhe&rsquo;s sexed his first daughter<br />\r\nin an attempt to be the first buyer.</p>\r\n\r\n<p>&copy;Emmiasky Ojex</p>', 'uploads/15437518232856408IMG-20181202-WA0004.jpg', 'j90819542aBn72i', '11:57:05', '2018-12-02', '1543751825g1ii90tn8h7h880s1e5t', 'thumb/1543751823979178IMG-20181202-WA0004.jpg', 1),
(42, 'THE STORY IN MY HEAD: THE LIL GIRL OF 12 (Day 3 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>&nbsp;</p>\r\n\r\n<p>She is a village girl<br />\r\nAll of 12 years<br />\r\nJust budding her lil breast<br />\r\nLike lik peas</p>\r\n\r\n<p>Her blood relative, a man of thirty often<br />\r\nSlides his hands through her pretty dress<br />\r\nAnd play with &lsquo;em little breasts</p>\r\n\r\n<p>She felt terrible<br />\r\nNo one to tell her agony<br />\r\nHe left for the city whence he worked, she then was relieved</p>\r\n\r\n<p>After her education (primary), she was sent to stay with his family<br />\r\nTo earn and grasp a living<br />\r\nShe was then blooming into a pretty lady of eighteen</p>\r\n\r\n<p>He found her desirous although staying with his family, with wife and kids<br />\r\nAs everyone goes to bed he quietly enters the unilluminated room<br />\r\nAnd goes in to her, with force<br />\r\nShe&rsquo;s bleeding profusely<br />\r\nHe had no pity or clemency towards her at all, not even once</p>\r\n\r\n<p>He continued being the devil&rsquo;s advocate every night<br />\r\nThreatening her if she ever thinks of opening her mouth<br />\r\nQuietly, she suffered his beastly hunger<br />\r\nFor her petite vagina which ached every night</p>\r\n\r\n<p>His family had no say as he was feeding them three meals a day!<br />\r\nEventually, she eloped with a young man,<br />\r\nTelling him her frustrations, they both took off<br />\r\nHe pampered her with lovely caresses and<br />\r\nmade a bow to God with a promise to take care of&nbsp;<br />\r\nher till death part them.</p>\r\n\r\n<p>Advice:<br />\r\nOh Man, stop your hunger for fresh dairies<br />\r\nBe happy with your devoted wife<br />\r\nLest wait for God&rsquo;s punishment when you become ashes which nobody will touch, out of sheer hatred for your humanly inhumane acts.</p>\r\n\r\n<p>Change your attitude towards budding ladies<br />\r\nProtect the precious pearls and gems they are<br />\r\nAs one day, they will lead us to a better place.</p>\r\n\r\n<p>&copy;Anonymous</p>\r\n\r\n<p>Story source: India</p>', 'uploads/1543835334278468IMG-20181203-WA0000.jpg', 'j90819542aBn72i', '11:08:56', '2018-12-03', '15438353367959hi79i3s2egtnht84', 'thumb/15438353348300848IMG-20181203-WA0000.jpg', 1),
(43, 'THE STORY IN MY HEAD: PLEASE TELL MY TEACHERS (Day 4 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>&nbsp;</p>\r\n\r\n<p>Please tell my teachers,<br />\r\nThat each time we teach the topic, FAMILY<br />\r\nI dread when I am called upon to explain some things<br />\r\nNot because I am timid or shy, but truly &ndash; I do not know<br />\r\nSince I do not think what I have is worth of being HOME</p>\r\n\r\n<p>A family is supposed to be together<br />\r\nBut mine, the man and his lady&rsquo;ll rather spend time being apart<br />\r\nWe are supposed to be in love,&nbsp;<br />\r\nBut with each contact amidst this duo, we all hurt</p>\r\n\r\n<p>Dad&rsquo;s a menace, while Mom&rsquo;s a dummy with a pretty face<br />\r\nThey never seem to wanna be at same place<br />\r\nSometimes, I wonder how I got to earth<br />\r\nFor the vehicle and driver seem to live on different planets</p>\r\n\r\n<p>I thought we should be one<br />\r\nBut us? - &nbsp;We&rsquo;re not!<br />\r\nMom&rsquo;s always greeted with a slap on her pretty-yet-wrinkled-with-trouble face,<br />\r\nEach time the mad man drives his demented body back home late</p>\r\n\r\n<p>She&rsquo;s held on for so long,<br />\r\nBut I fear for she does not live anymore,<br />\r\nShe only breathes<br />\r\nAnd that&rsquo;s until her torturer comes in and take all she&#39;s saved up</p>\r\n\r\n<p>How am I to tell my teachers that they only see me smile because I am hiding my tears<br />\r\nTalk, because I do not want to be lost in my fears<br />\r\nThat someday, that man might actually end her life<br />\r\nAnd that would, cause me to live with a DAGGER IN MY HEART.</p>\r\n\r\n<p>That&rsquo;s how my family is<br />\r\nSo please the next time we&rsquo;re learning<br />\r\nTell my teacher not to call me<br />\r\nFor I will, not hold back anymore secrets</p>\r\n\r\n<p>&copy;Emmiasky Ojex</p>', 'uploads/15439699698437138IMG-20181205-WA0000.jpg', 'j90819542aBn72i', '00:32:51', '2018-12-04', '1543969971es1n96e3li3sh8ptgi4a533', 'thumb/15439699696181494IMG-20181205-WA0000.jpg', 1),
(44, 'THE STORY IN MY HEAD: I THOUGHT THIS WAS MARRIAGE  (Day 5 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>&nbsp;</p><p>I thought when you said Ã¢â‚¬Å“I DOÃ¢â‚¬Â<br>Every moment of my life would be fun, like the man I thought I knew<br>thereÃ¢â‚¬â„¢d be no more Ã¢â‚¬Å“I DO NOT and NO IDEA OF HURTÃ¢â‚¬Â</p><p>I thought marriage was me waking up to calling Ã¢â‚¬Å“HONEYÃ¢â‚¬Â<br>And you responding with that bassy masculine voice, Ã¢â‚¬Å“HOW WAS YOUR NIGHT?Ã¢â‚¬Â<br>On our matrimonial bed, IÃ¢â‚¬â„¢ll have said Ã¢â‚¬Å“THE NIGHT WAS REALLY GOOD AS IT WAS WITH THE LOVE OF MY LIFEÃ¢â‚¬Â</p><p>But come on, let me snap out of it now<br>I didnÃ¢â‚¬â„¢t marry you to become your number one punch bag<br>just because I met with a friend from school the other day<br>DoesnÃ¢â‚¬â„¢t make me a lady thatÃ¢â‚¬â„¢s been, by so many men, laid</p><p>WhatÃ¢â‚¬â„¢s wrong with a little bit of going out<br>Did that really have to lead to a fight?<br>We married to be companions<br>Not for you to overly domineer over my Israel like the man from Gaza</p><p>Is this love, I thought I married my own Julius<br>The one whose words soothe every burden in my heart<br>And whose touch drives my subtle self to the extreme but now I am sad and cry</p><p>For the marriage I had in mind<br>Has turned to a wrestling hall and fighting ground<br>As each Friday night and more, I have to endure your dipsomaniac self<br>You, Julius Ã¢â‚¬Â¦Ã¢â‚¬Â¦, are such a worthless elf</p><p>You canÃ¢â‚¬â„¢t get mad at me for the loss you had at work,<br>I am not an after-work job<br>I am your wife<br>But now, I am just a piece of crap</p><p>Something you go home to lash out your anger upon<br>And deal with, if she doesnÃ¢â‚¬â„¢t ever concur<br>With the rule the bread(burnt) winner says<br>As it is not her place to give a say</p><p>Since this marriage is not what I thought itÃ¢â‚¬â„¢d be,<br>My David will arise someday and take the sling-shot<br>That was fired to kill Goliath, your predecessor.</p><p>Story source: Mrs Bukola Ã¢â‚¬Â¦Ã¢â‚¬Â¦.<br>Lekki, Lagos, Nigeria<br>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15440305491624243IMG-20181205-WA0002.jpg', 'j90819542aBn72i', '17:22:32', '2018-12-05', '1544030552t2t0hhi99e34876sngi4', 'thumb/15440305501673302IMG-20181205-WA0002.jpg', 1),
(45, 'THE STORY IN MY HEAD: LITTLE TIMMY(Day 6 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>Aunty Ronke smiled to herself, an explicit urge in her, &nbsp;a certain kind of feeling, &nbsp;dangerous.<br />\r\nNot really common but not rare either.<br />\r\nA burning thirst yelling to be quenched, she walked slowly towards her room, &nbsp;as she unveiled the laced cotton her beyond, somewhat dangerous, silence filled the room.<br />\r\nTimi looked up, to find his aunt standing at the entrance of her room and the parlour were he was playing doing nothing else but staring at him.<br />\r\nHer face unreadable, Timi smiled at her but she gave no response, &nbsp;she was just there looking at him like a predator eyeing its prey.</p>\r\n\r\n<p>Some minutes later the watching game she finally voiced out, with smile wide on her petite face with her beautiful teeth,<br />\r\nShe beckoned, &quot;My little Timi!&quot;<br />\r\n&quot;Yes big mummy&quot;, answered the ignoramus<br />\r\n&quot;Come &nbsp;here dear, come sit on my lap.&quot;</p>\r\n\r\n<p>Picking up the candy he had at hand, he lept for joy towards her, looking at her right in the eye with such innocence and stared back at his candy whilst fumbling with it, trying to unwrap it. &nbsp;With such swiftness, &nbsp;Aunty Ronke dropped him off her laps and pulled down his trousers.<br />\r\n&quot;Do you want to wiwi? &#39; Timi nodded negative but she didn&#39;t stop there, &#39;come let me off you top for you ehn, &nbsp;its time to go have your bath&quot;<br />\r\n&quot;Mama aff baff for me... &quot;, Timi replied<br />\r\n&quot;Shut up my friend!&#39; she yelled back intentionally to frighten him, &#39;Did mama not teach you to keep quiet each you&rsquo;re an elder orders you to do something?&quot;<br />\r\n&quot;I&#39;m sorry aunty ronke!&quot;, he concured<br />\r\nShe gave no response but started searching the boys thigh as if she was looking for something in particular, &nbsp;asking him to turn this way or the other till she finally exclaimed.<br />\r\n&quot;Ah! &nbsp;Ah!! &nbsp;Ah!!, &nbsp;what happened to your penis? &nbsp;Shey mama use sponge for you when she baffs you?&#39; &nbsp;Timi nods in assertion. &#39; eheen shey e dey hurt you anytime she does? , &nbsp;she said as she starts to pull the young boys&rsquo;s genitals.</p>\r\n\r\n<p>Timi nodded sideways to depict &lsquo;negative&rsquo; as a tear rolled down his cheeks.<br />\r\n&quot;Weytin do you, k&iacute;l&oacute;d&eacute; to f&iacute; n sunk&uacute;n(why are you crying), did I or anyone beat you ehn &quot; she asked angrily, &nbsp;her tone filled with violence.<br />\r\n&quot;E dey pain me&quot; &nbsp;(It&rsquo;s painful)<br />\r\n&quot;E dey pain you like this, &nbsp;mhm p&egrave;l&eacute;, &oacute;y&aacute; lie down okay?&quot;<br />\r\nHe obeyed every word from his aunt, &nbsp;a minute or two passed by like an hour, his aunt on him still deriving a pleasure so strange, he said nothing, &nbsp;he was just there, &nbsp;lying under having almost no idea of what it was, &nbsp;in his mind, &nbsp;she had beaten him, &nbsp;hurt him and he was going to tell his dad, &nbsp;he felt disappointed for he had come there to taste aunty Ronke&#39;s cookings, &nbsp;he had been eager to come receiving gifts, but here he was being involved in an activity strange to him and we can safely say &lsquo;He was being gifted with pain&rsquo;.<br />\r\nHe knew less of what it was but he knew it wasn&#39;t a good one either.<br />\r\n&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;..<br />\r\nAunty &nbsp;Ronke stood up ad tied her &igrave;r&oacute; around her waist, &nbsp;feeling pleasured, &nbsp;how she wanted in her own way, &nbsp;there was more to it, &nbsp;probably. The woman in her mid thirties with her beautiful dark hair, she was a bit pretty but would not pass for beautiful.<br />\r\nDark in complexion and five feet tall, &nbsp;well blessed with a woman&#39;s natural gifts, &nbsp;she kept beards. And for that she always looked strange for it only added a tiny bit to the reason she&#39;s still single, probably.</p>\r\n\r\n<p>Timi stared at this strange woman, she wouldn&#39;t be the same woman he knew or was she?, he wondered if there was something wrong somewhere, perhaps his mom had dropped him at someone else&#39;s house, &nbsp;he was too young to figure it that he had just been molested, too young to figure out that his favorite nice and cheerful aunty had just sexually exploited him.}<br />\r\nShe left the room and came back with a look Timi would term &lsquo;wicked&rsquo;.<br />\r\n&quot;To ba sÃ…Â fun Ã„â€œnÃ„Â«k&eacute;nÃ„Â« n&iacute;pÃ„Â oun t&oacute; sÃ„â€œl&egrave; nibi loni (if you tell anyone about what happened here today)<br />\r\nDo you know death?, she asked rather discourteously,<br />\r\n&nbsp;I mean do you know what it means to say someone died? &nbsp;Ik&uacute;! &nbsp;Ik&uacute;!! &nbsp;Death!!!&nbsp;<br />\r\nLaying emphasis on the words to scare him &#39;do you know death? &quot; he nodded in affirmation.</p>\r\n\r\n<p>&quot;You will die! &nbsp;If you tell anyone, your dad, mom or uncle, you hear?&nbsp;<br />\r\n&nbsp;I will kill you myself shootigbo!&quot; she yelled.<br />\r\n&quot;Yes m&hellip;.aa&quot; he replied stuttering and simultenously bursts into tears.<br />\r\n&quot;Good! &nbsp;Oya stop crying my dear.&quot; &nbsp;And with that his old Aunty Ronke was back again.<br />\r\n&quot;what will you eat?&quot;, she asked in a mother voice<br />\r\n&quot;Mi o jeun&quot;, was the reply the little one gave<br />\r\n&quot;Auhn so you&#39;re still angry ehn. &nbsp;P&egrave;l&eacute;!&nbsp;<br />\r\nYou will now come to my house and you won&#39;t eat anything ehn, &nbsp;that&#39;s impossible, wait here let me go prepare your favorite food.&nbsp;<br />\r\nDo you want Amala?, &nbsp;&#39; Timi nodded positive, trying to hide the scars.&nbsp;<br />\r\n&#39;Good boy! My little Timi, wait for me ehn, &nbsp;<br />\r\nRemember!&#39; She whispered again. &#39;Tell anyone and you will die but if you don&#39;t tell anyone ehn nothing will do you!&quot;<br />\r\n&quot;Okay big mummy&quot;, the dreaded sapiens replied his semi-motherly figure<br />\r\n&quot;Very good that&#39;s my baby boy&quot;, was the devil&rsquo;s response</p>\r\n\r\n<p>&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;</p>\r\n\r\n<p>The night came and they went to sleep, &nbsp;perhaps she had repeated it again or not was still a mystery but it sure looked like it wasn&#39;t going to be the last.</p>\r\n\r\n<p>Aunty Ronke woke up early the second day to prepare herself and Timi for the day, she woke Timi up for the morning devotion and gave him his bath, amidst playing with his penis.&nbsp;<br />\r\n&#39;Ok&oacute; rÃ„â€œ keere&#39; {You have a little penis}<br />\r\nShe &nbsp;would constantly say and Timi would smile shyly.</p>\r\n\r\n<p>Aunty Ronke prepared &Egrave;g&uacute;s&iacute; soup with &Egrave;b&agrave; for breakfast and before 10 am they were at the Gbadegesin&#39;s compound.<br />\r\n&quot;Ha Ã…ÂmÃ…Â mi kaabo&quot; Timi&#39;s mom exclaimed as she opened the door for the duo.<br />\r\n&quot;&Agrave;b&iacute; o! &nbsp;We are back niyen o, we thought we should give you a surprise &quot; Aunty Ronke replied the boy&rsquo;s mother as she entered with him and sits down&quot;<br />\r\n&quot;I thought as much because I remember saying I was coming over to pick him, &agrave;b&iacute; he was giving you a hard time ni?&quot; (Or was he giving you&hellip;.)<br />\r\n&quot;Hard time kÃ„â€œ, No! You know my little Timi is a good boy, his joy knows no bounds, God has blessed him with such a lively spirit, we had so much fun together, right Timi?&quot;<br />\r\nshe asked the young boy who only nodded affirmative with &nbsp;a half smile on his face.<br />\r\n&quot;Even I can see that myself, &nbsp;with all these toys he brought home and his bulged belly&quot;<br />\r\n&quot;He had &Egrave;b&agrave; and &Egrave;g&uacute;s&iacute; for breakfast and he had lots of food to his fill yesterday, don&#39;t be surprised if he starts to fart around &nbsp;the house &quot;, she made a joke out of the<br />\r\n&quot;Hahahaha&quot; they both laughed and Timi stared, looking at &nbsp;how the two gets along so well or had they planned it together?, &nbsp;he took his mind off what was bothering it as his dad came in the room<br />\r\n&quot;My son!&quot; he exclaimed<br />\r\n&quot;Papa&quot; his joy knew no bounds as he ran and embraced him.<br />\r\n&quot;Father and child, Sha take am easy o, &nbsp;we too go soon get married and have our own o, &nbsp;so stop making us jealous &quot;<br />\r\n&quot;Hahaha! &#39; he laughed,&#39; after you shave off your beards. &nbsp;&quot;<br />\r\nHe teased and they all laughed except Timi who only stood there feeling helpless.</p>\r\n\r\n<p>&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;</p>\r\n\r\n<p>The conversation faded away into thin air as the house could be viewed from afar. The morning dusts erupting from the ground.<br />\r\nThe birds singing a mournful song.<br />\r\nAnd life slowly draining away from him.<br />\r\nIt was no longer what it used to be, the sound of laughter might never mean the same again. &nbsp;Timi walked out and closed the door behind him. He stood there as he watched the morning fading into a beautiful chaos. &nbsp;<br />\r\nNo one will know and no one might ever understand.&nbsp;<br />\r\nThat feeling&hellip;.<br />\r\nThat burning feeling.</p>\r\n\r\n<p>Afterthoughts:<br />\r\nThe phenomenom that many feminists contemplate is that &ldquo;BOYS DO NOT GET TOUCHED AS THEY ARE STONG AND MANLY&rdquo; and I am certain this proves you wrong.<br />\r\nFor mothers, boys suffer a lot, but unlike in the case of the feminine gender, we do not really like talking about it, especially because the society makes us pretend to be what we (most) are not, HIGH AND MIGHTY.<br />\r\nYou need to let it OUT!<br />\r\nSo many boys/guys/men have faced sexual abuse and exploitations too but do not talk about it, why?<br />\r\nThe society has programmed us to be ROBOTS, without feelings of hurt or pain neurons, while in actuality, WE ARE NOT!<br />\r\nWe also get hurt and need someone to talk to, you cannot fully understand what we GO THROUGH unless we talk about it.</p>\r\n\r\n<p>Stay safe and be well.<br />\r\nMake your voice heard.</p>\r\n\r\n<p>&copy;Anonymous<br />\r\n&copy;Emmiasky Ojex</p>', 'uploads/15441170686483045WhatsApp_Image_2018-12-06_at_8.17.17_AM.jpeg', 'j90819542aBn72i', '17:15:33', '2018-12-06', '1544116533t8ig31se6099hih2n1t0', 'uploads/15441170685501520WhatsApp_Image_2018-12-06_at_8.17.17_AM.jpeg', 1),
(46, 'THE STORY IN MY HEAD: I HAVE SUFFERED TOO (Day 7 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>&nbsp;</p>\r\n\r\n<p>Days in school when I was the fat monkey in class<br />\r\nThose times when I always had to sit at the back<br />\r\nFor fear that someone might come in and on my neck, tap<br />\r\nBut to the teacher it&rsquo;s a normal routine but they do not know that I am battered</p>\r\n\r\n<p>Times when I am called to answer<br />\r\n&ldquo;Solve for x on the board&rdquo; sayeth the teacher,&nbsp;<br />\r\nBut I am the Dumb-George of the class<br />\r\nAnd it&rsquo;s turn to become the joker of the day for He doth not know Maths</p>\r\n\r\n<p>Days when I didn&rsquo;t grow breasts<br />\r\nAnd wasn&rsquo;t like any of the hot girls<br />\r\nDamn, I wanted to be like them<br />\r\nShow the boys too what it means to be a fem&rsquo;</p>\r\n\r\n<p>I have suffered rejection too<br />\r\nI have suffered abuse too<br />\r\nTimes when being strong wasn&rsquo;t mental but at the back of the class<br />\r\nWe always had to see who had the strongest arms</p>\r\n\r\n<p>Girls cheering to see who the winner would be<br />\r\nAnd I getting killed internally<br />\r\nFor I knew at the back of my mind<br />\r\nThat this is already a lost fight</p>\r\n\r\n<p>It&rsquo;s ended, I am on the ground<br />\r\nMy back&rsquo;s lying flat<br />\r\nIt was a punch that made him the winner<br />\r\nThus from that day, I was the school looser</p>\r\n\r\n<p>I couldn&rsquo;t talk,<br />\r\nFor every little thing that came out turned a horror<br />\r\nTo the extent that I looked down the bridge<br />\r\nAnd wanted to concede life&rsquo;s defeat.</p>\r\n\r\n<p>Afterthoughts:<br />\r\nSo many kids in schools or educational institutes today suffer depression because they think too much of their size, height, brain power, loss of grade and once this gets out of hand; may lead to death, self-harm and other malicious practices, although this may not be easily visible on their faces as they go around the school pretending all is well, but deep within, nothing is right and most teachers do not know this.<br />\r\nTo that kid who knows nothing, tell him HE HAS SOMETHING, don&rsquo;t just advice him/her academically, give life&rsquo;s advice too.</p>\r\n\r\n<p>Source: Ibadan, Nigeria<br />\r\n&copy;Emmiasky Ojex</p>', 'uploads/1544199775665252IMG-20181207-WA0017.jpg', 'j90819542aBn72i', '16:22:57', '2018-12-07', '1544199777s8ght092e17ti44i96hn', 'thumb/1544199775550402IMG-20181207-WA0017.jpg', 1),
(47, 'THE STORY IN MY HEAD: VOICES (Day 8 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>I hear voices in my head<br>Telling me I am not fit for earth<br>Telling me, \'here, I do not belong\'<br>Thus, my stay should not be long</p><p>I hear voices telling me to quit it all<br>Telling me to jump into the water and be gone<br>They are my voices<br>I tell me that I am not worth it.</p><p>That I am too dark to have a fan<br>and too skinny to have someone to call me honey<br>Too fat to be awarded a job at Walmart<br>And too dumb to ever make something as major as impact</p><p>I tell me that I have nothing to offer the world<br>Can you not see that all\'s been done?<br>I tell myself that!<br>and I missed the mark as a dart thrown by everything\'s true Maker</p><p>&nbsp;</p><p><br>Hello friend,<br>I might not know you today,<br>But I have this to say to your feeble mind.</p><p>\'You are not worthless<br>And there should never be anyone who makes you feel less<br>If there is,<br>Quit such hazardous relationship<br>As it leads no one to a point of success</p><p>You have something within you to offer the world<br>You just haven\'t found one<br>Or maybe you have and it seems like it\'s not working out for you.<br>Family and friends too are not proving helpful<br>As the only thing they wish to see it the result and not the hard process that involves the work</p><p>If all these choke you<br>And makes you feel like you can\'t do,<br>The one thing in your head that makes you \'YOU\'<br>I am here to tell that the voices do not tell the truth.</p><p>Afterthoughts:<br>So many people feel like all they do in not substantial enough to make them great esp young entrepreneurs, get depressed over time and many finally call it quits, see you don\'t need the perfect brain to be great, you just need to see yourself as one with a perfect life (despite all ups and downs)<br>-Suicide is really not the solution-<br>-It us putting a permanent end to a temporary problem-</p><p>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15443045001576317IMG-20181208-WA0020.jpg', 'j90819542aBn72i', '21:28:22', '2018-12-08', '1544304502tn268hhgei02263it64s', 'thumb/15443045002757429IMG-20181208-WA0020.jpg', 1),
(48, 'THE STORY IN MY HEAD: NO WITCH(Day 9 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>&nbsp;</p><p>I am no witch<br>Just a boy you decide to maltreat<br>I am not a thug<br>I only went out to play with other boys</p><p>Why did you have to tie me to the wall for a sin I know naught?<br>And why dÃ¢â‚¬â„¢yu have no inch of trust for my words?<br>Do I threaten your happiness that much<br>That you had to pour on me, hot oil?</p><p>I am just a little lad that was brought up on the wrong side of earth<br>Just the unfortunate son of some old couple in the village<br>Who sold me to you for an amount of paltry worth<br>Despite living in the most commercial state in the nation, I still eat crumbs</p><p>I am no witch<br>But if you see me as one<br>I have no words,&nbsp;<br>However if the Prince of Darkness calls, to poison the family meal,<br>I wonÃ¢â‚¬â„¢t resist and will gladly do The Dark LordÃ¢â‚¬â„¢s bid</p><p>But know, I can still help out<br>Thus, this is a plea to my owner (if she ever sees this)<br>treat me like the SUN<br>and watch as I light up your WORLD.</p><p>Afterthoughts:<br>Child trafficking, abuse, labour should be dettered massively in the world as most bosses really just exploit these kids after making them do literally all the chores for them and still leaving them at the mercy of hunger.<br>More so, for all houses that already have such (workers, house-aids, cleaners etc.), please try as much as you can to take care of the young lad or patootie youÃ¢â‚¬â„¢ve got in your custody, youÃ¢â‚¬â„¢re realistically their HEMI-PARENTS now, so why not treat them well, if you canÃ¢â‚¬â„¢t even treat them like you do your children?<br>They should have access to education too, good food, and a good life, they are not SLAVES to your will, they are just unprivileged but you can turn that around.</p><p>#NoToChildLabour<br>#HealingHumanity</p><p>Story source: Alagomeji, Yaba, Lagos</p><p>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15443897064158753IMG-20181209-WA0017.jpg', 'j90819542aBn72i', '21:08:28', '2018-12-09', '1544389708ie9igh73299t9h1t6sn8', 'thumb/15443897063778696IMG-20181209-WA0017.jpg', 1),
(49, 'THE STORY IN MY HEAD: DONÃ¢â‚¬â„¢T WAKE ME UP (Day 10 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>&nbsp;</p><p>Ã¢â‚¬Å“ItÃ¢â‚¬â„¢s hard, Emmiasky, living life this way, can you help me?Ã¢â‚¬Â<br>was what started this tale!</p><p>Each time before the night passes, I close my lids and wish all these could just go away<br>But as I open them back to this cold dosage of reali-TEA<br>I remember that all these is true and I am still ME<br>The one no one wants,<br>The one censured as doom to the family name<br>She claims I have thrown the familyÃ¢â‚¬â„¢s pride into ignominy and shame</p><p>But what am I to tell?<br>The stories in my head are true pain and tales of hell<br>Do I have pride?<br>In telling you that I donÃ¢â‚¬â„¢t know how many men laid on me that inauspicious night?</p><p>She says she canÃ¢â‚¬â„¢t be the grandma of a bastard<br>Dad too says he cannot father a being (not a son in his case) that isnÃ¢â‚¬â„¢t of his sperm<br>But who am I to let know,<br>that they both caused me to be the victim in this hell hole?</p><p>Times when girls like me shouldÃ¢â‚¬â„¢ve been in school<br>I was not, had to fend for you two<br>I donÃ¢â‚¬â„¢t regret youÃ¢â‚¬â„¢re my parents<br>IÃ¢â‚¬â„¢m just saying, it seems God chose wrongly for me, back then</p><p>I had to visit one of your friends, Mom; the other day<br>DidnÃ¢â‚¬â„¢t want to tell you, but Uncle Tunde finally had his way<br>Not just him though, he gladly shared me with friends and close pals<br>But what am I to tell you when even I do not know how many ate of this forbidden fruit?</p><p>Please donÃ¢â‚¬â„¢t wake me up<br>For all I feel right now is to leave this place and never return<br>For everywhere I go<br>I am a joke!</p><p>Yet you still want me out of your lives<br>DonÃ¢â‚¬â„¢t worry, IÃ¢â‚¬â„¢ll be gone<br>But know that a stitch in time saves nine<br>And the family name you see in the gutter will soon be stained better in the mud.</p><p>Afterthoughts:<br>Teenage pregnancy or unwanted pregnancy!<br>Yeah, thatÃ¢â‚¬â„¢s a common feat in this part of the world, but as parents, chasing out your females because of such error is not, in any way helping the situation, forget about the family name, she has a life to live too.<br>Besides, who are you protecting the name for? Is it not generations to come?<br>How will you feel like if all you worked for, after chasing her out was a waste at the end of your life?<br>Embrace the scars, it might have not been RAPE (like this case), it might have been her sauciness or youthful exuberance to see how good/bad sex is.<br>Well, a lesson as PREGNANCY teaches one for LIFE, as there is no escaping it, you see your products daily and wish Ã¢â‚¬Å“HAD I KNOWN!!!Ã¢â‚¬Â<br>But chasing them out!! That is pushing them to the world they once stepped in for a little while and got shocked, now however, they have no home to return to.<br>Ã¯Æ’Â¨TheyÃ¢â‚¬â„¢d drop the young ones to be picked up or something worseÃ¯Æ’Â§<br>And fully go into the business of spoiling themselves more (not in every case obviously as very few of these women/ladies help themselves become a success)<br>Like I said, please EMBRACE THE SCARS</p><p>Ã‚Â©Emmiasky Ojex<br>Story source: Yaba, Lagos</p>', 'uploads/1544464687753344IMG-20181210-WA0006.jpg', 'j90819542aBn72i', '17:58:09', '2018-12-10', '15444646896ne8si83h9t4t0i0g33h', 'thumb/15444646874116357IMG-20181210-WA0006.jpg', 1),
(50, 'THE STORY IN MY HEAD: HOW I WISH MOMMY KNEW (Day 11 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>&nbsp;</p><p>I\'m not here to sing lullabies that sweeten your ears,<br>But to whisper Echoes of dirges I hurl to my dead-self.<br>I\'m not here to tell you tales of my village,<br>But to retell the stories of my Ill-age you\'ve devoured.</p><p>As a little girl,<br>Mom taught me life was filled with roses and Honey -&nbsp;<br>roses father brought back from work carrying my little body in his arms as he entered into the kitchen to lick the honey mother kept on the shelf.</p><p>But the Arrival of uncle Bola taught me Roses are thorny as I was molested anytime he\'s Horny.</p><p>With today,<br>a reminiscence into the past of my yester-year,<br>I remember the love that dwelt within the cage that now palaces the demons that hoard haunting memories in my heart.</p><p>If only uncle Bola didn\'t come,<br>My \'B\' will still be for the Ball dad played with uncle Bola, and not Bitterness caused by the dangling balls welded to the rod in between the thighs of a man my father called Brother.</p><p>Uncle bola was a snake. He still is,&nbsp;<br>His venom not only metamorphosed me but also changed my alphabets.</p><p>My \'A\' went for Anguish.<br>Anguish was what I felt when uncle Bola took me out to buy biscuit, and I wish mom knew he was only looking for a chance to play with my clit. with claims of me being his little daughter, he stole away my pulchritude.</p><p>My \'B\' changed from Believe to Bitterness.<br>With my beloved I grew up with bitterness,<br>For I know not how to tell mom I don\'t want to stay with Uncle Bola anytime she drops me at his place on her way to work.<br>I still hear the echoes of her voice in my soul telling uncle Bola not to give me too many sweet. The Devil called man will smile in his devilish ways saying \'Yes Ma\'.<br>If only mom Knew.</p><p>If only Mom knew his okay meant I won\'t be Okay.<br>If only Mom knew the sweet I know is the demonic rod that dangles between uncle Bola\'s thighs.<br>If only mom knew the sweet I am to be given only barters my happiness with darkness and bitterness.</p><p>I wish the hands of yesteryear be rewinde[d].<br>Maybe I\'ll get a chance to tell Mom,Uncle bola is the demon that made my life a Jester fair.</p><p>And \'C\' went for Crushed,<br>Crushed I was(am) into pieces anytime uncle bola came to our house on Saturdays to play tennis with Dad.<br>I curse those times mom fed him meals with wishes in my heart he\'s poisoned to death.</p><p>As a little girl,<br>The darkness in my heart were enough to consume the moon,<br>With Nostrils that no longer grace the sweet scent of roses father brought home but a soul that questions if this house was my home.</p><p>\'D\' went for death,<br>Death became a regular ally and the comfort for my graving soul.<br>I still remember the smooth hands of uncle Bola scratching my fragile body as he tries to force himself between my legs,<br>With tears and wails from a lone soul to no avail.</p><p>The knock of mom at the door that day breathe life upon my hole but left me with wishes!<br>Wishes i could utter words when mom asked why I was crying-<br>But the gaze of feary storm upon uncle Bola\'s eyes shut my mouth leaving the doors ajar.</p><p>E is for echoes,<br>Echoes of maladies of my lost mind,<br>Echoes of the dirges i sang each time I lost the sanity of my mind,<br>Echoes of the trauma I feel each time I sit in the living room wanting to shout,scream and tell to the world,<br>That the person standing next to father in the portrait,<br>Isn\'t my uncle,<br>But a demon who found his ways to kill my dream.</p><p>I was once loved,&nbsp;<br>But life wasn\'t fair and my life was changed into a Jester-fair.</p><p>From a soul with a sad mind in the continent.<br>(c)Anonymous</p>', 'uploads/15445608084656741IMG-20181211-WA0000.jpg', 'j90819542aBn72i', '20:40:10', '2018-12-11', '1544560810it68nh4ei01g77h6st35', 'thumb/15445608088723620IMG-20181211-WA0000.jpg', 1),
(51, 'THE STORY IN MY HEAD: I HOPE YOU FIND YOUR PEACE(Day 12 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>&nbsp;</p><p>I hope you never get to know of the pain you made me go through<br>When you walk around the earth searching for water and food<br>I hope you never realize you took away the best part of my lifeÃ¢â‚¬â„¢s sojourn<br>And toiled it in the trash-can your penis offered because I refused to be, on the bed, &nbsp;yours</p><p>I hope youÃ¢â‚¬â„¢re forgiven for deceiving me and my mates into thinking youÃ¢â‚¬â„¢re a human being<br>When truly, you are a Mephistopheles<br>It didnÃ¢â‚¬â„¢t last much,<br>But the memories still, till today hurt</p><p>I still can tell no one<br>The reason why they all seem to be having fun but I am suddenly dull!<br>and NO, itÃ¢â‚¬â„¢s not a mood swing, it a memorial occurrence<br>The day my blessing came in the form of death</p><p>YouÃ¢â‚¬â„¢d taken me to the bar across two streets<br>ItÃ¢â‚¬â„¢s a normal thing to do in every love affair; I thought<br>Only for the details of this thoughts to get stuck<br>In my head, as memories of the day thatÃ¢â‚¬â„¢ll forever be green</p><p>A little too much wine, we had<br>That I didnÃ¢â‚¬â„¢t realize it was not just drinks in the bar<br>You had a sleep-inducing pill too, in your hand<br>And when you offered it to me, I was glad</p><p>DidnÃ¢â‚¬â„¢t see my shadow no more<br>I shouldÃ¢â‚¬â„¢ve realized something had gone wrong<br>But before I muttered the words from my rima oris<br>YouÃ¢â‚¬â„¢d already told me to gladly accept Ã¢â‚¬Å“ONE MORE and IÃ¢â‚¬â„¢ll take you homeÃ¢â‚¬Â<br>clock</p><p>I felt elated at the thought of leaving and gladly sipped green from the sap (of the tree) of hypnosis<br>And the job was done already and I was out of it<br>I lost my mind<br>And on the bed the next morning, was where I would be found</p><p>What?<br>Who would believe that right?<br>Yeah, but it happened, to me<br>But when I talk, no one believes</p><p>Even my friends would think I am a dumb and an idiot<br>I guess I am one<br>If I was gullible enough to let him go scot free with the evil he did<br>But they do not know that I sought help from officers, but they did, NOTHING.</p><p>Afterthoughts:&nbsp;<br>ItÃ¢â‚¬â„¢s a pitiful act when many people still see rape as a joke especially guys,<br>So many people would claim this is just a made-up story however, it is not as this act occurs daily, ladies getting drugged and led to the nearest room (itÃ¢â‚¬â„¢s usually been planned).<br>But please and please, do not ever take a rape case as a joke, itÃ¢â‚¬â„¢s life treathening, mind buggling. The victims are led into their mindÃ¢â‚¬â„¢s abyss and made out with, against their will (In this case, she refused to have an intercourse WITH HER BOYFRIEND, yes Ã¢â‚¬â€œ her boyfriend).<br>For ladies too, donÃ¢â‚¬â„¢t bother getting entangled in relationships when you are not ready, you never know what your man might ask for, and when you refuse to be the pawn of the beast you claim to be Ã¢â‚¬Å“the man of your dreamsÃ¢â‚¬Â, something happens, which might be BAD.</p><p>Side Note: Eventually, many men forget about what evil theyÃ¢â‚¬â„¢d done but do not understand the repercussion. &nbsp;Like they say Ã¢â‚¬Å“KARMA ISSA KILLER!Ã¢â‚¬Â</p><p><br>Story source: Ogun State, Nigeria<br>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15446440187963635IMG-20181212-WA0001.jpg', 'j90819542aBn72i', '19:46:59', '2018-12-12', '1544644019ht201tie0nh7180s9g3i', 'thumb/15446440184000576IMG-20181212-WA0001.jpg', 1);
