(52, 'THE STORY IN MY HEAD: ONLY IF YOU KNEW(Day 13 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p><br>#TheStoryInMyHead</p><p>Only if you knew what she holds deep down in her heart<br>only if you understood what large hole you left in her<br>when you said Ã¢â‚¬Å“no moreÃ¢â‚¬Â<br>And told her to go and hug death since she didnÃ¢â‚¬â„¢t want you gone</p><p>Only if you knew what pain he felt<br>When you said to him, Ã¢â‚¬Å“YouÃ¢â‚¬â„¢re not needed on this planetÃ¢â‚¬Â<br>Only if you knew how his heart sunk<br>When you told him Ã¢â‚¬Å“Your destiny reeks and you are a skunk without a futureÃ¢â‚¬Â</p><p>Only if you understood the weight your joking words<br>Meant to her when you called her Ã¢â‚¬Å“Something without WORTHÃ¢â‚¬Â<br>Only if you understood when you told your husband that he is not supposed to call himself a man<br>Since he cannot afford to take care of the house now that he lacks</p><p>Only if you knew, you wouldnÃ¢â‚¬â„¢t have called him educationally retarded<br>He also wishes but just cannot seem to learn<br>WhyÃ¢â‚¬â„¢d you make him a joke for it?<br>ItÃ¢â‚¬â„¢s also against his wish</p><p>She also wishes her brain could absorb<br>Everything the teacher, in class; taught<br>But since she cannot seem to,<br>Why has she become the song topic of you and your threatening friends at school?</p><p>Only if you understood that there was nothing we could do<br>But watch as life turn us into fools<br>Something we never were<br>But like lifeÃ¢â‚¬â„¢s drama, we came to become what we couldnÃ¢â‚¬â„¢t bear</p><p>Only if you knew what we bear in our hearts<br>The suicidal thoughts running through our heads on those loveable nights<br>Maybe if you knew,<br>You would have helped us live longer than that!</p><p>Maybe you wouldÃ¢â‚¬â„¢ve shut your mouth over our lifeÃ¢â‚¬â„¢s business<br>Maybe you wouldÃ¢â‚¬â„¢ve never called us THE HOPELESS<br>Maybe olodo wouldnÃ¢â‚¬â„¢t have been our school name<br>And maybe someday we too wouldÃ¢â‚¬â„¢ve done little to help the world with our worthless BRAINS.</p><p>Maybe we all wouldÃ¢â‚¬â„¢ve helped heal the world together.<br>Only if you did know!<br>Please know now, if you didnÃ¢â‚¬â„¢t;<br>We all should mind what we say to the hurt ones around us.<br>&nbsp;</p><p>Afterthoughts:<br>People go through lots of difficulties daily, they are already thinking in their minds that living is not worth staying and feel as though death is the next step, your words, as an external however, can goad something in them, talking to a person who is on the verge of giving up (motivating him or her/preaching/saying soothing words can really trigger peace and a sense of belonging to them but neglecting them and ostracizing them, even if the society does is &nbsp;really not a good thing to do to someone who is already on the verge)</p><p>If you didnÃ¢â‚¬â„¢t, know today; YOUR WORDS MEAN A LOT TO THE PERSON YOU SAY IT TO<br>You never may understand what he/she is going through but if you say something nice, it changes everything, even if for a little while Ã¢â‚¬Â¦. HEAL THE WORLD</p><p>From a friend that cares,<br>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15447381368274544IMG-20181213-WA0059.jpg', 'j90819542aBn72i', '21:55:38', '2018-12-13', '1544738138ng0234h006it6i8h6set', 'thumb/15447381365757313IMG-20181213-WA0059.jpg', 1),
(53, 'THE STORY IN MY HEAD: WE NEED HELP(Day 14 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p><br>#TheStoryInMyHead</p><p>Everyone of us has friends, since no man is an island in anyway<br>Now, how about Ã¢â‚¬ËœCLOSE FRIENDS?Ã¢â‚¬â„¢<br>Those types of friends that you go on hangouts with, grew up together with, made memorable moments with?</p><p>Oh yeah,<br>Did any of them have a down moment recently?<br>Lost a job?<br>Divorced?<br>Had an accident?<br>Lost admission?<br>Lost grade in school?<br>Lost a sibling or life support?<br>Suffered bully?<br>Was raped?<br>and so onÃ¢â‚¬Â¦</p><p>Please I would like you to know today;</p><p>These set of people pretend a lot, they will up a faÃƒÂ§ade and act like all is well, but bet me this, NOTHING is well, THEY ARE AS FRUSTTRATED AS CAN BE, most often, blame themselves for the bad occurrences (despite knowing that they could not have done anything palpable about it) Ã¢â‚¬Â¦ You see them asking questions (mostly in solitude) like&nbsp;<br>Ã¢â‚¬Å“What if I didnÃ¢â‚¬â„¢t tell him to go?<br>What if this and thatÃ¢â‚¬Â<br>and thus in the process, make themselves feel guilty for occurrences that are irreversible.</p><p>Oh yeah, have you ever asked&nbsp;<br>Ã¢â‚¬Ëœhow they are doingÃ¢â‚¬â„¢, yet the constant response you get is&nbsp;<br>Ã¢â‚¬Å“I am fine, All is well, DonÃ¢â‚¬â„¢t worry about me!Ã¢â‚¬Â<br>Please DO!!!, please worry about them as you donÃ¢â‚¬â„¢t really wanna hear of a bad issue when you couldÃ¢â‚¬â„¢ve done little to help out, many people are not emotionally stable, TRAUMATIC EVENTS like the above mentioned can trigger evil thoughts in such people especially VICTIMS of assaults and so on.</p><p>As many of them feel life is USELESS, they were just a PAWN, theyÃ¢â‚¬â„¢ve been USED and so on (they wonÃ¢â‚¬â„¢t normally tell these things to just anyone, but if you know how to get to them, you will hear these and many more)</p><p>Please do not leave them alone even when they tell you to, stay around, thatÃ¢â‚¬â„¢s when you are needed the most, they need someone by their side,&nbsp;<br>someone to tell them that all is and will be well,<br>someone to tell them that Ã¢â‚¬ËœLifeÃ¢â‚¬â„¢s not made up of the bad memories but of what we make of these memoriesÃ¢â‚¬â„¢</p><p>You can be that person, NOW<br>Try to remember, and make an attempt to help out in whatever way you can, some require money (in case bankruptcy or total lack and are in deep need of it), you may or may not have but please do the little you can, pull up a fundraiser for them, youÃ¢â‚¬â„¢ve helped (in that little way)</p><p>*I once made a post on the statistics of suicide counts per year around the world and the numbers seems to not be in decrease as each year approx Ã¢â‚¬Â¦Ã¢â‚¬Â¦Ã¢â‚¬Â¦..*<br>*The post can be accessed via https://www.facebook.com/171739306811190/posts/212119892773131 *</p><p>You just made them understand that they are not alone, make them realize that they have so much in excess than others, tell them that they are loved, do not make them feel lonely, watch a movie together, go out together&nbsp;<br>-even if it means using your last dime {itÃ¢â‚¬â„¢s better than regretting not doing so}-</p><p>ItÃ¢â‚¬â„¢s up to you to restore TRUE HAPPINESS IN EVERYONE OF US<br>It starts with you friend, and I.</p><p>I hope this article passes a message and someone reaches out to another soul today.</p><p>Please do not misunderstand something, many people in these categories may not think of ending themselves but rather endangering more lives and theirs<br>-Ladies who were infected with HIV/AIDS may turn prostitutes, spreading the venom more to their unknowing idiotic customers who in turn contract their family {and so on}<br>-Guys may pick up the guns and form a clique with the aim to do, only EVIL</p><p>Ã‚Â©Emmiasky Ojex</p><p>Please pass on the baton if you agree with this.</p>', 'uploads/15448713453870IMG-20181214-WA0055.jpg', 'j90819542aBn72i', '10:55:46', '2018-12-14', '15448713468s12nti0gh262t15i8eh', 'thumb/15448713457154343IMG-20181214-WA0055.jpg', 1),
(54, 'THE STORY IN MY HEAD: BLAME THEM; NOT US(Day 15 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p><br>#TheStoryInMyHead</p><p>We were the normal kids,<br>wanting nothing more than Mom and Dad\'s support,<br>But what did we get for failing in the last maths test?<br>Yeah, days and nights of irking talks.</p><p>I was the boy with much ambitions,<br>Grow up and be the best you can in life, it\'s your future<br>But No, this duo just wouldn\'t let me be,<br>They\'d rather make my life miserable with rules that are not made for me.</p><p>They\'d say, YOU\'RE A BORN LAWYER,<br>but if I could I would\'ve responded, YOU\'RE A BLOODY LIAR,<br>Because I do not see myself, contemplating crossing the Ts and dotting the Is of another man\'s case,<br>No, I\'d rather have myself in the wake of the night, painting the world\'s look on a canvas as a portrait.</p><p>Steve told us,&nbsp;<br>\"We cannot solve problems with the same minds we used in creating them\",<br>I now seems like our turn to elevate them,&nbsp;<br>We are ready to levitate from here,<br>but why\'d you clip our wings under the guise of modern education?<br>Compelling us to live our lives under this forced jurisdictions?</p><p>We are tired of spending life in a jail,<br>Forced upon us by our ignorant parents,<br>Who still wish they knew best,<br>But deep down, they know less.</p><p>Blame them, if we ever cut this rope,<br>We are already on the stool,<br>about to let all hell break lose,<br>For we may someday get tired of living a life that is NOT OUR OWN.</p><p>Afterthoughts: Parents are the basic advisors of their wards, they need to learn the difference between being opinionated and being mandatory over issues that affects their children\'s future.<br>If your child doesn\'t want to do something or take a career path as opposed to what you intend for them, DON\'T force him or her to do it, it leads to emotional distortion, and besides, IT\'S THEIR LIVES; NOT YOURS.</p><p>Source: Somewhere in the world.<br>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15449744363922149IMG-20181215-WA0038.jpg', 'j90819542aBn72i', '15:33:58', '2018-12-15', '1544974438t44esg8876ni3i105thh', 'thumb/15449744368631986IMG-20181215-WA0038.jpg', 1),
(55, 'THE STORY IN MY HEAD: IS THIS STILL HOME?(Day 16 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>&nbsp;</p><p>When all I see in my room are broken dreams and lost hope<br>When all mom cares about is seeing the back of me, leave<br>Dad left her, so sheÃ¢â‚¬â„¢s on her own<br>All and the aggressionÃ¢â‚¬â„¢s mine to receive</p><p>But I did nothing wrong<br>For I forced no one, for me to be made<br>So why canÃ¢â‚¬â„¢t I play when I want<br>But, itÃ¢â‚¬â„¢ll result to a slap on my young face</p><p>Is this still home?<br>MomÃ¢â‚¬â„¢s favorite spot is the local bar, her place of hustle<br>After sheÃ¢â‚¬â„¢s done with her shenanigans and roam<br>She comes home to talk with her new best friends, coke and alcoholic bottles</p><p>This is not a place of rest<br>When I canÃ¢â‚¬â„¢t even sleep with both eyes closed<br>Each sound I hear at night causes thumping sounds on my chest<br>For I know not whether or not this woman has oÃ¢â‚¬â„¢erdosed</p><p>But what am I to do?<br>She made me and thatÃ¢â‚¬â„¢s why I am still here<br>But sheÃ¢â‚¬â„¢s killing me too<br>And this may cause to leave, and never be near.</p><p>Afterthoughts:<br>Marital disharmony entails more than just the normal disunion between two individuals and it leads to a lot on the childÃ¢â‚¬â„¢s part as they will have to survive/latch unto one of their parents and if the law takes itÃ¢â‚¬â„¢s way, may go wrongly as these kids may be handed over to the wrong partner, prolly because of age, Ã¢â‚¬Ëœfeigned responsible behaviourÃ¢â‚¬â„¢ of the parent or for other reason best hashed out and jurally settled (most times Ã¢â‚¬Å“pretentiouslyÃ¢â‚¬Â).</p><p>The trauma some parents, ladies especially experience after divorce is usually more than the eyes can see as they get wrong ideas from various individuals on how not to think about the occurrence and other whatnots, in the process demoralize themselves and get entangled in series of denigrating acts like drug abuse, meaningless partying/sex, drunkenness and so one which will all, to a great extent affect the lives of their wards who Ã¢â‚¬Ëœobviously see them doing theseÃ¢â‚¬â„¢, itÃ¢â‚¬â„¢s no news today to know that many couples who experienced divorce were mostly products of broken homes too, not to talk about the drug addicts we find daily, same story, BROKEN HOMES.</p><p>THINK THRICE BEFORE SAYING Ã¢â‚¬Å“I DOÃ¢â‚¬Â,<br>It means a lot more than Ã¢â‚¬Ëœwhat we see marriage as today!Ã¢â‚¬â„¢</p><p>Story source: Lagos state, Nigeria<br>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15449772804887779IMG-20181216-WA0015.jpg', 'j90819542aBn72i', '16:21:22', '2018-12-16', '1544977282e3ti31h1it75nh0gs937', 'thumb/1544977280726806IMG-20181216-WA0015.jpg', 1),
(57, 'THE STORY IN MY HEAD: BEFORE YOU LAUGH AT ME(Day 17 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p><br>#TheStoryInMyHead</p><p>My name is, well what everyone knows me as is NOBODY<br>But I couldÃ¢â‚¬â„¢ve become somebody<br>If only I had listened to the words Mama and every other person wishing me well telÃ¢â‚¬â„¢d<br>When they were coming in at my tender age of ten</p><p>Sorry, but I didnÃ¢â‚¬â„¢t<br>Rather, I was with the girls, loved partying, really did!<br>Day and nights, the local bar was my favorite meeting spot<br>Not for any other purpose but to do manÃ¢â‚¬â„¢s most interesting job</p><p><br>Having sex at least thrice a week<br>After it, going for ablution, I\'d pray God to God fall sick<br>Smoking with my fellow air-headed mates<br>We loved the life we thought we had and thought this was our fate</p><p>My name is nobody<br>And today I will be telling you a little of my lifeÃ¢â‚¬â„¢s tale<br>Of how mama cautioned me each time I got home late at night, intoxicated, Ã¢â‚¬Å“Son, you have a life to leadÃ¢â‚¬Â<br>But Ã¢â‚¬Å“YES, Mama, I knowÃ¢â‚¬Â was the reply I always would give</p><p>But, what can the poor lady do?<br>After all, I had grown physically and not, anymore; her little coo-coo<br>And all she could do was talk and talk<br>To the young idiot of 23, back then, I was</p><p>I didnÃ¢â‚¬â„¢t realize that life waits for no one<br>And thought that this was all just one wonderful love song<br>For the next twenty years or more<br>I donÃ¢â‚¬â„¢t think I did anything of worth for myself or the world</p><p>Now, I am 47 years old<br>My timeÃ¢â‚¬â„¢s been sold<br>To the bottles I once thought I controlled<br>But like the green snake under grass, I was feasting on the time I shouldÃ¢â‚¬â„¢ve grown</p><p>Now, you see me pushing carts and laugh at me<br>But I hope you will not be<br>The stupid son (or daughter) I was<br>To the dead-loving woman, my mother for now sheÃ¢â‚¬â„¢s gone.</p><p><br>Afterthoughts: Yeah, we all &nbsp;understand the pressure youths feel, we want to enjoy the bliss of this moment, we say LIFEÃ¢â‚¬â„¢S TOO SHORT TO LIVE IT LOCKED UP and want to explore all the immoral things we can, we say NOW IS THE MOMENT and NOTHING SHOULD KILL IT FOR US, thus we smoke, do drugs, steal, have sexual intercourse, party rather than focus on the one thing we should really be doing and which is LEARNING.<br>The moment is not now, it is tomorrow, like Ali said Ã¢â‚¬Å“Suffer now and live the rest of your life a ChampionÃ¢â‚¬Â, it would be applicable if you say to yourself too Ã¢â‚¬Å“Deprive yourself of the vain things now, learn and see the good results in the futureÃ¢â‚¬Â<br>Maybe if all young ones could do these, we would need not worry about the population of poverty-wrecked people in the and maybe we would truly have the ability to CONTROL THE PEOPLE.</p><p><br>Story source: All countries of Africa and other parts of the world<br>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15451541656935410WhatsApp_Image_2018-12-17_at_5.17.58_PM_(2).jpeg', 'j90819542aBn72i', '17:29:26', '2018-12-17', '1545154166ie7427t7770hhsitn6g0', 'thumb/15451541653588489WhatsApp_Image_2018-12-17_at_5.17.58_PM_(2).jpeg', 1),
(58, 'THE STORY IN MY HEAD: ALL YOU WANTED(Day 18 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>#TheStoryInMyHead<br><br>All you wanted was a few minutes of pleasure<br>To get dirty with this petite at your time of leisure<br>But did you care or not<br>For every seed sown, surely has a reward<br><br>I said Ã¢â‚¬Å“NO\"<br>What part of N-O is so operose to KNOW?<br>Do you know what that act cost me?<br>ItÃ¢â‚¬â„¢s not for you to say SO SHALL IT BE</p><p>I have a voice too<br>He gave me to use it whenever I want to<br>I said that Ã¢â‚¬Å“I am NOT\"<br>Now you say, I was just playing HARD LIKE A KNOT?</p><p>All you wanted was a five-to-ten minute game of love<br>With a lady whoÃ¢â‚¬â„¢s not yours<br>And even if she was<br>She didnÃ¢â‚¬â„¢t want it and so didnÃ¢â‚¬â„¢t have to be forced</p><p>Five minutes; to a lifetime of pain, equals<br>What can you sum up?<br>Of the pain she had to cover up<br>That she had to cry out her eyes before sleep takes her off?</p><p>All you wanted was fun,<br>But, since youÃ¢â‚¬â„¢ve gotten what you want<br>And have left her in a shell of the young madam<br>DonÃ¢â‚¬â„¢t blame if she tries to come at you and stab!</p><p><br>Afterthoughts: ItÃ¢â‚¬â„¢s really sad to know that despite numerous humanitarian acts and programs, many people still go on rampage to rape a fellow being these days, it makes one wonder whether these set of people actually are only uneducated but maybe, the are ANIMALS too.<br>ItÃ¢â‚¬â„¢s not just the simple (forced) sex you think it is, it means everything to your victim at that point in and it will mean everything to her/him in the future too, such acts never truly get forgotten or forgiven, they are remembered for a life-time (of shame and stigma at that).<br>LADIES: Please be careful around men especially ones that you do not really know how desperate they can be.</p><p>MALES: Please do not, I mean NEVER think of it, NOT EVEN once to rape a lady because she refused you, itÃ¢â‚¬â„¢s an emotional curse already and you will bear it till you die, you may appear free and successful on the outside but you will never be free until you make amends for your sin, something I still see no amendments for and be watchful of DOMINANT females too (though it is rare to see such)</p><p>Story source: Nigeria<br>-Emmiasky Ojex</p>', 'uploads/15451549719420633WhatsApp_Image_2018-12-18_at_5.47.04_PM.jpeg', 'j90819542aBn72i', '17:42:53', '2018-12-18', '15451549736htt20ii179nh45seg27', 'thumb/15451549715963723WhatsApp_Image_2018-12-18_at_5.47.04_PM.jpeg', 1),
(59, 'THE STORY ON MY HEAD: WE BEAR UN-NEEDED SCARS(Day 19 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>Body ragged in torn clothes<br>The truth behind our lives; only us and the madam knows<br>Chartered like yam being transported from the North<br>Was how we also were bought at cheap amounts since we had little worth</p><p>Face scarred with broom and slaps<br>WeÃ¢â‚¬â„¢ve been marred by the merchant who made us come to the metropolitan<br>We cannot tell you, how we were sold off by our parents<br>Obviously, they had no loss from their end<br>As we were only three of their twenty four kids<br>Perhaps our siblingsÃ¢â‚¬â„¢ been traded for cash or cows too</p><p>For mom and dad, these were sales that needed to be done<br>Ours or their lives, they didnÃ¢â‚¬â„¢t wanna die<br>So, theyÃ¢â‚¬â„¢d rather sell off their fries<br>But with little knowledge or compassion for what would befall the tots</p><p>Hither, the centre of excellence<br>Like pieces of meat, weÃ¢â‚¬â„¢re shared<br>Within merchants whoÃ¢â‚¬â„¢d size us up according to their sine qua non<br>Some of us on the right and the others left</p><p>Now, youÃ¢â‚¬â„¢ll see us lifting cargoes for buyers<br>YouÃ¢â‚¬â„¢ll see us pushing carts, to NO ONE knows<br>This is not the life we ought to have<br>But because our parents were reckless bow-wows,<br>Who had much experience on causing problems<br>But none on how to solve them</p><p>We have to live life like cretins with nothing upstairs<br>Hence, the next time you see us,<br>Pray that we may someday recover all that weÃ¢â‚¬â„¢ve lost<br>and not lead our kids this same way.</p><p>For we bear un-needed scars<br>From both our buyers and parents.</p><p>Afterthoughts: So many parents from the Northern part of the supposed giant of Africa still practice the act of selling their children for some amount to any interested buyer whoÃ¢â‚¬â„¢d tender the money, since they usually have children in abundance, a situation where youÃ¢â‚¬â„¢d see a family with 42 members but do not have the capability to provide the necessary materials for their products, a mistake thatÃ¢â‚¬â„¢s been going on since their get-go and still prevails till date; they do not understand what they put their unfortunate kids into when they sell them as many of them get inducted into forced labor, ladies are the most unfortunate as they might even be taught prostitution and how to run other malicious acts.<br>Hence, it would be preferable if these sets of people stop giving birth as they are not just causing problems to their kids, they are also causing a lot of problem to the nation itself<br>-These kids may become criminals,&nbsp;<br>-They may be goaded into drug trafficking and so on (all to the ignorance of their parents) and plot out a really good family plan for them now and in the future.<br>Government as well can help out in reaching out to the uncultured communities and teach them the benefits of having a simple family of not more than five.</p><p>Story source: Lagos Island Market, Lagos<br>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15453241186321161WhatsApp_Image_2018-12-19_at_4.50.39_PM.jpeg', 'j90819542aBn72i', '16:42:01', '2018-12-19', '1545324121neh35021h6si9igtt477', 'thumb/15453241181794281WhatsApp_Image_2018-12-19_at_4.50.39_PM.jpeg', 1),
(60, 'THE STORY ON MY HEAD: IS THIS FAIR?(Day 20 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>Few days from now, Christmas<br>Few days from now, merrying times<br>But, not me though<br>IÃ¢â‚¬â„¢ll be locked up in the shack of a room I was given, laying low<br>Because my owners say party is for the free-borns and not slave sons</p><p>Lo, the life I live in Lagos<br>The true capital of the pitiful Giant of Africa<br>On socials, I dare not belong<br>For everything I am here for, according to maÃ¢â‚¬â„¢am, is serve her family all life-long</p><p>WhatÃ¢â‚¬â„¢s Christmas<br>when all I see outside, a bunch of bewitching guys<br>WhoÃ¢â‚¬â„¢ve killed every potential I have<br>and made me the the Jack of NO TRADE, an object of laugh</p><p>Her free-born, my age<br>still dumb, since cradle he is<br>but money will do it,<br>unlike me, whoÃ¢â‚¬â„¢s lifeÃ¢â‚¬â„¢ll probably remain same</p><p>Is it fair?<br>the life I live<br>Just because my parents had nothing to give<br>In Lagos, I would make it; I believed,<br>Now, I know all those are just vague dreams</p><p>As the life here is living in light but hiding in the dark.</p><p>Afterthoughts: Merry Christmas in advance<br>However, as we celebrate the good times this season, letÃ¢â‚¬â„¢s know that there are so many kids who cannot celebrate this with the world for whatever reason, kindly aid them by celebrating with them (DonÃ¢â‚¬â„¢t waste money on yourself alone), and make someone SMILE.</p><p><br>Story Source: Ebute Metta, Lagos<br>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15453242768524311WhatsApp_Image_2018-12-20_at_5.03.18_PM.jpeg', 'j90819542aBn72i', '16:44:37', '2018-12-20', '15453242776i1n8hs5eh7gt4it2254', 'thumb/15453242768064076WhatsApp_Image_2018-12-20_at_5.03.18_PM.jpeg', 1),
(61, 'THE STORY IN MY HEAD: WHAT I WONÃ¢â‚¬â„¢T TELL YOU (Day 21 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>Pretty faced, you see me as such<br>But the so-angelic lady on the outside, quietly runs amok<br>A shadow of the outside girl in the room<br>DidnÃ¢â‚¬â„¢t cast myself in this insufferable doom</p><p>Another did,&nbsp;<br>Had his way to my room and made the evil deed<br>Unknown to Dad, for MomÃ¢â‚¬â„¢s dead<br>The late womanÃ¢â‚¬â„¢s brotherÃ¢â‚¬â„¢s a beast who seeks refuge in my legs</p><p>This is a story from back then, I was nine<br>Before I became all these, cute and fine<br>But he still kept coming home to this shelter<br>The hut he built in my priv is food he deems better</p><p>Of course Dad knew nothing about this<br>Having sex with an adult, my brother wasnÃ¢â‚¬â„¢t something thatÃ¢â‚¬â„¢s music to the ears<br>Like a lion, you may see me still standing strong</p><p>But I was battered and no one knew, for I tell no one<br>Of how Uncle John selfishly made me an object of funÃ¢â‚¬â„¢</p><p>Afterthoughts: Parents (single ones especially), please understand that pedophiles are around the world, Uncles and Aunts whoÃ¢â‚¬â„¢s favorite meal of now is the little thing under your kids skirt or trousers.<br>Beware of who you leave your children with and if you notice anything at all awkward about your children after getting re-united (prolly you left Ã¢â‚¬Ëœem with a nanny or whatsoever), know that this is a risk itself and ask question from your kids or wards.</p><p>Story source: Herbert Macaulay, Yaba, Lagos.<br>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15454958838629042WhatsApp_Image_2018-12-21_at_5.01.26_PM.jpeg', 'j90819542aBn72i', '16:24:45', '2018-12-21', '15454958851gh54t4nt8s5e8697ihi', 'thumb/15454958834141273WhatsApp_Image_2018-12-21_at_5.01.26_PM.jpeg', 1),
(62, 'THE STORY IN MY HEAD:ARE YOU NOT AS WELL GUILTY (Day 22 of 24)', 'Emmaisky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>When you see your neighborÃ¢â‚¬â„¢s step-daughter getting treated as rags<br>When you are able to help an hungry man but will rather save up the little change youÃ¢â‚¬â„¢ve got left, to purchase snacks?<br>when you see two people fighting but would rather get a phone to record the occurence than help out?<br>Are you not as well guilty?</p><p>Guilty of the fact that you could help but chose not to?<br>Guilty of the crime that you were there but decided to pretend like you were not because you were thinking WHAT WOULD BE THE CONSEQUENCE EVEN IF I DO HELP?<br>Guilty of the fact that a little advice from your mouth couldÃ¢â‚¬â„¢ve saved their dying marriage?</p><p>Will you rather watch live when you could help with just a touch?<br>WonÃ¢â‚¬â„¢t you pass on the torch,<br>Of humanity in you?<br>To the fellow by your side, who cares if you both know?</p><p>The victim sees no difference between<br>Its assailant nor the spectators<br>So far you were there, and couldÃ¢â‚¬â„¢ve helped<br>But didnÃ¢â‚¬â„¢t, you committed a huge offence<br>Against you, yourself and them<br>THE OFFENSE OF INHUMANITY</p><p>DonÃ¢â‚¬â„¢t live being guilty<br>When you put yourself in the cell<br>Of regrets knowing you couldÃ¢â‚¬â„¢ve helped<br>But chose not too,</p><p>There is still someone out there, crying<br>Needing a friend<br>Or anyone to come closer,<br>Talk with and hug her</p><p>You could be that one<br>Help one, save one.</p><p>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15455943279287841WhatsApp_Image_2018-12-22_at_8.12.01_PM.jpeg', 'j90819542aBn72i', '19:45:29', '2018-12-22', '15455943294058e2gtr95i7ins0h0a', 'thumb/15455943277065761WhatsApp_Image_2018-12-22_at_8.12.01_PM.jpeg', 1),
(63, 'THE STORY IN MY HEAD: Nwa Ãƒâ€¢jor (Evil Child)(Day 23 of 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p>#TheStoryInMyHead</p><p>That\'s me,<br>My identity<br>That\'s what the people I live with call me, at least - it seems like they\'ve all forgotten that Mama called me Victor before she let go.</p><p>Each time something not good happens in the house, it always is the fault of the Evil Witch my owners have at home, I am bad luck to everything, even to myself;</p><p>The prayer for normal people of the world was \"I shall be the head and not tail\",<br>in my case however<br>\"Thou shall be the dust beneath the tail\",<br>that\'s my scripture as I never for once understood the A-Bs and Cs not to talk of the Bracket Order ....... rule</p><p>I was just there, madam says&nbsp;<br>\"When I was born, I brought bad-luck to the environ and that\'s why they had to sell me to them, of cause I knew those were shenanigans but IT GOT TO ME.</p><p>I can\'t even perform anything, anywhere; I am so bad at everything.</p><p>The baby cries, \"Witch, what are you doing to her\"<br>Pot lid falls, \"Witch you wish the soup would pour on me right?\"<br>Breadwinner loses his job, \"Was it because he refused to take your for dinner last week?\" despite knowing fully that the man lost his job due to his lackadaisical attitude towards work and so on.....<br>Madam of the house gets headaches, \"Nwa-Victor, was it because I DIDN\'T GIVE YOU FOOD LAST NIGHT?\"</p><p>Many more examples that even I begin to see myself as one.</p><p>This is my life,<br>the life of an evil being.</p><p>I am an evil child, messenger of evil to those who harbor me, I am an harbinger of ill-luck.</p><p>Afterthoughts:<br>The ideology of seeing maids as ill-luck or ill-fortune to one is a really wrong menace from the on-set, you should never bring in a child, maltreat her, over-work her for whatsoever reason, and when she shows a little bit of resilience, tag her a WITCH.</p><p>Continuous cogitation on a wrong idea can become true as once these kids are told what they are not, continuously think on it and see themselves like such, it becomes only natural to them.</p><p>You see them as evil or paranormal, don\'t be surprised if they become one.</p><p>Like the Yoruba adage<br>\"TÃƒÂ­ ewÃƒÂ© bÃƒÂ¡ pÃƒÂ© lÃƒÂ¡ra ode, aa dÃ…ÂÃˆâ„¢Ã„â„¢\"<br>(Once a leaf stays too long on a soap, it will become it)</p><p>&gt;I am not here to tell you how that occurs or the science behind it&lt;</p><p>But one kids see themselves as what you tag them as, EVIL,<br>don\'t be surprises if they become such.</p><p>A canvas portrays nothing till the first artist makes an impression</p><p>Story source: Makoko, Yaba, Lagos<br>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15455945388722436WhatsApp_Image_2018-12-23_at_8.16.15_PM.jpeg', 'j90819542aBn72i', '19:48:59', '2018-12-23', '1545594539s8926tnth1hi1ie7606g', 'thumb/15455945383303072WhatsApp_Image_2018-12-23_at_8.16.15_PM.jpeg', 1),
(64, 'THE STORY IN MY HEAD: OH, SO IT\'S CHRISTMAS(Day 24)', 'Emmiasky Ojex', '1543678318ledse7l3-ycon8heaml472ge9ed-2-8jlnaeuaa-m514', 'show', '<p><br>#TheStoryInMyHead</p><p>Yay, the day you celebrate the birth of the coming Messiah<br>Whose purpose on earth was prophesied in the Holy Book since the Man Of God, Isaiah<br>Well, I actually care not for that<br>Since He saw me as I was and let me be, just like that</p><p>What\'s there to be felicific about?<br>Since no one even cares whether or not I am around<br>I am just a living dead<br>a robot, zombie-like-talking head</p><p>The path I yearn is not the road I thread<br>Because I am being played by those up ahead<br>I speak for those of us with no hope whatsoever of where life is for them<br>and what holds the problems</p><p>Those of us with no dreams of tomorrow<br>but lay back on our broken chairs,&nbsp;<br>While you\'re celebrating in church, we\'ll sit at home,<br>with our raggy clothes, under our creaking roofs, malnourished food and bow our heads in sorrow<br>as we seek refuge under the withering flowers of the meadow</p><p>We are victims of unplanned youths<br>Who lived up their lives without use</p><p>We are products of a rotten generation<br>Who lived without thinking of the future</p><p>We are sons of a bloody land<br>Whose inhabitants, sucked up the juice nature had to offer</p><p>So please, do not tell me about Christmas, as we all will be in a worse position next year.</p><p>Ã‚Â©Emmiasky Ojex</p>', 'uploads/15457555941737318IMG-20181225-WA0021.jpg', 'j90819542aBn72i', '16:33:16', '2018-12-25', '154575559636i8h48snh9te89t01ig', 'thumb/15457555942631138IMG-20181225-WA0021.jpg', 1),
(65, 'HOPE AMIDST TRAGEDY (DAY 1 of 10)', 'Georgette Kendra Mbale', '1559751687aeytcets5teded9e0blg3g21emn1aehyaireel1po8nrglol1tr9ckra6a', 'show', '<p>Cyclone like the demon of fire and earth;tekar<br>She wipes the beauty from my eyes.<br>Cyclone Idai;the name that shatters my heart to pieces<br>She stole the music from my ears<br>She is a thorn in my flesh.</p><p>She came like war horses<br>Destroying what I built with love.<br>I can\'t find the peace to share a smile from my heart<br>I can\'t find the hope to laugh and love.<br>My beautiful home is beyond disaster management.</p><p>They\'ll rebuild the buildings and houses<br>But they can\'t rebuild the broken homes and shattered dreams<br>They can\'t replace people I\'ve lost or fill the hole in my heart.</p><p>It\'s a funeral&nbsp;<br>I mourn beyond my loses<br>Our lives cannot be replenished<br>My loses are too grave;I\'ll carry them to my grave.</p><p>I cry for my people&nbsp;<br>My home will never be the same again<br>But I am not alone<br>Mama Africa\'s children cry with me&nbsp;<br>They bring me hope like the moon on a dark night<br>They love ,support and encourage me.<br>Awake and rise up like an awakening dawn they tell me<br>Mama Africa\'s child is brave and a warrior.</p>', 'uploads/15601925172102701.jpeg', 'j90819542aBn72i', '18:48:39', '2019-06-11', '1560192519pe447h1o91r8ea7il73ct', 'thumb/156019251779881361.jpeg', 1),
(66, 'THE ME IN ME (DAY 1 of 10)', 'Lewis Wamwanda', '1559751824300twhsaocetip8dai3enners8lw1myawadre85yac5gal11lel', 'show', '<p>The me that is in me is not me<br>The me in me is different<br>Not like the Me i knew ago<br>Or the me that I wanted to be</p><p>The me in me smiles not<br>He cries and always moody<br>He complains of life going amiss<br>And sometimes wishes to die</p><p>The me in me has changed remarkably<br>Spends time alone in cemeteries<br>And sings songs of suicides<br>And laughs loud at the mention of death</p><p>The me in me<br>He spends time and money on drugs<br>Drinking until late at night<br>And often sleeps in ditches</p><p>The me in me needs help<br>I think he is depressed,<br>And just like others, needs help<br>To overcome the sorrow and heavy laden</p><p>Ã‚Â©Lewis Wamwanda</p>', 'uploads/156019292142420312.jpeg', 'j90819542aBn72i', '18:55:22', '2019-06-11', '1560192922t3e9le8hct2ira657917', 'thumb/156019292176540732.jpeg', 1),
(67, 'PETALS OF THORN (DAY 1 of10)', 'Johnson Victor Oluwatobi', '1559751638oio1dr3ectan2lcjanipatarsot0te673weveyy7clsogu8roohnbh8i5ll7', 'show', '<p>Her beauty made every man to yawn<br>And her kisses blown out the candles light&nbsp;<br>But underneath her lips, dwells thousand of thorn .</p><p>Like a foreign man speaking in tongues&nbsp;<br>She whisper sweet love in ancient Tongues<br>Burnt candles of kisses, her petals is nurtured with thorns</p><p><br>She is the queen that wears no crown<br>She is the bitch that dressed in purple linen<br>She is Love turns poison</p><p>The blue eyed bullet from the west<br>Captivating the soul of the feeble&nbsp;<br>Enticing the eyes of the robust</p><p>Her lap is a wide passage for the horse&nbsp;<br>But her soul is a round circle when it comes to love<br>She is infected to infect others</p>', 'uploads/15602033495595315day_1_im.jpeg', 'j90819542aBn72i', '21:49:10', '2019-06-11', '1560203350lt3e9a3e2icra19ps4222tl', 'thumb/15602033493857030day_1_im.jpeg', 1),
(68, 'TRIBUTE TO GANGAN (Talking Drum) (DAY 1 of 10)', 'OLUWOLE OLUWATOBI SOLOMON', '15600993580oonbacye1gtousayoa4lnrelr01cioo4t6slolue0w0plltold7ewmai9he1', 'show', '<p>Honour to the infant skin of goat<br>The two faced traditional drum<br>Which sounds like human\'s voice&nbsp;<br>Ayangalu uses his prowess gimmick&nbsp;<br>To show his stylistic dexterities<br>With his drum stick.</p><p>The mother of all traditional drums<br>Which makes the young damsels&nbsp;<br>Wriggle their beaded waists to&nbsp;<br>The euphony of your sonorous voices<br>The rhythmic rhythm of your beats<br>Make many melancholic masses&nbsp;<br>Forget their sorrows</p><p>The villagers rush to your rhythmic voices&nbsp;<br>Which make them shake their heads and&nbsp;<br>Buttocks to your melodious beats<br>Your voices allay people\'s worries<br>And make their hearts full of jollification&nbsp;<br>Honour to the infant skin of goat<br>Which makes people joyous for life.</p><p>Written by: OLUWOLE OLUWATOBI SOLOMON</p><p>**Ayangalu means Drummer in Yoruba language</p>', 'uploads/15602046676590256talkingdrun.jpeg', 'j90819542aBn72i', '22:11:08', '2019-06-11', '15602046681b9c5u866r2ltr124eaiitet', 'thumb/15602046673573673talkingdrun.jpeg', 1),
(69, 'ACCEPT EVERYTHING (DAY 1 of 10)', 'Roland Ogomigo', '1559751748hsgdoca97gl7yt3yeli4re1ratolpe0n5gea8do7lr8iaomcn2o', 'show', '<p>As the cars need fuel to kick off, so do humans need food to gain energy. There is one vital energy, which is the mind energy.</p><p>How do you feed your mind? Do you crown it with negative thoughts or positive vibes?</p><p>Talk to me. Well like the Buddha said, \"the mind is everything, who you\'re now is as a result what you\'ve thought\".</p><p>We struggle hard daily to fight off this erroneous negative energy, but it seems it has collapsed our wall of defense.</p><p>So how can we escape this trauma. It\'s simple.</p><p>The problem with people is that they don\'t seem to accept others and things outside their control.</p><p>Don\'t fall in that line. The end leads to destruction.</p><p>Have you heard about love?</p><p>What is love to you?</p><p>It is that feeling that abores the diverse nature of things.</p><p>I\'m sure you\'ve never heard of that definition.</p><p>However, let me explain further. My own version of love is coined in two words.</p><p>ACCEPT EVERYTHING!!!</p><p>Everyone and everything is unique and should be understood, if not it will create unending wars in our generation.</p><p>Accept yourself unconditionally. I mean everything about you. You\'re a perfect being.</p><p>Accept people unconditionally. Respect their differences and act mature. No need to fight them. \'Ignoring\' is better if their relationship keeps daunting you.</p><p>Accept nature unconditionally. It\'s so dynamic and unpredictable. Acclimatize with it.</p><p>This exercise builds self-esteem and increases your responsibility.</p><p>Take charge of your life and achieve your goals.</p><p>No one can halt you.</p><p>Tell me what inspires and keep you going. I love to hear from you.</p><p>Ã‚Â©Ogomigo Roland</p>', 'uploads/15602049131930134accept.jpeg', 'j90819542aBn72i', '22:15:14', '2019-06-11', '1560204914cp1cl1e4212c763aaertt2i', 'thumb/15602049135812091accept.jpeg', 1),
(70, 'HOW LOVE BECOME RANCID  (DAY 1 of 10)', 'Bello Sodeeq Adekunle', '1560163948uyoesae7laldeeatd51lootpre1beics0ngyn81dkl04qa9l5lreeceh6', 'show', '<p>Yesterdays reflect the memories of appealing taste of love<br>Of how I cling onto its plate, gulping every mole.&nbsp;<br>But never remind that; at every tip of sweetness was laced a choking bitterness.</p><p>A tale of how emotion turns a gloomy &nbsp;chamber,&nbsp;<br>Nought is found but only the whirring chorus of cacophony:<br>Of sour voice, piercing &amp; thrusting&nbsp;<br>Roused with redolent lyrics, capable of dissolving heart into a sardonic liquid.</p><p>In my domicile, we paint love as a protective shield&nbsp;<br>that could calm the rage of an hostile whirlwind.&nbsp;<br>They even say: in an abode of love peace reigns&nbsp;<br>Still, in between couples, I wonder why all serenity gives was denial.</p><p>I\'ve been told much, witness more<br>&amp; experience &nbsp;several.&nbsp;<br>But apathy has gorge its likings like crocodile\'s prey.&nbsp;<br>It\'s better to drill out what we have &amp; only incurs pains<br>Now I know the sweetness fetched from fictitious love tales is incomparable to that of reality.</p>', 'uploads/15602074946054321rachid.jpeg', 'j90819542aBn72i', '22:58:16', '2019-06-11', '1560207496el3ith9w67o929c2a79r', 'thumb/15602074946991954rachid.jpeg', 1),
(71, 'I NEVER WANT TO (DAY 1 of 10)', 'Paciolo Pen Saint', '156018203445nt0aiss3nclhny6ceteo9gtraoa6e9a4lipi7ee1playorplc7d', 'show', '<p>I never want to forget the sensual smile<br>That went hidden in my lips&nbsp;<br>Hidden itself in a ligneous of pain<br>Covered by a tempest radiance.&nbsp;<br><br><strong>Paciolo Pen Saint</strong></p>', 'uploads/15602081807282507skip.jpg', 'j90819542aBn72i', '23:09:41', '2019-06-11', '1560208181rti87i6328leca397', 'thumb/15602081803956378skip.jpg', 1),
(72, 'TASTE OF HER LIPS  (DAY 1 of 10)', 'MR\'TINO', '1560163509coadedep0lrecaramea3h2eiab1e3dn4l27siy28ejyougmltayi5yat1', 'show', '<p>My heart was captured in cage</p><p>Like a bird fly into a wrong direction</p><p>Striving his way out&nbsp;</p><p>But strumming and fall&nbsp;</p><p>My throat has be intoxicated&nbsp;</p><p>Through her lips and kiss&nbsp;</p><p>It flavor smelled malodorous&nbsp;</p><p>when inhaled into my nose&nbsp;</p><p>It seems pretty to eye&nbsp;</p><p>But poisoning to lung&nbsp;</p><p>&nbsp;</p><p>Taste of her lips a remarkable memo&nbsp;</p><p>All night it rings in my head&nbsp;</p><p>Like a gunshot passing in atmosphere&nbsp;</p><p>Ã‚Â© MR\'TINO THE LOVER BOY</p>', 'uploads/15602429972401341tino.jpg', 'j90819542aBn72i', '08:49:58', '2019-06-11', '1560242998ras889el7tt85ct7247eai', 'thumb/15602429976543505tino.jpg', 1),
(73, 'HOPELESS (DAY 1 of 10)', 'Aj Maverick', '1560098207y3eogt5e7i6chc3k1aeavc3aye1apmlller4nstaj7rir00d', 'show', '<ul><li>We are children of no precise settlement,<br>&nbsp;where the rays of the sun is turbulent.&nbsp;<br>We are from where the moon shies his light,&nbsp;<br>where the rain is very wild.</li><li><br></li><li>The earth is our bed&nbsp;</li><li>on which we lie with so much unrest.&nbsp;</li><li>Fear rumbles deep in our heads,&nbsp;</li><li>what may become of us tomorrow, we cannot tell.&nbsp;</li><li>&nbsp;</li><li>Where on earth is our share?&nbsp;</li><li>We are children of no mean settlement.&nbsp;</li><li>Our homes are made of mud&nbsp;</li><li>on which the rain pours until it\'s satisfied.&nbsp;</li><li>&nbsp;</li><li>Countless are days when our eyes get soaked&nbsp;</li><li>with tears gathered on the thoughts of no tomorrow.&nbsp;</li><li>When the skies grimace on us like we\'re not of this world,&nbsp;</li><li>and the angry thunderstorm threaten to bring down our homes of mud.&nbsp;</li><li>&nbsp;</li><li>We sit by the trees to see how the breeze&nbsp;</li><li>make their leaves dance forcefully to its tune with speed.&nbsp;</li><li>This, a replica of the storm that has befallen our souls,&nbsp;</li><li>today we see, tomorrow we await with dying hope.&nbsp;</li><li>&nbsp;</li><li>The leafless trees, our brothers.&nbsp;</li><li>For like them, we\'re tattered!&nbsp;</li><li>Should destiny remain unfolded,&nbsp;</li><li>our hearts would forever be scolded.&nbsp;</li><li>&nbsp;</li><li>Pains will no longer suffer us, I fear&nbsp;</li><li>nor will fears cause to our eyes, a tear.&nbsp;</li><li>Our eyes will soon match the grimace of the sky&nbsp;</li><li>as the true children of where the sun doesn\'t shine!&nbsp;</li><li>Ã‚Â© Aj Maverick</li></ul>', 'uploads/15602459385923011hopeless.jpg', 'j90819542aBn72i', '09:38:59', '2019-06-11', '1560245939te5all9epsrh25o829c26ise', 'thumb/1560245938426286hopeless.jpg', 1),
(74, '#REST_IN_PEACE (DAY 1 of 10)', 'Chhote', '15601637908ypeccotrs6edlncey9e512t28rlotahaial0hgh051e', 'show', '<p><br>CHHOTE: Who knew tears could someday taste so sweet? Who knew one could feel pain this strong to the point of saturation? To a point where &nbsp;you feel like a thousand &nbsp;electrical volts being conducted through your spine,&nbsp;<br>a point &nbsp;where you get so hurt and confused the adrenaline keeps on pumping you can\'t sleep, sit or do anything. Who knew.......?&nbsp;<br>PROMISE:Hun?<br>CHHOTE:who knew that one day I would be standing here besides your open casket? singing incatations, punching holes through walls as the silently creeping pain keeps on breaking me.&nbsp;<br>PROMISE:Chhote!!!!&nbsp;<br>CHHOTE :Huh?&nbsp;<br>PROMISE :Talk to me&nbsp;<br>CHHOTE:It wasn\'t supposed to end like this. It wasnt supposed to be another Romeo And Juliet story. We were supposed to grow old, have kids together, Lose our teeth and have our backs bend.Why??&nbsp;<br>PROMISE:It shall be fine<br>CHHOTE:I would have anything for you yet you chose death over me.&nbsp;<br>PROMISE:What did you expect me to do? Let me guess, You wanted me to run away from death like some super hero in the movies? Beat this crooked cancer left jab and a right hook as though the I was the hulk? when will you stop your selfish antics and for once &nbsp;be fair? &nbsp;.I gave it my all What else do you want?&nbsp;<br>CHHOTE:I wanted you stay! I want you to not be dead and be here with me. Its you I want and not these still potraits that only deepen my anguish and despair. Now iam forced to Walk in solitude &nbsp;this earth,tell me that is fair. &nbsp;<br>PROMISE:I\'m sorry! Sorry I couldn\'t stay a while longer, sorry I couldn\'t hold or kiss you one last time. I\'m sorry I was not strong enough to beat this cancer or break my spirit free from this oblivion in which am drawn.<br>CHHOTE:We had a choice!&nbsp;<br>PROMISE :we had nothing!&nbsp;<br>CHHOTE:What about Chemo-therapy?&nbsp;<br>Couldnt you Atleast imagin us,&nbsp;<br>Like soldiers on the battlefield fighting a common &nbsp;enemy,&nbsp;<br>Like Batman and wonder woman on the same mission to capture and kill aliens invading earth,<br>Like &nbsp;a husband and wife,Matching &nbsp;through hell while holding hands after capturing and killing death.&nbsp;<br>PROMISE:We can\'t beat death<br>CHHOTE:Cancer we can!<br>PROMISE:How?&nbsp;<br>CHHOTE : like any other disease dignosed and treated in its early stages we can.&nbsp;<br>Coz just like AIDS Cancer is no death sentence, it is treatable.&nbsp;<br>Hope faith, courage and unity is all we need and together we will rid this world of cancer. Because we can!&nbsp;<br>PROMISE:I\'m already dead, please carry on without me,&nbsp;<br>Soldier on and on until all is well.&nbsp;<br>Remember, I love you!&nbsp;<br>CHHOTE:To you my love and all we\'ve lost to cancer \"Do rest in peace\"<br>#CHHOTE_THEE_POET</p>', 'uploads/15602463079320192rip.jpeg', 'j90819542aBn72i', '09:45:08', '2019-06-11', '1560246308aa1rc4e249n172cl8eiptrse9tie', 'thumb/15602463073397947rip.jpeg', 1),
(75, 'RAYS OF HOPE (DAY 1 of 10)', 'Ariyo Ahmad', '15602440698dah92am6al40doactaroyyrg3ina7else5ie1yrh8ct0elp', 'show', '<p>I longed to make a sculpture of a story.<br>Promise me you will buy and decorate your heart.<br>The story of how hope triumph beyond.<br>Like the busy beetle tap through my heart<br>Making echo of terror in my porous vein.<br>I rest through the night, touring in my dream.</p><p>Lost in the story of my existence.<br>But I smell the iota of hope.<br>Even when the night became long like decades.<br>Staying awake sobbing through my woes.<br>I was raped and mocked by my foes.<br>Rejected, forsaken, abandon, I bite through my mind.</p><p><br>I would smile out loud maintaining my grief.<br>I learnt to blow like flame after I am burnt.<br>Never for once per chance did I blink happiness.<br>Even when the moon plays through my heart.<br>She would get scared and pick a running race.<br>Because I close my eyes and sue my side to sleep.</p><p><br>My skin glows bright in sad pretence.<br>While my blood is hot like hell.<br>My face house a beautiful countenance.<br>But my rooms are full of bowels.<br>The sum in my night became scared of smile.<br>And the moon in my days failed to reconcile.</p><p>&nbsp;</p><p>Suddenly, an eclipse erupt, a seed sprout.<br>The iota of hope grow in my heart.<br>It stems are firm like mountains.<br>The branches are bright like the sun.<br>Its leafs are glooming like the moon.<br>Its fruit are numerous like the stars</p>', 'uploads/15602464474949153rays.jpeg', 'j90819542aBn72i', '09:47:28', '2019-06-11', '1560246448390ysir742ear57cal1t9', 'thumb/15602464477083336rays.jpeg', 1),
(76, 'WAVES (DAY 1 of 10)', 'The_Bee', '15602467049y1yhrl1i4rtdac41el91pbaces1gno0tte1haeeele6', 'show', '<p>She was born free<br>Like the waves of an ocean&nbsp;<br>This she felt<br>In a moment she loves<br>The next she leaves</p><p>&nbsp;</p><p>With the feelings&nbsp;<br>Like the waves of an ocean&nbsp;<br>Not so strong yet so deep<br>Not so sad yet so happy<br>It\'s all in her.</p><p>Calm my waves</p><p><br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;THE_BEE</p>', 'uploads/15602472156945345thebee.jpeg', 'j90819542aBn72i', '10:00:17', '2019-06-11', '156024721761v0s11rewa0tcal1i7e9', 'thumb/15602472151803776thebee.jpeg', 1),
(77, 'I\'M JUST A POOR GUY   (DAY 1 of 10)', 'Asika Victor', '1560102058ce2hcod0l31iel77inotya83tay600escgiarvrskret4plaa', 'show', '<ul><li>I may not have the money</li><li>to buy that diamond ring</li><li>I may not kiss the prettiest girly</li><li>I can\'t ask her out on a date</li><li>\'Caus i know she will turn me down</li><li>&nbsp;</li><li>Am just poor guy&nbsp;</li><li>Who is sinking in ocean&nbsp;</li><li>of unreturned love&nbsp;</li><li>I sink deep in endless love&nbsp;</li><li>&nbsp;</li><li>Love i don\'t know if i can get&nbsp;</li><li>I may not have the venza now&nbsp;</li><li>I may not have the jet&nbsp;</li><li>But am sure of my feelings&nbsp;</li><li>&nbsp;</li><li>_&nbsp;</li><li>Am just a poor boy,&nbsp;</li><li>poor boy of emotions&nbsp;</li><li>not of senses and ideas&nbsp;</li><li>My feelings am afraid&nbsp;</li><li>to show to this uptown girl&nbsp;</li><li>&nbsp;</li><li>Now am a dreamer&nbsp;</li><li>I dream of crazy things,&nbsp;</li><li>things like&nbsp;</li><li>When i call you at home&nbsp;</li><li>and you answer the call&nbsp;</li><li>When i hold your hand&nbsp;</li><li>Walking down the street&nbsp;</li><li>In a cold infant night&nbsp;</li><li>&nbsp;</li><li>Now i think of things,&nbsp;</li><li>that make me go crazy&nbsp;</li><li>Things like&nbsp;</li><li>When you need me so badly&nbsp;</li><li>When we play together&nbsp;</li><li>When we eat together&nbsp;</li><li>When we embrace each other&nbsp;</li><li>With high velocity of love&nbsp;</li><li>Emotions jamming emotions&nbsp;</li><li>&nbsp;</li><li>My love I can\'t confess&nbsp;</li><li>to this uptown girl&nbsp;</li><li>Oh, what a painful heart to heart</li></ul>', 'uploads/15602671851418264diamond.jpg', 'j90819542aBn72i', '15:33:07', '2019-06-11', '1560267187r3li9me58c77t92i38a', 'thumb/15602671856200797diamond.jpg', 1);
INSERT INTO `insight` (`id`, `title`, `author`, `category`, `visibility`, `body`, `image_1`, `created_by`, `time_created`, `date_created`, `hash_id`, `thumbnail`, `notification_status`) VALUES
(78, 'Sit besides me  (DAY 1 of 10)', 'Abdulrahman Soliu', '15601820100bly1ulmorenaer8alita11yepo4sru32i78sltae0c5hnagcdldha', 'show', '<p>Sit besides me, &nbsp;let me assail your ears&nbsp;<br>You\'re the angels dwelling on earth&nbsp;<br>Though not able to fly like a bird of Jove&nbsp;<br>on top of the land of the leal. &nbsp;<br>You illume your glisten teeth, &nbsp;<br>Even barrows me with joy and love. &nbsp;<br><br>Sit besides me, &nbsp;speaks about me&nbsp;<br>after a pregnant pause, &nbsp;<br>Feel to bodes me, &nbsp;the story of the two lovers&nbsp;<br>dine and wine in an ocean of love&nbsp;<br>Even we may not write our own love story&nbsp;<br>Like that of Romeo and Juliet. &nbsp;<br><br>Sit besides me, &nbsp;and let me seize &nbsp;<br>Your fruitful river in your eye, &nbsp;<br>And brought smiles with a wonderful comb&nbsp;<br>To fill the haviour of your visage &nbsp;<br>That had seized by the less leasure&nbsp;<br>receive and perceive by the ex_lover. &nbsp;<br><br>Sit besides me, &nbsp;and sing a words of so sweet, &nbsp;<br>Move me with their noble perfume, &nbsp;<br>Touch me and made me feel my abode&nbsp;<br>On top of the lamp of heaven. &nbsp;<br><br>Sit besides me, &nbsp;and let\'s play with those words&nbsp;<br>That was added to a world of relationship &nbsp;<br>To make us feel as we were &nbsp;already in paradise of love. &nbsp;<br>Let my ears bleed with those tittles, &nbsp;<br>Honey, &nbsp;sweetie, my dear, my darling&nbsp;<br>It makes my heart feel attracted &nbsp;<br>Like the rainbow fascinated the heart of its first viewer.</p>', 'uploads/15602676082271055sit.jpg', 'j90819542aBn72i', '15:40:10', '2019-06-11', '1560267610ct9et9ri9i5a62235ls7', 'thumb/15602676089250567sit.jpg', 1),
(79, 'The call   (DAY 1 of 10)', 'HOLUWAKHARYORDAE TAIWO', '1560102926ra12hacel1ngpraalad6wodtieyaorulcaio67ee37yokl0stw90h5teryh', 'show', '<p>Beside the stream of sorrow &nbsp;<br>I wave hello to my tomorrow &nbsp;<br>Sitting on a wooden couch &nbsp;<br>Staring at two fighting cockroach &nbsp;<br><br>In dismay I sigh&nbsp;<br>Couldn\'t get clearer view of my sight &nbsp;<br>Weird voices blares in my head &nbsp;<br>Couldn\'t hear the chirps of birds&nbsp;<br><br>Silent breeze rustles dried leaves &nbsp;<br>I stares at the silent flowing stream&nbsp;<br>Trying hard to beat the noise &nbsp;<br>As it keep rumbling in my eardrum&nbsp;<br><br>What could this noise be? &nbsp;<br>Is this the signal I\'m awaiting? &nbsp;<br>Or the sign for Me to run &nbsp;<br>Thoughts I keep pondering on &nbsp;<br><br>Write, &nbsp;write is all I could hear&nbsp;<br>I guess I\'m not the only one here &nbsp;<br>What to write? &nbsp;<br>Where to write? &nbsp;<br>Who to write to, &nbsp;<br>How will I write, I\'m lost. &nbsp;<br><br>\"For your pen shall lead you through &nbsp;<br>Spilt out your bitter truth &nbsp;<br>This is the destiny you\'ve &nbsp;chosen &nbsp;<br>Indeed you\'re amidst the chosen\"&nbsp;<br><br>I guess this my call.. &nbsp;<br>I\'ll definitely give it my all.&nbsp;<br><br>Iamteazhy &nbsp;<br>Holuwakharyordae Taiwo&nbsp;<br>BoardSpeck</p>', 'uploads/156028848088828last.jpg', 'j90819542aBn72i', '21:28:02', '2019-06-11', '1560288482ea1l858tr1it3ehc6177', 'thumb/15602884801884697last.jpg', 1),
(80, 'UNCOMMON PARASITE (DAY 2 of 10)', 'Lewis Wamwanda', '1559751824300twhsaocetip8dai3enners8lw1myawadre85yac5gal11lel', 'show', '<p>Not like others before her,<br>She\'s different from head to toe<br>She enstranges reality<br>With her flowing beautiful venom</p><p>She spits sadness like a boa<br>And stings like a wasp<br>Her song, of an owl<br>That carries melodies of death<br>Thoughts of murder and suicide</p><p>She is a Parasite,<br>Not those that feed on flesh<br>Or blood, or other lives<br>No, she sucks happiness<br>And robs with it joy</p><p>She branded her name,<br>Depression, so she calls herself<br>And laughs mockingly<br>Like a siren of whales<br>Plunging deep into the deep seas</p><p>A parasite, not like others<br>Hides under happy souls<br>Feeding slowly deep into happiness<br>Depleting happy memories<br>And like a pump<br>Pumps in sorrow and sadness</p><p>Ã‚Â©Lewis Wamwanda</p>', 'uploads/15603136236484010common_parasite.jpg', 'j90819542aBn72i', '04:27:05', '2019-06-12', '1560313625ou3cc3eo99lt6m1nm87ia5n6r', 'thumb/15603136237028563common_parasite.jpg', 1),
(81, 'UNDER THE SAME SUN (DAY 2 of 10)', 'Georgette Kendra Mbale', '1559751687aeytcets5teded9e0blg3g21emn1aehyaireel1po8nrglol1tr9ckra6a', 'show', '<p>Wishing upon a shooting star;<br>Watching and waiting for the midnight stroke;<br>Hoping my fairy godmother rescues me from reality.</p><p>In a world where you are different;&nbsp;<br>Different is ugly;<br>In a world where you are a rare specie;<br>Your are a blessing and curse;<br>Haunted then weighed by the upper hand to see your worth;<br>Under the same sun,we are not all the same.</p><p>If wishes where horses,I would still not afford them;<br>I was not born with &nbsp;silver spoon in my mouth;<br>Not a house or money to my name;<br>Not a crown to my head or a legacy to uphold.<br>I am not the Cinderella that always has her glass slipper on.<br>I cry with my eyes closed,dream with my eyes wide open;<br>Wishing I was an ogre living in peace&nbsp;<br>Than an albino haunted and hated.</p><p>I am different but I am human;<br>I wish to be loved, cherished and desired.<br>I need no white horse or a carriage;&nbsp;<br>No ferrari or Versace;<br>Under the same sun I wish to be treated the same.</p>', 'uploads/15603137295955902undersu.jpg', 'j90819542aBn72i', '04:28:50', '2019-06-12', '1560313730dcni5rta26u71e41r88e1l', 'thumb/1560313729865343undersu.jpg', 1),
(82, '\"LETTER TO THE HOPELESS\" (DAY 2 of 10)', 'OLUWOLE OLUWATOBI SOLOMON', '15600993580oonbacye1gtousayoa4lnrelr01cioo4t6slolue0w0plltold7ewmai9he1', 'show', '<p>Dear despondent children throughout the globe&nbsp;<br>Who never aspire anything good to come out of them<br>Due to their present predicaments&nbsp;<br>Both parents are indigent&nbsp;<br>Who cannot assure their children one meal per day<br>Emblems of economic depression on their faces<br>Thinking of the way out daily</p><p><br>Struggling seriously in search of menial jobs<br>This present predicaments of the pauper<br>Cannot remain forever in their lives&nbsp;<br>There is still hope for the tree which its head is chopped off&nbsp;<br>Man may mock your moments of melancholy&nbsp;<br>But I assure you<br>Night will change its garment&nbsp;<br>And it shall be called morning</p><p><br>Weeping may endure for a night&nbsp;<br>But joy comes in the morning&nbsp;<br>Those that are great in life&nbsp;<br>Are not more special than you&nbsp;<br>They are just privileged&nbsp;<br>Mind you, &nbsp;what you will be in life<br>You shall surely be.</p><p><br>Noone can stop God\'s works in your lives<br>Make God your best friend&nbsp;<br>Talk to Him like caring father<br>Never murmur to Him<br>Let Him know your heart desires&nbsp;<br>He is not a deceiver&nbsp;<br>He cares about your future&nbsp;<br>Your future is in His hands<br>You shall have good testimony&nbsp;<br>May God bail you out of your calamities in life.</p><p>Written by: Ã‚Â© OLUWOLE OLUWATOBI SOLOMONÃ‚Â®</p>', 'uploads/1560313945779361letter_to_hopless.jpg', 'j90819542aBn72i', '04:32:26', '2019-06-12', '156031394672lct9true1o70eei8a98r4qttl', 'thumb/15603139457918788letter_to_hopless.jpg', 1),
(83, 'Illusion (of life after death)  (DAY 2 of 10)', 'Bello Sodeeq Adekunle', '1560163948uyoesae7laldeeatd51lootpre1beics0ngyn81dkl04qa9l5lreeceh6', 'show', '<p>Here comes a mystic realm<br>Where things can only be &nbsp;&nbsp;<br>Perceived by inhume figures.&nbsp;<br>A boy on a street clenched between the arms of solitude once said: for you visualize the truth enfold in wraps of lies,&nbsp;<br>You have to possess some black power.&nbsp;<br>.&nbsp;<br>/how could a teen of his age acquire the wisdom of ages/<br>.&nbsp;<br>I knew his lineage must be an harbinger of secretive &amp; legendary fairy tales.&nbsp;<br>- of grandpa narrating how the dead could view more than we can see<br>- &amp; grandma make Thursdays\' night a mayhem by telling of their &nbsp;coming.&nbsp;<br>.&nbsp;<br>On those dusks, we marry our bed &amp; never part,&nbsp;<br>Even when the pipe is in spontaneity of gushing out. &nbsp; &nbsp;<br>-/Stinking fluid that mess up our room /<br>.&nbsp;<br>Sometimes we count &amp; recount our rosaries, chanting God\'s name:<br>To make their sequential coming a thing of harmony to household.&nbsp;<br>&amp; we never fail to get their &nbsp;repasts ready&nbsp;<br>- kettle of waters with salt &amp; millet sprinkled all over the surroundings.&nbsp;<br>.&nbsp;<br>/everything was always the way it was before we sleep /<br>.&nbsp;<br>when we rise at down, the water was still but reduced.&nbsp;<br>Then I drew separate the curtain to peep through the shutter&nbsp;<br>But the purified ritual has been chomp by different creatures :<br>White pigeons,&nbsp;<br>Black goats,&nbsp;<br>White sheep.&nbsp;<br>.&nbsp;<br>/Remember black &amp; white depicts reality/.&nbsp;<br>.&nbsp;<br>Its been long we have been fooled that ghosts descend from home(heaven) &nbsp;to house(residence),&nbsp;<br>only to quail their starve with our &nbsp;<br>Superstitious sacrificial rite.&nbsp;<br>.&nbsp;<br>Umpteenth time we have engaged in this act.&nbsp;<br>I wish one of those dead just resurrect &amp; tell us the what\'s real.&nbsp;<br>Till now, I\'ve become a bag of silence on the cliff of uncertainties.</p>', 'uploads/15603140912264020illusion.jpg', 'j90819542aBn72i', '04:34:52', '2019-06-12', '1560314092au1l5cel3til3n41i4ois8r62', 'thumb/15603140914923559illusion.jpg', 1),
(84, 'IN THE MIDST OF BLISS (DAY 2 of 10)', 'Paciolo Pen Saint', '156018203445nt0aiss3nclhny6ceteo9gtraoa6e9a4lipi7ee1playorplc7d', 'show', '<p>Am as brilliant as the mirror,&nbsp;<br>Bright as a new shilling,<br>Broad in the sky as heaven\'s expanse,<br>Calm as the grim reaper,<br>Cheerful as the birds,<br>I am as buoyant as the wings.&nbsp;<br><br><strong>Paciolo Pen Saint</strong></p>', 'uploads/15603147923652039inthe_mist.jpg', 'j90819542aBn72i', '04:46:33', '2019-06-12', '1560314793ne5r3c34l34i1a13it', 'thumb/15603147927908619inthe_mist.jpg', 1),
(85, 'Childhood (DAY 2 of 10)', 'HOLUWAKHARYORDAE TAIWO', '1560102926ra12hacel1ngpraalad6wodtieyaorulcaio67ee37yokl0stw90h5teryh', 'show', '<p>I still remember the joy<br>That hid beneath my chins<br>Whenever mama sauntered in&nbsp;<br>With a bag, loaded with toys&nbsp;<br><br>\"SANDALILI, SANDALILI&nbsp;<br>SANDALILI, SANDALILI&nbsp;<br>SANDALILI,SANDALILI\"<br>We love to chant beside the hill.<br><br>Oh vividly I remember&nbsp;<br>Those night, in months of embers&nbsp;<br>Silently,we <a href=\"https://web.facebook.com/boardspeck/inbox/?mailbox_id=606459533049827&amp;selected_item_id=100007048716721#\">sat</a> in a circle form&nbsp;<br>Listening to granny\'s fairytale&nbsp;<br>While the moon lucidly shone&nbsp;<br>Oh.. I missed those days!&nbsp;<br><br>Oh..childhood days&nbsp;<br>Building up a castle with clay<br>Once mama\'s aroma pass by our nostril&nbsp;<br>We demolished our hard crave anthill,<br>Like a hare, we duel on a race&nbsp;<br>To dine, we fought for a space.<br><br>We stumbled while playing in the dust&nbsp;<br>We\'re labelled as \'The cuss&nbsp;<br>Rolling tyres from village to town&nbsp;<br>The famous troublesome kids known across the town.<br><br>Oh. I could still recalled,<br>Those erasers we love to chew,<br>Rubbed our plain sheets with palm&nbsp;<br>Tried hard to mend our tattered books with glue,&nbsp;<br>Blue ink painted all over our books&nbsp;<br><br>Oh.. This breeze reminds me,<br>Of the kites we threw in the sky<br>This feeling triggered my memories,<br>Of how I felt whenever I\'m on a swing&nbsp;<br>Dangling up and down the wheel<br>Fell sometimes, but seized to cry.&nbsp;<br><br>Childhood fun, childhood memories&nbsp;<br>In me those days, shall be kept for century.&nbsp;<br>Once upon a time in the past&nbsp;<br>To my kids, I do this and that!&nbsp;<br><br>#Iamteazhy&nbsp;<br>Holuwakharyordae Taiwo</p>', 'uploads/15603149883999336childhood.jpg', 'j90819542aBn72i', '04:49:50', '2019-06-12', '1560314990ld7i86rh3c63iohto7d7ea3l7c', 'thumb/15603149881768523childhood.jpg', 1),
(86, 'ODE TO THE FACELESS (DAY 2 of 10)', 'MR\'TINO', '1560163509coadedep0lrecaramea3h2eiab1e3dn4l27siy28ejyougmltayi5yat1', 'show', '<p>The faceless,&nbsp;<br>The frightener to all faces<br>The undefeatable god&nbsp;<br>The war commander beyond warlord<br>From your dinning table&nbsp;<br>all warriors dine and sip cup of peace&nbsp;<br><br>I bow my head and kneels&nbsp;<br>Onto a flame blazing constantly&nbsp;<br>From centuries,&nbsp;<br>That never disabled or retired<br><br>I retreat from this battle<br>A war winning and losing<br>Fighting against vanity often<br>Yet, ruling and running in vanity terra<br><br>Then, keep raising and falling&nbsp;<br>Onto the cold hand off enemy<br>Called the faceless (death)<br>Like bird enslaved in a cage<br><br><br>Ã‚Â© MR\'TINO THE LOVER BOY<br><a href=\"https://web.facebook.com/boardspeck/inbox/?mailbox_id=606459533049827&amp;selected_item_id=100004233512570#\">12/06/2019</a></p>', 'uploads/15603151382987429faceless.jpg', 'j90819542aBn72i', '04:52:19', '2019-06-12', '15603151399eecr2ia089t7o6l56d', 'thumb/15603151383027119faceless.jpg', 1),
(87, 'Desert women I am  (DAY 2 of 10)', 'Abdulrahman Soliu', '15601820100bly1ulmorenaer8alita11yepo4sru32i78sltae0c5hnagcdldha', 'show', '<p>Make a wanton of me&nbsp;<br>Though my uterus is full of abundant tears of them&nbsp;<br>Those treasure that makes world sweetest &nbsp;<br>And thee make hear after worse &nbsp;<br>In the state of their carelessness brought up. &nbsp;<br><br>Shall I forbear the sorrow of being isolated? &nbsp;<br>Walking alone under the scorching of phocbus\' cart&nbsp;<br>When my eye couldn\'t ease its hardness &nbsp;<br>Of viewing the erect of umbrella &nbsp;<br>Hanging above other fairer sex&nbsp;<br>With the aid of their treasure. &nbsp;<br><br>My words fly up, &nbsp;my thought accompany the moon, &nbsp;<br>And my day relish a warmwood. &nbsp;<br>Will my womb won\'t discharge its assigned duty? &nbsp;<br>Will I dine wine in this land of desert till the last whistle blown.? &nbsp;<br>Those questions analyses my feelings&nbsp;<br>And cause me to flashback on my past memories. &nbsp;<br><br>Who am I offended? &nbsp;<br>I echoed repeatedly &nbsp;<br>Till the smallest being grasp my emotion&nbsp;<br>With the state of being solilique &nbsp;<br>And causes me to rue&nbsp;<br>To those that I might offended. &nbsp;<br><br>I shall reject the tittle &nbsp;<br>When thy, &nbsp;my creator bless my womb&nbsp;<br>With the fruitful of my honeymoon &nbsp;<br>And till I experience the feelings&nbsp;<br>Of mounting my own child.</p>', 'uploads/15603213044698947desert_woman..jpg', 'j90819542aBn72i', '06:35:06', '2019-06-12', '1560321306et711r1rtelse694cd1a24i', 'thumb/15603213043543185desert_woman..jpg', 1),
(88, 'The Hole in my Heart (DAY 2 of 10)', 'Johnson Victor Oluwatobi', '1559751638oio1dr3ectan2lcjanipatarsot0te673weveyy7clsogu8roohnbh8i5ll7', 'show', '<p>There is a hole in my heart<br>Shallow and deep,<br>My heart, a deserted island&nbsp;<br>Where many feet &nbsp;have tread with grey pattern ,<br>Some with sword, many holding spears<br>But all are blood mongers<br>Scourging life out of my life.<br>That when I realized that Is (not) land&nbsp;<br>Is a young lad amidst the devil prawns.</p><p>There is a particular hole in my heart,<br>The curved is as big as the Euphrates river,<br>It was caused by a cursed&nbsp;<br>\"From dust you are, and to dust you shall return\".</p><p>Both Adam and Samson, David and Solomon&nbsp;<br>All passed this hole yolk on me,<br>It is the dark ages burden,<br>That I carried from my boyhood.</p><p>My holes are not scar nor pain,<br>They are the reason I crave upon the days,<br>When darkness resides without stars .<br>My holes are echoes&nbsp;<br>Of black days, of curse, of experience&nbsp;<br>\"Once I tread, twice I fall\".</p><p>There is a hole in my heart<br>Where blissful dew resides,<br>Anyone that puts there legs inside<br>Will never remove them again ,<br>Any tongue that taste from it<br>Will never taste from it again,<br>\"Because once you tread, Twice you fall\"</p><p>The holes are the ink in my pen ,<br>That teach the young ones not to love again,<br>\"Once I do, I was intoxicated with pleasure\"<br>But they say the heart was made to be broken .</p><p>Love is charming, but it\'s also a Charm,&nbsp;<br>A pot full of death, Poison in the Source<br>Full of wish, full of kiss.</p><p>My holes are my hope.<br>My myth are my might,<br>Once I fall in love , I can\'t resist his Pain<br>But I can endure the poison,<br>Once I tread, Twice I fall, thrice I rise.</p>', 'uploads/15603590112222118deed.jpg', 'j90819542aBn72i', '17:03:33', '2019-06-12', '156035901313trahcet7i05el53033', 'thumb/15603590111250995deed.jpg', 1),
(89, 'IT IS NOT EASY TO WRITE BUT (DAY 2 of 10)', 'Roland Ogomigo', '1559751748hsgdoca97gl7yt3yeli4re1ratolpe0n5gea8do7lr8iaomcn2o', 'show', '<p>It\'s not easy to write but I struggle to. I envy writers and their magic touch on papers.</p><p>The way they sculpt situations and put it down in writing can sweep you off from your feet, but nothing good comes easy.</p><p>There is always a fire you must go through to become a refined version.</p><p>Well, I was an average student that had passion for literature back then in highschool.</p><p>I didn\'t pass English language in flying colours but had that burning desire like young William Shakespeare, Chinua Achebe, Wole Shoyenka, etc.</p><p>I believed if they could do it, then I can do better.</p><p>Before the advent of telephone, guys relied on writings to win a lady\'s heart.</p><p>Those days, writing letters was the only method to communicate with someone farther from you.</p><p>So if your pen was not mighty enough, then your crush will fade away into another man\'s heart.</p><p>However, I still cherish writing till this day. Especially, the fact of earning a livelihood from it.</p><p>You can become a content writer, creative writer, ghost writer, copywriter author, poet, etc but all these professions require rigorous trainings.</p><p>Some may cost you a fortune to learn. It is worth the chase after all since you can make it a side hustle or full time job.</p><p>There are sites that support writers - upwork, Fiverr are the famous ones. There are others to consult if you make further research.</p><p>I started with poetry because I fell in love with imagery, alliteration and other poetic condiments.</p><p>I didn\'t get an offline tutor for poetry. I got admitted into a webinar that drove me into the world of the art.</p><p>And the experience has been wonderful. You can also join online platforms on WhatsApp or Facebook that teaches literature.</p><p>I met other talented writers and we engaged in duels. This activity really inculcated my obsession for the art. I lost twice in those duels, but after then, I became infallible.</p><p>You don\'t know how far you will get, until you take a step. The journey of a thousand mile begins with a step. So go for your dreams while you can and creativity will follow.</p><p>I tried participating in online competitions on some prominent sites but my works was never shortlisted for prizes.</p><p>This can be discouraging, but my zeal remains unmoved.</p><p>My strength in poetry grew in multitudes that people commended my works. This encouraged me to open two Facebook pages centred on poetry so people can have a taste of my skill.</p><p>Now, I am venturing into earning from writing and this is the most important thing to me.</p><p>I am naturally spurred by generating wealth and will commit myself to turn this to reality.</p><p>No matter your skill, if it doesn\'t earn you wealth, it is useless. You can earn a fortune also in this business.</p><p>If you think and feel writing is for you, then don\'t procastinate.</p><p>Now is the time!</p><p>Express yourself in its bliss.</p><p>If you experienced the same or have a different story about writing or you want to be guided on the path of earning from writing. Kindly drop your comments below.</p><p>Ã‚Â© Ogomigo Roland</p>', 'uploads/1560359175520831not.jpg', 'j90819542aBn72i', '17:06:16', '2019-06-12', '1560359176ic7ae7lr2735t8ti69', 'thumb/15603591753065596not.jpg', 1),
(90, 'The thorny cries (DAY 2 of 10)', 'Ariyo Ahmad', '15602440698dah92am6al40doactaroyyrg3ina7else5ie1yrh8ct0elp', 'show', '<p>It must be a dream she shrugged her head.<br>Panting her legs on the wall vehemently, I\'m a living dead.<br>Her thought raced to her yesterday, nothing had changed, she said.<br>That saddest joy overwhelmed her like rain in the cold.</p><p><br>The devil that highjacked her joy, appeared again.<br>Everything she ever burn the candle for, in vain.<br>Brilliant student of &nbsp;final year, indeed to her a pain.<br>A bipolar disorder fighter, part of her stain.</p><p>The car stumbled several occasions and delivers fire.<br>Her gold and mirror were shattered, sorrowful attire.<br>And her pride was burnt by &nbsp;a blazing liar<br>Her eyes have become cloud of rain.</p><p><br>My heart bumps into break at every cry.<br>I wail like a soul who lost his ephemeron body.<br>Thinking it\'s of a permanent body at first.<br>Sitting aloof to burn the pain with flowing tears.<br>There is a heavy thorn ladden in her lost soul that shed tears.</p><p><br>She has become a prey to hungry lion,<br>That have been camped in a closed circle of death.<br>Every times she blinks her eyes.<br>A thorny cries flow like ocean of heaven.<br>She lost &nbsp;battle to every demons she fought in her dream.</p><p><br>An happiness deprived soul that find pleasure in her tears.<br>Her body becomes a switch plugged with pains.<br>When she tries to stand, she fall twice a time.<br>When war begins, her fighting harmour betrays her.<br>Her tears flow freely from a free river of supremacy.<br>She gave up being a crying beast for in her &nbsp;tears lies her cold happiness to her world.</p>', 'uploads/15603592686621628cry.jpg', 'j90819542aBn72i', '17:07:49', '2019-06-12', '1560359269e2e5t18l5r37c3ia4th8', 'thumb/15603592687325734cry.jpg', 1),
(91, 'YET ANOTHER LEAP   (DAY 2 of 10)', 'Aj Maverick', '1560098207y3eogt5e7i6chc3k1aeavc3aye1apmlller4nstaj7rir00d', 'show', '<p>Yet another leap&nbsp;<br>on your heels. &nbsp;<br>See time flip&nbsp;<br>with the breeze. &nbsp;<br><br>The day speaks&nbsp;<br>squeaks and creaks. &nbsp;<br>It tosses and whirls, &nbsp;<br>only the wise hears. &nbsp;<br><br>Time ticks&nbsp;<br>in a flick. &nbsp;<br>A moment in your side, &nbsp;<br>in another, gone in a trice. &nbsp;<br><br>See the birds&nbsp;<br>flip flaps. &nbsp;<br>Until they perch&nbsp;<br>on their target. &nbsp;<br><br>See the bees&nbsp;<br>work all day. &nbsp;<br>Even in seasons &nbsp;<br>of rain like may. &nbsp;<br><br>Take another leap&nbsp;<br>on your heels. &nbsp;<br>If it\'s not convenient, &nbsp;<br>you\'ll still land on earth. &nbsp;<br><br>#Aj_Maverick</p>', 'uploads/15603594382257959leap.jpg', 'j90819542aBn72i', '17:10:39', '2019-06-12', '15603594393ea8tl10r6e982y7i6tc', 'thumb/15603594381723957leap.jpg', 1),
(92, 'RISE (DAY 2 of 10)', 'Chhote', '15601637908ypeccotrs6edlncey9e512t28rlotahaial0hgh051e', 'show', '<p>I\'ve conversed with demons and Seduced angels,&nbsp;<br>Beat boxed my ancestral spirits, and beaten witches to a pulp.&nbsp;<br>I think Its high time I spoke to the devil.&nbsp;<br>Wechipondo,&nbsp;<br>How are you?&nbsp;<br>Iam sorry iam left with no choice but to write Hoping someway, &nbsp;somehow, someday you will come accross this writing.&nbsp;<br>Shall we begin?&nbsp;<br>So, My brain, body and heart are tired of your silly childish games<br>tired of having to be tempted over and over again with the same petty temptations.&nbsp;<br>Iam Tired of your amateur minions running around in black dark and white suits tryna turn me into one of them,&nbsp;<br>Tired of my success &nbsp;being held in captivity and goals in chains .&nbsp;<br>For how long will I have to put you down?</p><p>For how long will I leave you decapitated swimming in your own blood?&nbsp;<br>How many holes In your dark chest and corrupt heart must I leave with the holy word?&nbsp;<br>For you to be convinced iam strong with Christ, how many of your attacks must I evade with him as my shield?&nbsp;<br>How many of your demons must I cast out into the abyss?&nbsp;<br>Wechipondo!&nbsp;<br>When will you realize no matter how broken you leave me, I still rise?&nbsp;<br>Break my neck, detach my heart from the depth of my rib cage,&nbsp;<br>Still I rise!&nbsp;<br>Turn nations against me if you can, burn them bridges I depend on, place me on a boat, &nbsp;close all the doors and sink me,&nbsp;<br>Still I rise!&nbsp;<br>Burn my home, connive with death as you strike my beloved ones with eternal sleep,&nbsp;<br>Still I rise!&nbsp;<br>Attack my academics, deny me bursary and scholarships,&nbsp;<br>Still I rise!&nbsp;<br>Plague my body with sickness, pull my eyes out for all care, I will rise!&nbsp;<br>For Christ has not given me the power of fear but the power of hope, power to love, power to heal and overcome, power to cast out demons, power to be free from your bondage.&nbsp;<br>You see, With Christ as my friend and savior, with him as my ally,&nbsp;<br>\"I WILL ALWAYS RISE\"<br>#CHHOTE_THEE_POET</p>', 'uploads/15603595444180641chote.jpg', 'j90819542aBn72i', '17:12:25', '2019-06-12', '156035954517a8e41cirrsl74886tie', 'thumb/1560359544761917chote.jpg', 1),
(93, 'Mother Earth\'s Share  (DAY 2 of 10)', 'Asika Victor', '1560102058ce2hcod0l31iel77inotya83tay600escgiarvrskret4plaa', 'show', '<p>Mother earth owes mannish a share,&nbsp;<br>Share that all don\'t want &nbsp;<br>Oh, an inevitable share,&nbsp;<br>all wish not to have&nbsp;<br>This wicked and lovely share,&nbsp;<br>that all must embrace one day&nbsp;<br><br>Oh what a lovely unwanted share,&nbsp;<br>all must accept&nbsp;<br>Day after day all draws closer to thee&nbsp;<br>That unwanted share&nbsp;<br>if enters sadness flows&nbsp;<br>giving way to a mighty ocean to run down our chicks &nbsp;<br><br>Oh mother earth\'s share for all&nbsp;<br>When seen sadness seen&nbsp;<br>It weaks and it cross the bar&nbsp;<br>---over to forever land&nbsp;<br>But this share is for all&nbsp;<br>and all must take&nbsp;<br><br>Death is an inevitable share,&nbsp;<br>that all will surly get&nbsp;<br>Be you beautiful or ugly, rich or poor and black or White &nbsp;<br>I pray before I cross the bar,&nbsp;<br>before I take mine.&nbsp;<br>That this eternal line of mine,&nbsp;<br>most have done the need be</p>', 'uploads/15603625649505714lass.jpg', 'j90819542aBn72i', '18:02:46', '2019-06-12', '1560362566t0c87r57ee7to11imah9lr2', 'thumb/15603625641198018lass.jpg', 1),
(94, 'KISS OF BETRAYAL (DAY 3 of 10)', 'Georgette Kendra Mbale', '1559751687aeytcets5teded9e0blg3g21emn1aehyaireel1po8nrglol1tr9ckra6a', 'show', '<p>Kisses from the dragon<br>Hisses in whispers of the serpent.<br>Those snake tight hugs<br>The kind that make you feel warm<br>Yet &nbsp;they squeeze the life out of you.</p><p>Imagine living next to a bee<br>One minute it stings you<br>Next minute it offers you the sweetest of honey.<br>Imagine having friends like ghosts<br>Claiming to be friends of all seasons<br>Yet they\'re just a thorn in your flesh<br>A knife that keeps stabbing you in the back<br>Or a venomous serpent that keeps biting you<br>They don\'t kill you&nbsp;<br>Slowly growing numb to &nbsp;the hurt and venomous bites.</p><p>Take a look around,take a good look around you<br>Can you spot the bees,thorns,serpents and the Judas.&nbsp;<br>Always holding your hand in thy brightest moments<br>Yet taking a step back in your darkest torments.</p><p>Be aware,stay vigilant&nbsp;<br>Take a huge step away from them<br>Before they offer you as a pleading sacrifice to their gods<br>Or your head as a gift like John the Baptist<br>Or offer you on a silver platter for pieces of silver<br>Like Judas did to Jesus<br>With a kiss of betrayal.</p>', 'uploads/15604069884741778day3_gorge.jpg', 'j90819542aBn72i', '06:23:10', '2019-06-13', '156040699016sl90criist752k8e59a', 'thumb/15604069883437668day3_gorge.jpg', 1),
(95, 'THE SACRIFICES WE MAKE (DAY 3 of 10)', 'Lewis Wamwanda', '1559751824300twhsaocetip8dai3enners8lw1myawadre85yac5gal11lel', 'show', '<p>You will feed us with honey and milk<br>To bribe us away from the pain<br>But the memories will be buried deep within us<br>Plunging deep down the thoughts of sorrow<br>Like a small ship lost in the middle of a raging sea<br>Or a plane in the middle of a stormy night<br>And silently, within the verge of our sorrow<br>We will summon death for comfort<br>And take pain with us<br>To ease the burden in our hearts</p><p>We will laugh together \'till midnight<br>To give you hopes of triumph<br>And a sense of victory and pride<br>But when we lay silently in our beds<br>In the cold lonely nights,<br>The buried memories will find their way out<br>To torment and lure us to pain<br>Mocking and making fun at us<br>As we bath in tears of our sorrows<br>And fighting ourselves back to slumber</p><p>Nights will not be time to sleep<br>For fear will be roaming at the darkest hours<br>Waiting to pounce on our beaten souls<br>And take control of the long nights<br>We will be enslaved by our memories<br>Tortured by the past bitter pains<br>To the point of breaking our souls<br>And killing the little joy we possessed<br>Extinguishing the light lit years ago<br>And hope and happiness will float in the dark</p><p>We will laugh and smile all day<br>And you will praise us for our happiness<br>And urge others to be like us<br>To follow the steps we ought to make<br>But you won\'t understand our griefs<br>And not notice the masks we wear<br>That fades as dusk approaches<br>Leaving us naked, afraid and lonely<br>And the chains of fear will be put on us<br>As we wait for our long night of torture</p>', 'uploads/15604070874855049day3_lewis.jpg', 'j90819542aBn72i', '06:24:48', '2019-06-13', '156040708820e5ilat71ec9tr15h71', 'thumb/15604070875437117day3_lewis.jpg', 1),
(96, 'CORRUPT LEADERS (DAY 3 of 10)', 'OLUWOLE OLUWATOBI SOLOMON', '15600993580oonbacye1gtousayoa4lnrelr01cioo4t6slolue0w0plltold7ewmai9he1', 'show', '<p>How are we blessed with corrupt celebrated leaders?<br>Who know nothing than to cause havoc to the masses<br>They are the present cankerworms of Nigeria<br>Dubious deliberate dealers of human rights<br>How can we be freed from these bad omens?</p><p>Corrupt leaders, where are your eyes?<br>Why have you given yourselves to be prey to the masses?<br>Who have cursed you to perform all these acts?<br>Can change ever come from you all?</p><p>Corrupt leaders, where are your ears?<br>You listen to the agonies of the masses<br>But you turn your deaf ears<br>Who have charmed you to be deafs?<br>Will you lead the masses aright like this?</p><p>Corrupt leaders, where are your brains?<br>Are they not mentally deranged?<br>If no, why do you think abnormally?<br>You amass the public funds,<br>You embezzle and exploit the masses<br>Do you think the masses are mannerless?<br>The eyes above is watching your wickedness<br>How long will you stop all these inhuman acts?</p><p><br>Written by: Ã‚Â©OLUWOLE OLUWATOBI SOLOMON (10/06/2019)</p>', 'uploads/15604071722430728day3_oluw.jpg', 'j90819542aBn72i', '06:26:13', '2019-06-13', '1560407173rarc3ocr616l37p83ei0utt2', 'thumb/15604071724229992day3_oluw.jpg', 1),
(97, 'THIS WORLD OF VANITY (DAY 3 of 10)', 'Ariyo Ahmad', '15602440698dah92am6al40doactaroyyrg3ina7else5ie1yrh8ct0elp', 'show', '<p>My heart sobs, my mind stinks.<br>My skin bleaches, my eyes got blind,&nbsp;<br>my ears becomes deaf, my nose becomes stuffed up,&nbsp;<br>my blood stops from flowing, my teeth ignites sparks like thunder.<br>My body now dropped in a hollow room&nbsp;<br>Called grave that my four fathers were buried.<br>And their bones becomes bright and glooming like the &nbsp;moon in the night</p><p>Is this not the world, where the sun rise and set.<br>Of the moon that glows bight will fade of shine.<br>Does man thinketh is breathe that gas is eternally set.<br>Even the sad face that smile will also decline.</p><p><br>This world of vanity, where man accumulate treasury.<br>And then dine and wine in the villa, forsaken the needy.<br>This word of vanity, where religion has turned to business.<br>The garment of faith has tore, religion is now in nakedness.</p><p><br>This world of vanity, where peace has been drunk to stupor.<br>She now wonders around the world, vomiting ocean of bloodshed.&nbsp;<br>The world of vanity where the fire of evil burns,<br>And its flame soak our nose from breathing peace.</p><p>This world of vanity , where madness has struck eternity.<br>With no sense of change, man still dip hands in vanity.<br>This world of vanity , where our creation is from water that stink.<br>And our apex in life will be inside the fashioned grave.<br>Where our forefathers were baptized.</p>', 'uploads/15604072609596917day3_armad.jpg', 'j90819542aBn72i', '06:27:41', '2019-06-13', '15604072612ta3tcl82r8si94i98eh7', 'thumb/15604072606247152day3_armad.jpg', 1),
(98, 'DEAR_MOTHER (DAY 3 of 10)', 'Chhote', '15601637908ypeccotrs6edlncey9e512t28rlotahaial0hgh051e', 'show', '<p>Iam sorry IÃ¢â‚¬â„¢ve been too busy with my useless doings that I forgot to check and see how you were doing<br>Sorry I have been too committed pleasing the entire world while you were neglected in the process<br>Sorry I spent all my soche pack subscriptions sending sweet and nasty messages,<br>Having dirty conversations with my girlfriends<br>While you wallowed in your pillow of sadness<br>Iam sorry IÃ¢â‚¬â„¢ve been too busy attending picnics and late night dinners with my friends<br>While you remained buried in heavy blankets of loneliness<br>Sorry I replaced your presence with my Facebook friends<br>Replacing your essence in my life with Facebook statuses<br>Iam sorry&nbsp;<br>Sorry I was never that blessing I was meant to be<br>Instead of mapalo I only gave you problems and heartaches mu chalo<br>On countless occasions I hurt you,<br>On different times I forgot about you,<br>Insulted you and even left home but, you loved me still<br>When I cried you were there to wipe my tears<br>You were there to bandage my wounds all those times<br>You were always there to lecture me lovingly when I was wrong&nbsp;<br>In my dark corner I write this letter to you,<br>Realizing my mistakes,<br>Reflecting on my ugly past with tears drenching my shirt&nbsp;<br>Truth is,<br>No amount of comments can ever match up to your advice<br>Neither can the amount of likes on my pics ever quench my thirst for that smile you bring to my face<br>In short all I wanna say is,<br>IAM SORRY<br>#CHHOTE_THEE_POET</p>', 'uploads/15604073424842792day3_chhote.jpg', 'j90819542aBn72i', '06:29:04', '2019-06-13', '1560407344eeitdhlea3c15t71636marr34or', 'thumb/15604073424508727day3_chhote.jpg', 1),
(99, 'We(boys) shiver too.  (DAY 3 of 10)', 'Bello Sodeeq Adekunle', '1560163948uyoesae7laldeeatd51lootpre1beics0ngyn81dkl04qa9l5lreeceh6', 'show', '<p>The last time papa complete the&nbsp; sketch of those taking his semblance<br />\r\nHe forgot to create any loopholes<br />\r\nIn his diagram<br />\r\n&nbsp;Refined colours he&#39;d make use of - Black and white&nbsp;<br />\r\nBlack: too deep to have an iota of shallowness&nbsp;<br />\r\nWhite: a crystal of plain ink, too clear to conceal taint.&nbsp;<br />\r\n.&nbsp;<br />\r\nI imagine if creature like us - me &amp; papa, don&#39;t have flaws<br />\r\nbut he said we have &amp; they&#39;re outnumbered&nbsp;<br />\r\nJust that our portrait is too good to reveal one.&nbsp;<br />\r\n.&nbsp;<br />\r\nsome say we reflect the image we look up to&nbsp;<br />\r\nwhen we stretch out our hands to heaven,&nbsp;<br />\r\nThey say we&#39;re a mini-version of him - God &amp; they call us god.&nbsp;&nbsp;<br />\r\n.&nbsp;<br />\r\nI hope the hellion here will see God&#39;s forgiveness.&nbsp;<br />\r\nBecause they&#39;ve actually name us what we ain&#39;t.&nbsp;<br />\r\n.<br />\r\nWe&#39;re just brave warriors that have fought in deadly war<br />\r\nBut still survive amidst its turbulence.&nbsp;<br />\r\nAnytime we drew the line of battle, the inner us shimmer but we betray our soul with that firm look.&nbsp;<br />\r\nLingering to that sturdy verse:<br />\r\n&quot;Everything is okay&quot;.&nbsp;<br />\r\n.&nbsp;<br />\r\nPapa couldn&#39;t tell us about the hell erupting inside him<br />\r\nThough&nbsp; before he speak we are aware of the terror inside,&nbsp; moulding into fortress of pretence.&nbsp;<br />\r\n.&nbsp;<br />\r\nWe are birds of the same heritage, we think alike.&nbsp;<br />\r\n.&nbsp;<br />\r\nMama always give all shield to my sisters - both younger &amp; older.&nbsp;<br />\r\nEven papa will still garner mine &amp; give it to them<br />\r\nTelling me I am meant to be strong &amp; batter hardships&#39; face<br />\r\nHe said he didn&#39;t mean to hurt me but can&#39;t bare leaving the heritage of is household for a cowardice.&nbsp;<br />\r\n.&nbsp;<br />\r\nThey believe we are above being protected&nbsp;<br />\r\n&amp; think we ain&#39;t that fragile to cry.&nbsp;<br />\r\n.&nbsp;<br />\r\nBut deep inside our eyes are flames of agony<br />\r\nSprouting from the dell of yesteryears pain<br />\r\nThey deprive us the right to cry because if we do&nbsp;<br />\r\nThey say we are not what we are meant to be - Men.&nbsp;<br />\r\n.&nbsp;<br />\r\nI wish they see how we jolt in the dreary arm of struggles<br />\r\nI wish they know what we pass through in lands rigged with pains<br />\r\nI wish they understand our plight &amp; acknowledge how our heart sake in times of odious challenges<br />\r\nBecause we(boys)&nbsp; are not stone, we shiver too.&nbsp;</p>\r\n\r\n<p>&copy;Adekunleunique</p>', 'uploads/15604074851399210day3_Bello.jpg', 'j90819542aBn72i', '06:31:26', '2019-06-13', '1560407486alri07w6451735retce7e', 'thumb/15604074859789224day3_Bello.jpg', 1),
(100, 'LET GO (DAY 3 of 10)', 'Paciolo Pen Saint', '156018203445nt0aiss3nclhny6ceteo9gtraoa6e9a4lipi7ee1playorplc7d', 'show', '<p>Away from this insipid world,&nbsp;<br>Away from this earthly catastrophe,&nbsp;<br>Away from this dungeon of calamities.&nbsp;<br><br>Let go to where won\'t be seen, &nbsp;<br>To where parent sins won\'t visit, &nbsp;<br>To where severe phases won\'t linger,&nbsp;<br>To where eternal bliss dwell,&nbsp;<br>To where we will be tied with the strings of Arcadian life,&nbsp;<br>Let go to the never never land.&nbsp;<br><br>Paciolo Pen Saint</p>', 'uploads/15604076905505850day3_paciolo.jpg', 'j90819542aBn72i', '06:34:52', '2019-06-13', '15604076922181r81c5etai2ll36te', 'thumb/15604076916110116day3_paciolo.jpg', 1),
(101, 'What if I am   (DAY 3 of 10)', 'Abdulrahman Soliu', '15601820100bly1ulmorenaer8alita11yepo4sru32i78sltae0c5hnagcdldha', 'show', '<p>The healer that will be healing mankind&nbsp;<br>From the gross of plague that make them unkind&nbsp;<br>And which had corrupted the life of those with great mind. &nbsp;<br><br>What if i am&nbsp;<br>The plenipotentiary of lord&nbsp;<br>Which will be dwelling on world &nbsp;<br>With my greatest mind of changing the whole world &nbsp;<br>With that of my pen\'s blood&nbsp;<br>Inking without eliminating with mighty sword. &nbsp;<br><br>What if I am &nbsp;<br>The book revealing for the light to shed&nbsp;<br>Into the heart that had rot into master red&nbsp;<br>To proliferate them in the manner of being well&nbsp;<br>And forever reign in the palace of well. &nbsp;<br><br>What if I am &nbsp;<br>The heart that will be correcting the hand&nbsp;<br>That had pledged to remain the idle hand&nbsp;<br>not to stagnant as &nbsp;workshop of evil&nbsp;<br>For \'t makes world the palace for devil.</p>', 'uploads/15604078698756321day3_soliu.jpg', 'j90819542aBn72i', '06:37:50', '2019-06-13', '15604078703ehit4l66a1w71rc36ta9', 'thumb/15604078694781295day3_soliu.jpg', 1),
(102, 'RADIANT     (DAY 3 of 10)', 'Aj Maverick', '1560098207y3eogt5e7i6chc3k1aeavc3aye1apmlller4nstaj7rir00d', 'show', '<p>The sun brings light &nbsp;<br>In the day, shining bright. &nbsp;<br>Nature turns sharply with haste &nbsp;<br>When she meets the sun\'s gaze&nbsp;<br>Its rays are beautiful, &nbsp;<br>Radiant, looking like you. &nbsp;<br><br>While the sun emits light rays&nbsp;<br>Lighting up the earth&nbsp;<br>And comes with it a new day&nbsp;<br>Shining everywhere &nbsp;<br>Giving chance to those who make hays, &nbsp;<br>Before it sets. &nbsp;<br><br>Afterwards, going to take a rest, &nbsp;<br>Far in the west. &nbsp;<br>While you\'re always here. &nbsp;<br><br>The sun pales in comparison to you &nbsp;<br>Tho she\'s as beautiful as you &nbsp;<br>Her effects are only ephemeral &nbsp;<br>Unlike you, whose presence give exuberance. &nbsp;<br>&nbsp;<br><br>Ã‚Â© Aj Maverick</p>', 'uploads/15604079754395105day3_ajmaverick.jpg', 'j90819542aBn72i', '06:39:36', '2019-06-13', '1560407976i9ra3a27tra660d8elc3in6t', 'thumb/15604079758513646day3_ajmaverick.jpg', 1),
(103, 'My life drama  (DAY 3 of 10)', 'MR\'TINO', '1560163509coadedep0lrecaramea3h2eiab1e3dn4l27siy28ejyougmltayi5yat1', 'show', '<p>Like a bird i was born &nbsp;<br />\r\nTo soar amidst of blues &nbsp;<br />\r\nMy nest is beautifully but,&nbsp;<br />\r\nCastled on distinguishably tree&nbsp;<br />\r\n<br />\r\nTo fly is my will &nbsp;&nbsp;<br />\r\nBut my two wings is broken &nbsp;<br />\r\nWhile my chirps is fading,&nbsp;<br />\r\nI am a Nightingale that lost his melodious afro&nbsp;<br />\r\nWhen intended to fly on sky&nbsp;<br />\r\n<br />\r\nEvery night came as hurdling&nbsp;<br />\r\nEvery dawn came as herod &nbsp;<br />\r\nBut crafted in shape of Judas &nbsp;<br />\r\n<br />\r\n<br />\r\n&copy; MR&#39;TINO THE LOVER BOY</p>', 'uploads/1560430166467682day_3_tino.jpg', 'j90819542aBn72i', '06:44:05', '2019-06-13', '156040824581tl1807irce0ay0m16', 'uploads/15604301665288486day_3_tino.jpg', 1),
(104, 'WASTE NOT    (DAY 3 of 10)', 'Asika Victor', '1560102058ce2hcod0l31iel77inotya83tay600escgiarvrskret4plaa', 'show', '<p>Waste not---&nbsp;<br>that precious water,&nbsp;<br>that comes from the sight&nbsp;<br><br>Don\'t open that river for the worthless,&nbsp;<br>those waters are precious&nbsp;<br>Waste it not&nbsp;<br><br>Hold that strength,&nbsp;<br>for you will use it to shade the cold night&nbsp;<br>For the night is cold&nbsp;<br><br>Waste it not dear,&nbsp;<br>for it\'s not time to water the floor&nbsp;<br>Hold back your strength and tears&nbsp;<br><br>Put on those smiles as you always do&nbsp;<br>Hold back the strength and cover the filled tank&nbsp;<br>Do not let any water drop from it&nbsp;<br><br>It\'s been a long time coming&nbsp;<br>You may not be the best&nbsp;<br>but still, you are different from the rest&nbsp;<br><br>The pain might seem over much to bear&nbsp;<br>But try masking on the smiling face&nbsp;<br>Let the pain dry like tears do&nbsp;<br>One day the dryer will join the story,&nbsp;<br>then will the rest become history&nbsp;<br>I know behind that happy scene&nbsp;<br>Mountain of melancholy lias&nbsp;<br><br>For the water destroys the beauty&nbsp;<br>So mask on the smile in pain,&nbsp;<br>for that will make the marred&nbsp;<br>And you\'ll become a saviour---&nbsp;<br>even in your pain&nbsp;<br>So waste it not</p>', 'uploads/15604086223190629day3_askika.jpg', 'j90819542aBn72i', '06:50:23', '2019-06-13', '1560408623rt1el55etia0ca149sw60', 'thumb/15604086222537906day3_askika.jpg', 1),
(105, 'Sweet Nothings    (DAY 3 of 10)', 'The_Bee', '15602467049y1yhrl1i4rtdac41el91pbaces1gno0tte1haeeele6', 'show', '<p>In the deep of the night&nbsp;<br />\r\nThe wind is calm</p>\r\n\r\n<p><br />\r\nNight skies wispers&nbsp;<br />\r\nI want you near<br />\r\nI miss your touch<br />\r\n<br />\r\nAnd the sweet nothings<br />\r\nWispered into my ears&nbsp;<br />\r\nOh how I miss your presence...</p>\r\n\r\n<p><br />\r\nTHE_BEE</p>', 'uploads/1560430477789657616_Eating_Performance_00_1860x2881.jpeg', 'j90819542aBn72i', '12:54:39', '2019-06-13', '1560430479lc1et39aie6634w7er0st', 'thumb/156043047763507916_Eating_Performance_00_1860x2881.jpeg', 1),
(106, 'Lost Chance (DAY 3 of 10)', 'Botefarm', '1560163828tmootcc7aeet9eab10ld9p7hgyie0lf2nl1ye2rar5rsa', 'show', '<p>As the world moved, they don\'t&nbsp;<br>Anticlockwise, retrogressive, hermit&nbsp;<br>Keeping the time of life, didn\'t moved a bone<br>Till grey hair came calling, &nbsp;bones start to stiff<br>Here I lay, &nbsp;regretting &nbsp;those chances I didn\'t pick.&nbsp;<br>...<br>...<br>Bottled anger, volcanic &nbsp;on wife, children<br>None prick &nbsp;me, &nbsp;but no money&nbsp;<br>No food on plate, not water in the sistern<br>For I\'ve played away when chances were many<br>Son, &nbsp;beware, &nbsp;watch, &nbsp;never be like daddy.&nbsp;<br>...<br>...<br>With a last straw, &nbsp;hope not lost<br>All capital &nbsp;packed, &nbsp;headed for the market &nbsp;stock<br>Looser, &nbsp;dump, &nbsp;candle stick, &nbsp;I know not&nbsp;<br>Gambled &nbsp;all away, &nbsp;came with none&nbsp;<br>Son, &nbsp;make hay, learn trade, so you won\'t be burnt.&nbsp;<br>...<br>...<br>From one school &nbsp;to another, &nbsp;this makes me happier&nbsp;<br>Plan, write goals, &nbsp;develop, educate yourself better<br>Future shock is coming, &nbsp;stock your stock&nbsp;<br>That when the chance, your gun &nbsp;should be cork<br>Ready, &nbsp;alert &nbsp;for the best of life\'s cut.&nbsp;<br>...<br>...<br>...</p>', 'uploads/15604334775829923oso.jpg', 'j90819542aBn72i', '13:44:39', '2019-06-13', '1560433479a6t214rlteol6733i2c5s', 'thumb/1533561thumb1560433562.jpg', 1),
(107, 'FAMILY (DAY 3 of 10)', 'Roland Ogomigo', '1559751748hsgdoca97gl7yt3yeli4re1ratolpe0n5gea8do7lr8iaomcn2o', 'show', '<p>I don\'t know who to choose. Should I choose my mom? My mom is that caring woman that can lash you with words when angry. I really hated those moments with her. My dad is a disciplinarian whose focus is mainly attached to academic success.</p><p>You dare not come home as a failure without been insulted and flogged when necessary. He hardly crack jokes with us, but he is funny.</p><p>My mom is not really much of a disciplinarian, but when she flogs, it can be bloody. She uses anything with her as instrument of punishment.</p><p>My dad doesn\'t miss me much whenever I am away too long from home, but my mom loves to see her first son especially when my absence has enlongated its period.</p><p>My siblings on the other are a world of endless dramas. Their personalities and tiny troubles has really swept me off my feet.</p><p>Guy, he no easy to get siblings.</p><p>When you\'re younger, you will want a baby brother or baby sister so you can cuddle and show parental care to them. But as they grow up, they become threats and don\'t give a \'fuck\' about who you are.</p><p>I have had constant conflicts with them including my parents, but most times we later return to our former relationship. They have all taught me true lessons of life. Experiences with them cannot be priced.</p><p><br>I didn\'t include their talents and skills are remarkable. Oops, I almost skipped that. Some can sing and dance. Some are academic gurus and were my dad\'s pet. I wasn\'t that of a guru in my studies, but my father\'s trainings helped me graduated from tertiary institution without carry over. He was happy that at least his teachings was worthwhile.</p><p>One of my friends back then in National Diploma told me \'carry over be like disease\'. Whenever I remember this, I thank my dad for those reprimand given to me when I failed my examinations.</p><p>So back to my siblings palava, although they\'re with side effects, but they can still be a tool for entertainment at times.</p><p>It\'s not easy to narrate their habits from day 1 till date, unless you want my pen to suffer or you want me to give you small small lies.</p><p>Above all, family is everything. No matter where you go, there\'s no place like home.</p><p>So how have your love ones treated you? If you\'re an orphan, you better love yourself.</p><p>Tell me, I\'m all ears. Who are your love ones. Tell me something about them?</p><p>Ã‚Â© Ogomigo Roland</p>', 'uploads/15604455997385050IMG_20190613_WA0006.jpg', 'j90819542aBn72i', '17:06:41', '2019-06-13', '1560445601rmf85iy25e885a3tclia2l', 'thumb/15604455994197551IMG_20190613_WA0006.jpg', 1),
(108, 'Becoming A Man (DAY 3 of 10)', 'Johnson Victor Oluwatobi', '1559751638oio1dr3ectan2lcjanipatarsot0te673weveyy7clsogu8roohnbh8i5ll7', 'show', '<p>If I should write a song with thousand pen,<br>Then it will be about the chain<br>Holding my lower heart tight .</p><p>Some call it manhood, but I call it Frighthood,<br>Upon death and resurrection I dive<br>Amidst my thin leg, A thin rod was unveil.</p><p>The thought of who am I<br>Keep tampering with my still water,<br>Until the sun keep moving towards manhood.</p><p>I stood upon the edge of my shadow ,<br>But even the time keep moving towards grey hair,<br>All young lads have also grown into woman.</p><p>They said the boy will surely turns to a man,<br>But if wish can really be catapulted ,<br>I would still be playing by the river bank.</p><p>But now that the bird was left to fly higher,<br>My two arms have been build to a firearm ,<br>Now I got to break through rock to get water.</p><p>I keep echoing my past,<br>Where I was tempered like the small bird,<br>And can roam the streets with my tyres .</p><p>Until I found out that some moon ago,<br>The sun also sets to rest,<br>When grey hair takes over the head.</p>', 'uploads/15604584094767026IMG_20190613_WA0008.jpg', 'j90819542aBn72i', '20:40:12', '2019-06-13', '15604584128irbn7mgel8c161o3ia96cte6', 'thumb/15604584093633079IMG_20190613_WA0008.jpg', 1);
INSERT INTO `insight` (`id`, `title`, `author`, `category`, `visibility`, `body`, `image_1`, `created_by`, `time_created`, `date_created`, `hash_id`, `thumbnail`, `notification_status`) VALUES
(109, 'THE JOURNEY series 1  (DAY 3 of 10)', 'HOLUWAKHARYORDAE TAIWO', '1560102926ra12hacel1ngpraalad6wodtieyaorulcaio67ee37yokl0stw90h5teryh', 'show', '<p>As the call rang through my ear<br>I stagger like climbing a stair<br>I was eloped with CHILDHOOD thought<br>Revived back to life by THE CALL.</p><p>I buckle up my shoes and stand upright<br>Echoes of mama\'s voice \"SON DON\'T BE FRIGHT \"<br>saunter to my eardrum with might<br>To win, I have to engage in a fight.</p><p>I back my heavyweight bag<br>Loaded with criticism and nags&nbsp;<br>I stamp my feet upon Rock of yesterday<br>It crust and crumble to Clay.</p><p>I stare astound at the ocean waves<br>Gigantic but I have to sail<br>Goodbye Mama, sadly I wave<br>In me your love was safely caged.. &nbsp;</p><p>I set to embark on a journey...</p><p>THE JOURNEY series 1<br>#Iamteazhy</p>', 'uploads/1560460077826392262204575_2381000748791351_4993074875179466752_n.jpg', 'j90819542aBn72i', '21:07:59', '2019-06-13', '156046007966te1lc3i6h88eart829', 'thumb/1560460077203552262204575_2381000748791351_4993074875179466752_n.jpg', 1),
(110, 'AWAKENING DUSK (DAY 4 of 10)', 'Georgette Kendra Mbale.', '1559751687aeytcets5teded9e0blg3g21emn1aehyaireel1po8nrglol1tr9ckra6a', 'show', '<p>Not all that glitters is gold<br>Not all that is dark is evil.<br>But there\'s always a thin line between darkness and light.</p><p><br>My hands liberated yet my mind enslaved&nbsp;<br>A daily meal is a hustle always straining a muscle.<br>Never do I break a leg,repetition of unending nightmares.</p><p>Mama cries and prays she goes early&nbsp;<br>Coz the ghost in her keeps taking away a piece of her daily.&nbsp;<br>Daily she grows thin on skin and life<br>But never thin on her misery and anguish&nbsp;<br>Crying tears of blood ,singing songs of liberation&nbsp;<br>Stories of a life promised<br>But only slavery with a different name.&nbsp;<br>Insufficient resources,lack of opportunities with unending poverty Enslaved through the mind and body.</p><p>They push us deep in the dark<br>As they feast and celebrate in the light<br>They live lavishly at the expense of our hard labour&nbsp;<br>They steal our seeds to sow their own fields<br>They walk with their stomachs full like pregnant men<br>Pregnant with lust and greed.</p><p>On that faithful moon shining night<br>We shall rise<br>Like a passover meal we shall be remembered.</p><p>On the day of the awakening dusk<br>The sun shall stand still<br>The ancestors shall rise to fight with us<br>Fight for the injustice against my father<br>Fight for my brother\'s security<br>Fight for my sister\'s dignity<br>Fight for my mothers peace of mind.&nbsp;<br>It\'s a paradise and a war zone&nbsp;<br>An awakening dusk and a dying dawn.</p>', 'uploads/15604668137508135IMG_20190613_WA0022.jpg', '1560460825r932ac966ot0e6eag4ril3', '23:00:15', '2019-06-14', '1560466815r9ieng9kctea98ni8wa133l0a2', 'thumb/15604668135765778IMG_20190613_WA0022.jpg', 1),
(111, 'Nature  (DAY 4 of 10)', 'Ariyo Ahmad', '15602440698dah92am6al40doactaroyyrg3ina7else5ie1yrh8ct0elp', 'show', '<p>&nbsp;</p>\r\n\r\n<p>In the beginning.<br />\r\nMan&#39;s existence was hidden<br />\r\nBut plain in the hand of the fashioner.<br />\r\nNot alone the existence of man.<br />\r\nFor we were bereft of it&#39;s knowledge,<br />\r\nOf how this world became decorated.<br />\r\nAt times it dazed my porous mind.<br />\r\nOf how this world was born to existence.<br />\r\nAnd the stunning process laden in it.</p>\r\n\r\n<p><br />\r\nI scale through the sky to find an answer.<br />\r\nIn the morning the sun came out triumphant.<br />\r\nSloping to the night that succeeded it,<br />\r\nI looked unto the moon again and again.<br />\r\nI then place my hand on my chest.<br />\r\nAnd I could hear the natural engine.<br />\r\nSo I get some of my questions answered.<br />\r\nBut my heart still tremble on the major question.<br />\r\nWhere is the one who fashioned the sky ?<br />\r\nSuddenly, the star bore hole to the sky.<br />\r\nBeautifying the sky was all together another intriguing thing.<br />\r\nThen I think of holding one and placing it on my palm.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Buy it was not to my reach.<br />\r\nNot a jump can even do, far beyond my reach.<br />\r\nThen I pursed for a moment, why the fuss ?<br />\r\nI looked around seeing animals like me.<br />\r\nThough am higher than them,like goat like hen.<br />\r\nI breathe in and out loudly and heavily.<br />\r\nWhere does this breathe descend from.<br />\r\nLikewise do I feel the breeze in the night.<br />\r\nThere is surely a subtle being behind this wonders.<br />\r\nPerfect above mans imagination,<br />\r\nSubtle and powerful.</p>\r\n\r\n<p><br />\r\nI saw the stars hiding their head back into the sky.<br />\r\nThe cloud suddenly change and I became scared.<br />\r\nThen a thunder sparks into my heart.<br />\r\nThe birds on the tree I sat, pick a fly.<br />\r\nThen after a moment the rain was delivered by the cloud.<br />\r\nWith a drop on my head, I feel the chimed cold.<br />\r\nDeep down in me it was a blessed one.<br />\r\nThe breeze commemorate the falling rain.<br />\r\nAnd I became happy &quot;within inside me&quot;<br />\r\nIt is an unforgettable incident about the nature.</p>\r\n\r\n<p><br />\r\nMy eyes after some moment.<br />\r\nSuddenly started melting like gum.<br />\r\nVery heavy to raise the eye lashes.<br />\r\nThe next thing that happened,<br />\r\nI found myself as a flying bird.<br />\r\nIn a world different from this world.<br />\r\nWondering and flapping my wings.<br />\r\nWill I remain like this till eternity.<br />\r\nI was showed wonders i never imagined.<br />\r\nSuddenly, I was resurrected from my dream.<br />\r\nI came to the life pursed when I sleep.<br />\r\nThen I know someone is in control of my dream.<br />\r\nOne who has power behind beyond.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>In the end of everything<br />\r\nThe young child I met in life died.<br />\r\nThe old I met in life are dead.<br />\r\nThey have gone to somewhere to hide.<br />\r\nA place where we will never be returned.<br />\r\nIts nature that drove us to this world.<br />\r\nThe wonders we see are all natures.<br />\r\nWe are part of the nature.<br />\r\nThis is my nature.<br />\r\nThe nature I live in<br />\r\nThe nature I will die within.</p>', 'uploads/15604986157447213IMG_20190614_WA0002.jpg', 'j90819542aBn72i', '07:50:17', '2019-06-14', '1560498617r3tit27nalrcuee615a4350', 'thumb/15604986157841774IMG_20190614_WA0002.jpg', 1),
(112, 'Dark Sunshine (Day 4 of 10)', 'Bello Sodeeq Adekunle', '1560163948uyoesae7laldeeatd51lootpre1beics0ngyn81dkl04qa9l5lreeceh6', 'show', '<p><br>I come from a domain where felony ride us like calvary&nbsp;<br>We become docile to his savagery<br>because if we don\'t, we become prey to his malignant treaty.&nbsp;<br>.&nbsp;<br>Though the sun watches what I do but the moon knows all my secret.&nbsp;<br>.&nbsp;<br>Many times we transform to synopsis of daylight&nbsp;<br>Illuminating stretches of throbbing rays&nbsp;<br>&amp; our body is weary of carrying its burdens.&nbsp;<br>.<br>We are getting tired of hackneyed headlines that keep popping in the morning daily times. &nbsp;<br>-A Pastor abducts self asking for ransoms<br>-Dead bodies found in the house of a furtive Islamic scholar<br>-the devastating wrath of street urchins&nbsp;<br>-relatives thrusting each other with bayonet of deceit<br>&amp; other foul headlines polluting our serenity.&nbsp;<br>.&nbsp;<br>Maybe in the solitude of a nautical dusk<br>We will pour out our heart in prayer sessions, whispering our deeds to darkness in silences &nbsp;- the fear in us reminds the uttering of the clamorous frog,&nbsp;<br>we ain\'t animals, secrets should be harbored.&nbsp;<br>.&nbsp;<br>The Sun\'s light has been veiled&nbsp;<br>by gloomy cloud of obscurity &nbsp;.&nbsp;<br>He watches all our bad deeds with &nbsp;his wistful gleaming radiance.&nbsp;<br>Moon has done much<br>knowing about all our dirty act but still retain it calmness.&nbsp;<br>.&nbsp;<br>I wonder who can best reveal the reigning evils&nbsp;<br>even when the sun watches what we do &amp; the moon knows all our secret</p>', 'uploads/15605019182978533IMG_20190614_WA0004.jpg', '1560499238919gltn63o60c5da5reeel3ui', '08:45:20', '2019-06-14', '15605019200a18rkcld5948tia34e0r', 'thumb/1560501918146007IMG_20190614_WA0004.jpg', 1),
(113, 'I Found A Solace (Day 4 of 10)', 'Lewis Wamwanda', '1559751824300twhsaocetip8dai3enners8lw1myawadre85yac5gal11lel', 'show', '<p>I remember days ago, those doomed days<br>When depression was a reflection of my soul<br>And my eyes were painted black<br>And my face of winkled skin<br>And I sit down and smile,</p><p>I found solace somewhere<br>And I\'m not selfish either, not at all<br>To share this mutual understanding<br>And the discovery of self happiness<br>That won\'t begotten anywhere<br>But from the solace within</p><p>My happiness comes from self acceptance<br>Of no denial of the bitter black past<br>But the embracement of my old self<br>And learning from the bitter thorns<br>Of life, of love, of pain, of torture<br>And re-writing of the better me</p><p>I found a solace within me<br>And accepted that at times I\'m wrong<br>Not worth it at all, and pain will be part of me<br>I found my solace<br>To dust off the dust in my eyes<br>And sweep the webs of fear and sorrow</p><p>The secret of happiness<br>Told by my inner self, my solace<br>To accept my mistakes, my pains<br>To forgive, to move on, and love<br>\"Depression is an illness\", He said<br>\"And you are the only doctor,<br>Choose Between happiness and sorrow\"</p><p>*Ã‚Â©Lewis Wamwanda*</p>', 'uploads/15605029145425383IMG_20190614_WA0006.jpg', '1560499238919gltn63o60c5da5reeel3ui', '09:01:56', '2019-06-14', '156050291689irt89cli62ea5711', 'thumb/15605029144018931IMG_20190614_WA0006.jpg', 1),
(114, 'THE GLORIOUS DAY (Day 4 of 10)', 'OLUWOLE OLUWATOBI SOLOMON', '15600993580oonbacye1gtousayoa4lnrelr01cioo4t6slolue0w0plltold7ewmai9he1', 'show', '<p>Every damsel thinks of a day<br>A day of earnest expectation of dreams&nbsp;<br>But not all ladies will have this day<br>Why? Temperance of ladies varies<br>Many have ruined the beauty of the deal day.</p><p><br>Though you\'re beautiful<br>Men run after you like money<br>Chasing the petal of your glory<br>To suck and dump like a bee does to flowers<br>How long will your glory be choked?<br>Men know what is pleasurable<br>For how long will they eat your egg and throw away your shell?<br>Think about it!</p><p><br>The glorious day<br>It\'s for the reserved ladies<br>Who have kept their glories<br>For that glorious day,<br>Those who do not depend on ephemeral things&nbsp;<br>Who have not spoilt themselves<br>With the evanescent enjoyments<br>The glorious day awaits them all!<br>Are you among the ladies<br>Who their doors are intact for that day?</p>', 'uploads/15605055305651585IMG_20190614_WA0008.jpg', '1560499238919gltn63o60c5da5reeel3ui', '09:45:31', '2019-06-14', '1560505531ar31hc7t82leei81t187', 'thumb/15605055309430555IMG_20190614_WA0008.jpg', 1),
(115, 'HOW LONG  (DAY 4 of 10)', 'MR\'TINO', '1560163509coadedep0lrecaramea3h2eiab1e3dn4l27siy28ejyougmltayi5yat1', 'show', '<p><br>Yes, how long&nbsp;<br>How long will we survived a weather<br>Which it\'s day breaks from cloudy&nbsp;<br>And it\'s <a href=\"https://web.facebook.com/boardspeck/inbox/?mailbox_id=606459533049827&amp;selected_item_id=100004233512570#\">sun</a> blemishes skin&nbsp;<br><br>How long we will endurance&nbsp;<br>The day that it\'s night romances <a href=\"https://web.facebook.com/boardspeck/inbox/?mailbox_id=606459533049827&amp;selected_item_id=100004233512570#\">sun</a> like a couple and neglected moon&nbsp;<br><br>How long will that dream waked from a snoring sleep&nbsp;<br>And meet on dawn\'s palm&nbsp;<br>As a day break&nbsp;<br><br>How long will&nbsp;<br>A game of hide and seek end<br>Like a childish play, conspicuous in a kingdom&nbsp;<br><br>How long will<br>Crys and morns linger on throats<br>Of inferior\'s people like infant thrives for milk&nbsp;<br><br>How long will<br>Darkness bleaching reflection of lights away often as black&nbsp;<br><br>How long&nbsp;<br>will upper rims fell on lower&nbsp;<br>Like a one eye-king&nbsp;<br>ruling a kingdom of blinds&nbsp;<br><br>How long&nbsp;<br>Will suffering and smiling plated kisses on lips of orphans<br><br>How long&nbsp;<br>Will rippers suck the innocent bloods and drunk as wine&nbsp;<br><br>How long&nbsp;<br>Will the legs staggering&nbsp;<br>As rising and falling&nbsp;<br><br>Oh! Dear Africa mother<br>Your children are groaning and mourning<br>Because;<br>Your dangling breasts is cease<br>Your beautiful flowing and extravagant milk is ambushed by betrayals<br><br>Oh! Mother of Africa safe your kids&nbsp;<br>Your mercy is necessary&nbsp;<br><br>Ã‚Â© MR\'TINO THE LOVER BOY</p>', 'uploads/15605348243748232slave.jpg', 'j90819542aBn72i', '17:53:47', '2019-06-14', '1560534827iw977l83th167ecor5a', 'thumb/15605348249104354slave.jpg', 1),
(116, 'A PAINFUL SPHERICAL  (DAY 4 of 10)', 'Asika Victor', '1560102058ce2hcod0l31iel77inotya83tay600escgiarvrskret4plaa', 'show', '<p>In this spherical&nbsp;<br>do you call me your enemy &nbsp;<br>Just because of my colour&nbsp;<br>molding endless melancholy&nbsp;<br><br>In this spherical&nbsp;<br>do you call me loathsome&nbsp;<br>Just because your believe &nbsp;<br>sees mine as vile&nbsp;<br><br>In this spherical &nbsp;<br>do you forgot the good in me&nbsp;<br>For your believe said that&nbsp;<br>there is no good in me&nbsp;<br><br>In this spherical&nbsp;<br>do you see me as disgusting&nbsp;<br>Just because of the place i\'m from,&nbsp;<br>isn\'t same as yours&nbsp;<br><br>Why the killing, just for power&nbsp;<br>Why hurting me because of my colour &nbsp;<br>Why am i disgusting to you,&nbsp;<br>in this spherical&nbsp;<br><br>This spherical is just a market&nbsp;<br>All will come and sale and go&nbsp;<br>Why not sale yours, i mine&nbsp;<br><br>In this spherical &nbsp;<br>after our sales, we all will return home&nbsp;<br>Why then the hatred, &nbsp;<br>hatred of what is not yours&nbsp;<br>Hatred of what has been before you&nbsp;<br>And will be after you &nbsp;<br><br>Tell me why the struggle for power &nbsp;<br>Why the killing and why the hate&nbsp;<br>Why the sorrow and why the pain&nbsp;<br>Why do will drive pleasure in hurting one another&nbsp;<br><br>Day in, day out&nbsp;<br>We fight in this spherical&nbsp;<br>Just for the selfishness&nbsp;<br>which we won\'t leave with&nbsp;<br>For is of the earth and of the earth will it remain &nbsp;<br><br>Why allowing our tongue &nbsp;<br>that is ment for blissfulness,&nbsp;<br>to be giving sorrowfulness&nbsp;<br>Our tongue that is ment for optimism&nbsp;<br>to be giving pessimism&nbsp;<br><br>Day in, day out&nbsp;<br>One is faced with enough disaster&nbsp;<br>you don\'t need to add more pain to it&nbsp;<br><br>Every day do one draw closer &nbsp;<br>to one\'s mother earth share&nbsp;<br>Tears showing its greatness in this spherical&nbsp;<br><br>Why not we put an end to this nemesis&nbsp;<br>Why not we share love, peace and bliss&nbsp;<br>And not war, melancholy and tears&nbsp;<br>Why not accept one for his foolishness&nbsp;<br>For that called foolishness brings peace&nbsp;<br><br>In this rigorous world&nbsp;<br>One deserve not more pain&nbsp;<br>For being in it is enough pain to bear&nbsp;<br>add no more pain, rather help easing some</p>', 'uploads/15605350766339119asika.jpg', 'j90819542aBn72i', '17:57:57', '2019-06-14', '1560535077r424l531c9e3iaa5t9', 'thumb/15605350768862917asika.jpg', 1),
(117, 'GRIM REAPER  (DAY 4 of 10)', 'Paciolo Pen Saint', '156018203445nt0aiss3nclhny6ceteo9gtraoa6e9a4lipi7ee1playorplc7d', 'show', '<p>When everything looks so cool<br>Like the balmy weather.<br>Love singing like cuckoo<br>Sweet and melodious.<br>Love shines like daffodils in bloom,<br>Home sweet home.<br><br>A blot will suddenly come from the blue,<br>In the cimmerian darkness&nbsp;<br>Will be an old man who shall scythe<br>Through hearts<br>Making mourns govern days.<br><br><strong>Paciolo Pen Saint</strong></p>', 'uploads/15605351993033428paci.jpg', 'j90819542aBn72i', '18:00:00', '2019-06-14', '15605352003r8lmat12gii542c3r8e8', 'thumb/15605351999262545paci.jpg', 1),
(118, 'Make Hay while the sun shine  (DAY 4 of 10)', 'Abdulrahman Soliu', '15601820100bly1ulmorenaer8alita11yepo4sru32i78sltae0c5hnagcdldha', 'show', '<p>Make hay the sun shall shine&nbsp;<br>For \'t the end will justify your means&nbsp;<br>For thee, your star shall shine&nbsp;<br>Like the glimpses of the moon when mix. &nbsp;<br><br>Make hay the sun shall shine &nbsp;<br>For \'t your frame shall rise&nbsp;<br>And thee, &nbsp;your glory shall waxe with shine &nbsp;<br>Like the squawk of an ice&nbsp;<br>At the side of an herring pond. &nbsp;<br><br>Make hay the sun shall shine &nbsp;<br>Then, your great enemy will run after your fame&nbsp;<br>And it shall illume their rile&nbsp;<br>But later look at you inside their frame. &nbsp;<br><br>Make hay the sun shall perch&nbsp;<br>And the moon shall gather to hear your tale&nbsp;<br>About how you sow before you reap in pack&nbsp;<br>That made you to be fortune in sale.</p>', 'uploads/1560535406114231abd.jpg', 'j90819542aBn72i', '18:03:28', '2019-06-14', '15605354084i4ee266mk8l11c46rtaa', 'thumb/15605354066378307abd.jpg', 1),
(120, 'The journey (Series 2)  (DAY 4 of 10)', 'HOLUWAKHARYORDAE TAIWO', '1560102926ra12hacel1ngpraalad6wodtieyaorulcaio67ee37yokl0stw90h5teryh', 'show', '<p>I wandered dark and thick jungles&nbsp;<br>Thorns prickled my foot,i stumbled&nbsp;<br>Out of food made my stomach grumbled&nbsp;<br>With my eyeglasses still on i saw double&nbsp;<br><br>Howl of wolves made my heart trembled&nbsp;<br>I held tight a bag loaded with pebbles&nbsp;<br>Walked with a singing stomach,&nbsp;<br>While i watched out for monstrous bullocks&nbsp;<br><br>Ancestors are you all sleeping?&nbsp;<br>Don\'t you see how hard I\'m weeping&nbsp;<br>amidst life devastator? &nbsp;<br>like a prey, i walks toward life\'s predators&nbsp;<br><br>Days walk with nights&nbsp;<br>Months sails in ocean of time &nbsp;<br>Seconds dance with minutes&nbsp;<br>I\'m stuck with this bittersweet Pinot.&nbsp;<br><br>Thought of my street massive deli&nbsp;<br>Lingered as hunger beats my belly &nbsp;<br>Hunger howled at me like a angry wolf &nbsp;<br>Spilt couldn\'t wet my dried throat. &nbsp;<br><br>Oh, will I conquer &nbsp;this war?&nbsp;<br>Even if I win,will I be reward? &nbsp;<br>Will I ever see my love ones again? &nbsp;<br>What if this carnivorous animals end my reign&nbsp;<br>Will you ever remember to tell my tale? &nbsp;<br><br>I wasn\'t aware life\'s a journey&nbsp;<br>Abruptly I sauntered in&nbsp;<br>Now I\'m stuck with pain\'s and anguish&nbsp;<br>Like a Warfield,my hopes was ambushed&nbsp;<br>Tattered to tiny shreds,&nbsp;<br>Left for me to unscramble&nbsp;<br><br>I\'m lost in a strange and scary &nbsp;island&nbsp;<br>though i was told beforehand&nbsp;<br>wish I had hearken to papa\'s sermons &nbsp;<br>I guess, &nbsp;<br>My life won\'t be shake up by life demons. &nbsp;<br><br>Iamteazhy</p>', 'uploads/15605452808866248hello.jpg', 'j90819542aBn72i', '20:48:01', '2019-06-14', '1560545281058ti18elthca6e6r655', 'thumb/15605452805007764hello.jpg', 1),
(121, 'The earth (Day 4 of 10)', 'Johnson Victor Oluwatobi', '1559751638oio1dr3ectan2lcjanipatarsot0te673weveyy7clsogu8roohnbh8i5ll7', 'show', '<p>&nbsp;</p><p>The earth is the god of all god\'s&nbsp;<br>Stronger than Hercules, better than Venus<br>With his long arms, that he use to shield his own.</p><p>The earth is the first Adam,<br>A river without a source,<br>Word are proclaimed by the sovereign&nbsp;<br>But the earth is the surface where word raptured into a man.</p><p>The earth is the heart of Art,<br>Where men are swallowed and Babies are left to soar<br>He makes Methuselah a poor brat, and Enoch a Mogul.</p><p>The Golf of all gold<br>Brownish surface of white petals,<br>Some say he is a golden ball,<br>While some says he had a flat tummy ,<br>But None ever says that he didn\'t have a mouth<br>But he keep collecting red oil, and yam tuber.</p><p>The earth is the Ancient witch&nbsp;<br>Many prophet have prophecy about sunrise and sunset&nbsp;<br>But the earth never rise in the east nor set in the west<br>Nor grow grey hair, Nor taste death.</p><p>The earth is the vast clown<br>That nourish beautiful flowers for the butterfly&nbsp;<br>And keep chasing men to the deep side of art,<br>Where Knowledge defines wealth.</p><p>The earth is a virgin slut.<br>Either in a golden coffin or in grey ashes<br>Rugged or nugget, Buttered or Bread,<br>All Adam and Eve shall kiss her on the forehead.</p>', 'uploads/15605503904296127IMG_20190614_WA0014.jpg', '1560499238919gltn63o60c5da5reeel3ui', '22:13:11', '2019-06-14', '156055039132l8eh3c2r5a7t0ie1t', 'thumb/15605503906041524IMG_20190614_WA0014.jpg', 1),
(123, 'Say No To Our Bondage (Day 5 of 10)', 'Abdulrahman Soliu', '15601820100bly1ulmorenaer8alita11yepo4sru32i78sltae0c5hnagcdldha', 'show', '<p>&nbsp;</p><p>Free us from the springe of evil<br>Its palpable that we mostly spent all our night with the devil<br>To forbear with the groans we we\'re feeling<br>Think not, our silence willtnever sit drooping.</p><p>The heaven Is tired of our whine<br>The cry of the moon has filled our hearts porthole&nbsp;<br>And our heart can\'t bear this, even with wine<br>That all those devil bought to replace our heart hole.</p><p>We had tired of this rebus&nbsp;<br>Our blood is unable to control our emotions<br>For the grievances that we can\'t tied and &nbsp;refused<br>nor the one we we\'re perceiving from our relations.</p><p>The earth is fuming pugnaciously<br>When it heard of their sinister<br>And those heaven lamp grieved loudly&nbsp;<br>To say no to our bondage from those gangstars.</p>', 'uploads/15605670029170804FB_IMG_15605668581282404.jpg', '1560499238919gltn63o60c5da5reeel3ui', '02:50:03', '2019-06-15', '1560567003691sa03ry27cae4i3tl0', 'thumb/15605670027121749FB_IMG_15605668581282404.jpg', 1),
(124, 'THE DEPRESSED\'S COWARD POET (Day 5 of 10)', 'Adeyemi Jamiu Adebayo', '1560163509coadedep0lrecaramea3h2eiab1e3dn4l27siy28ejyougmltayi5yat1', 'show', '<p>&nbsp;</p><p>Dear fellow Bards !!!<br>If morrow raised behind me&nbsp;<br>I plead&nbsp;<br>wove me a beautiful dirge&nbsp;<br>To paint me a pretty goodbye<br>Like a thin air &nbsp;<br>That evoperated amidst of wind<br>Don\'t wave tears but smiles&nbsp;<br>Don\'t mourn but cheerful</p><p>Where were those olden flies hidden&nbsp;<br>Can it be beneath soil or&nbsp;<br>Above that blue sky&nbsp;<br>Or faded away like flames<br>Let me grip one to questioned about their ways</p><p>Tonight\'s moon shall wrapped my tales in tissue paper&nbsp;<br>To utter the letters to ancestors</p><p>Tonight\' those stars shall sparkled on a beautiful grass&nbsp;<br>To lighten darkness of night and pave away as a smoke</p><p>Life showed it darkness part&nbsp;<br>And sucked me amidst of groans,<br>Shall i pick up a call of my ancestors&nbsp;<br>Suicide seems as bravery&nbsp;<br>Should i dare it cold hand&nbsp;<br>Or embrace it wide arms</p><p>Seeming is believing !<br>Whom tell tales of heaven and hell?<br>Is heaven beautiful?&nbsp;<br>Is hell ugly, as we were told ?<br>Let me satisfy to witnesses both<br>So i can bring records of both</p><p>Suicide is not an optional<br>But a cowardly and untapulate rhymic of life</p><p>&nbsp;</p>', 'uploads/156056862236894FB_IMG_15605670548449019.jpg', '1560499238919gltn63o60c5da5reeel3ui', '03:17:04', '2019-06-15', '1560568624lar5159tie8t9h369c0e', 'thumb/15605686228371762FB_IMG_15605670548449019.jpg', 1),
(126, 'THE WORLD I FIND MYSELF IN (Day 5 of 10)', 'Paciolo Pen Saint', '156018203445nt0aiss3nclhny6ceteo9gtraoa6e9a4lipi7ee1playorplc7d', 'show', '<p>&nbsp;</p><p>Bed of broken dreams not a rich inn,&nbsp;<br>Restless sea, &nbsp;fishes without fins<br>An examination hall, &nbsp;cheaters yet to be seen,&nbsp;<br>An empty stomach worms compose lean<br>Full of foxes, &nbsp;hopes can\'t be on pin</p><p>&nbsp;</p>', 'uploads/1560568977444163FB_IMG_15605686262718934.jpg', '1560499238919gltn63o60c5da5reeel3ui', '03:22:58', '2019-06-15', '1560568978t1e2ch78r582eia37tl', 'thumb/15605689776728907FB_IMG_15605686262718934.jpg', 1),
(127, 'THE DRUNKARDS (Day 5  of 10)', 'OLUWOLE OLUWATOBI SOLOMON', '15600993580oonbacye1gtousayoa4lnrelr01cioo4t6slolue0w0plltold7ewmai9he1', 'show', '<p>&nbsp;</p><p><br>Honour to all lovers of alcohol,<br>Who can drink the whole brewery dry<br>You\'re celebrated celebrities of contempt<br>I do not come to castigate nor condemn you all<br>You\'re at liberty to live your lives as you want,<br>What heaven lays ambush in alcohol?</p><p><br>Like a vulture you stagger on streets,<br>Saying some silly statements on the road,<br>Competing with vehicles<br>Saying you drink to eradicate your sorrow,<br>If you\'re done of the intoxication,<br>Won\'t you remember your calamities any longer?</p><p><br>Can\'t you be liberated from the daily shame<br>Which you cause to your households<br>You drink to stupor and instigate sorrow&nbsp;<br>In your wives\' hearts,<br>They pack your vomit,<br>You still molest them.</p><p>Dear drunkards, dream the day to stop this act<br>No one can stop you from this &nbsp;act<br>Let the spirit of responsibility allay the act<br>Make your wives, children and people happy<br>Do you know that you can attain something spectacular<br>From the money you use to consume alcoholic drinks?<br>May God help you all out of the bondage of drunkenness.<br>I care for you all drunkards!</p><p>&nbsp;</p>', 'uploads/15605799016455928IMG_20190615_WA0002.jpg', '1560499238919gltn63o60c5da5reeel3ui', '06:25:03', '2019-06-15', '1560579903ctt7earhe8257l3i9825', 'thumb/15605799014044617IMG_20190615_WA0002.jpg', 1),
(128, 'Then I Became This (Day 5 of 10)', 'Botefarm', '1560163828tmootcc7aeet9eab10ld9p7hgyie0lf2nl1ye2rar5rsa', 'show', '<p>Told you, blood runs deep Deranged, &nbsp;called names &nbsp;A looser, &nbsp;frail, &nbsp;weak, &nbsp;maimed &nbsp;Today, &nbsp;among mankind, mark the day.&nbsp;</p><p>...&nbsp;</p><p>Fault not mine, brutal &nbsp;past A scourged &nbsp;mom, &nbsp;abusive dad Evil became &nbsp;good, usual, consistent Watched it all, watched &nbsp;mom death.&nbsp;</p><p>...&nbsp;</p><p>Couldn\'t take it, &nbsp;disturbed &nbsp;Crazy, &nbsp;mad, &nbsp;troubled &nbsp;No one near I could share plight &nbsp;No family cuddle &nbsp;at sight.&nbsp;</p><p>...&nbsp;</p><p>And now this thing in me breeds Grows each day with horror &nbsp;Kill, &nbsp;maim, &nbsp;disemboweled, &nbsp;gag I\'ve learnt &nbsp;the devil\'s &nbsp;creed.</p>', 'uploads/15605857281846117Screenshot_20190615_084838.png', '1560499238919gltn63o60c5da5reeel3ui', '08:02:09', '2019-06-15', '1560585729chet59e102rn7tl41ia79', 'thumb/15605857281833614Screenshot_20190615_084838.png', 1),
(129, 'I AM A PROUD ALBINO (Day 5 of 10)', 'Lewis Wamwanda', '1559751824300twhsaocetip8dai3enners8lw1myawadre85yac5gal11lel', 'show', '<p>Neither black nor white Somewhere in between But I am Me, The proud self of my version &nbsp;I am just like you Born from a woman, With same strength and weakness The same fears and courage &nbsp;</p><p>My wants of life, &nbsp;Of love and equality Strengthens my will to stand And say I am human &nbsp;</p><p>I am a proud Albino Speaking for the voiceless Fighting for my presence And life of acceptance</p>', 'uploads/15605859535969844IMG_20190615_WA0004.jpg', '1560499238919gltn63o60c5da5reeel3ui', '08:05:55', '2019-06-15', '1560585955795e85i1cilr914t5a', 'thumb/15605859538635960IMG_20190615_WA0004.jpg', 1),
(130, 'Can\'t Let Go (Day 5 of 10)', 'Georgette Kendra Mbale', '1559751687aeytcets5teded9e0blg3g21emn1aehyaireel1po8nrglol1tr9ckra6a', 'show', '<p>The blazing fire glows red on this mountain side Not the shadows I see in this dark. I\'m a queen in isolation I\'m the ghost that haunts my soul. &nbsp;</p><p>The wind keeps blowing Like a hurricane swirling inside. I couldn\'t separate darkness from light Nor the sorrow from my smiles. How do I face the world without your hand to hold? &nbsp;</p><p>Nothing hurts more than losing a piece of yourself. Consciously losing your sanity and dignity. The mental torture of never seeing you again. Paying the price for a crime I know not. &nbsp;</p><p>I was taught how to live with you But not without you. And now its me at the worst of it all. &nbsp;</p><p>They have no foggiest notion what I go through They\'ve seen and heard what i go through But only through the spying glass And only through deaf ears. &nbsp;</p><p>When they see the tear marks on my face Sorrow in my eyes,quake in my voice They say I\'m depressed But I\'m just mourning my loss They know not why I cry.&nbsp;</p><p>&nbsp;I just can\'t Let go off the memories Yet they haunt me like nightmares But I still hold on to them like a fantasy Coz you and I were my favourite fairytale story And I just can\'t let go.</p>', 'uploads/15605864044927670IMG_20190615_WA0005.jpg', '1560499238919gltn63o60c5da5reeel3ui', '08:13:25', '2019-06-15', '1560586405ta386ln6i4tarc64c84e3', 'thumb/15605864047625533IMG_20190615_WA0005.jpg', 1),
(131, 'MUSIC AND ME (Day 5 of 10)', 'Ogomigo Roland', '1559751748hsgdoca97gl7yt3yeli4re1ratolpe0n5gea8do7lr8iaomcn2o', 'show', '<p>&nbsp;</p><p>When I wake up in the morning. The first thing I do is to plug in my earpiece to my ears so I can listen to my collection of Michael Jackson\'s songs and other foreign great songs.</p><p>Without music, my day isn\'t well spent. It gets me on that right mental attitude filled with optimism.</p><p>Music is like a pet to me. We are so close that I go to bed with it.</p><p>Sometimes I also listen to the radio to get it\'s wonderful services.</p><p>Do you know good music reliefs you from worries and things you couldn\'t avoid.</p><p>You know neighbors and their usual criticisms within earshot. Well, my music shields me from their verbal abuse.</p><p>I listen to it at home and extra careful when going out.</p><p>Instead of feeling acrimonious towards your neighbors or strangers about their awful opinions of you. You can ignore that drama and live like a normal human being.</p><p>That\'s how I deal with everyday bullshits from relentless hurters.</p><p>You can try my strategy too.</p><p>Do you think music is the remedy to avoid troubles?</p><p>Please drop your comments so I can get your feedback.</p><p>&nbsp;</p>', 'uploads/15605945694000229IMG_20190615_WA0007.jpg', '1560499238919gltn63o60c5da5reeel3ui', '10:29:31', '2019-06-15', '1560594571ei56st5um0l36c96i2c2ra', 'thumb/15605945692038600IMG_20190615_WA0007.jpg', 1),
(132, 'AT THE CROSS (Day 5 of 10)', 'Chhote', '15601637908ypeccotrs6edlncey9e512t28rlotahaial0hgh051e', 'show', '<p><br>Whipped,<br>Spat at<br>Dragged in the streets while dressed in rags like a lost cat.<br>Nelson Mandela took the long walk to freedom but,<br>He took the long walk of shame,<br>The long walk to pain,<br>Covered in blood,<br>Bruised,hurt,and abused.</p><p>Whip him!!whip him more!<br>They shouted and cheered,<br>Clapped while he bled and wept<br>His soft textured skin tattooed with lashes,<br>His back engraved with insults,<br>Head clothed in thorns.</p><p>More!more!more they exclaimed as the long nails pierced his hands,<br>Blood oozing from the fresh wounds,<br>Gasping for air each time he was striked.<br>And up,high on the cross he was raised,&nbsp;<br>left to die as a slave.<br>Father forgive them for they do not know what they do!</p><p>And just like that I was made new.<br>In his blood I am washed,<br>No longer codermed to die,<br>Out of the heavy chains and burdens,<br>No longer have to kill to sacrifice,<br>No longer have to wander coz,<br>He paid it all.</p><p>Come unto me all those who are heavy laden and I will give you rest.<br>Because of the cross,pray and I will answer,<br>Call and I will respond,<br>Knock and I shall open.<br>Dear child come seat at my feet because,<br>At the cross is where you will find it all.<br>#CHHOTE_THEE_POET</p>', 'uploads/15605966403611940IMG_20190615_WA0008.jpg', '1560499238919gltn63o60c5da5reeel3ui', '11:04:02', '2019-06-15', '15605966427i25lta4c8a231tre2', 'thumb/15605966403941513IMG_20190615_WA0008.jpg', 1),
(133, 'MASSAGE TO THE MOON AND STARS (Day 5 of 10)', 'Asika Victor', '1560102058ce2hcod0l31iel77inotya83tay600escgiarvrskret4plaa', 'show', '<p><br>My name I told you<br>but that song I wish not to sing<br>But for you, for the last time I\'ll sing<br>Yes I will for you</p><p>Here I am to write not to sing<br>To write of sadness not blissfulness<br>But here I am singing for joy not to come<br>singing for the moon and not the stars</p><p>Here I am writing elegy that\'s high<br>An elegy for the moon not the stars<br>Take this massage up above the sky<br>Tell the moon and stars,&nbsp;<br>that I am sorry for the scars</p><p>Don\'t thank me for my kindness,<br>for the beauty of the night is no more<br>Don\'t talk of my foolishness<br>for the shinning stars is no more</p><p>Search not in the sea<br>for the fish I wish to see has gone<br>Search not in my P\'s and Q\'s<br>for those words sounds like gun</p><p>The moon has taken a French leave<br>And the stars has left me in lunch all alone<br>Deep your hand inside the heart&nbsp;<br>for the golden cold heart is hurt</p><p>I don\'t have any IF\'s and BUT\'s<br>for there is no right in wrong<br>But still there is no harm to beg<br>So please tall the moon and the stars&nbsp;<br>that i am sorry for the scars</p>', 'uploads/15605971919916946FB_IMG_15605968200290553.jpg', '1560499238919gltn63o60c5da5reeel3ui', '11:13:12', '2019-06-15', '1560597192a4cmaaeg66r76s52i0t64lse', 'thumb/15605971919193346FB_IMG_15605968200290553.jpg', 1),
(137, 'Occultism (Day 5 of 10)', 'Bello Sodeeq Adekunle', '1560163948uyoesae7laldeeatd51lootpre1beics0ngyn81dkl04qa9l5lreeceh6', 'show', '<p><br>When I was a toddler&nbsp;<br>Lingering to mother\'s plumage<br>clasping its warmth, we thought that I will never be spike by the cold rattan of this occult realm.&nbsp;<br>.&nbsp;<br>I hear &amp; see many harms but can\'t recognize one.&nbsp;<br>.&nbsp;<br>In this phase of life, our thoughts are embryos - immature &amp; immaculate. &nbsp;<br>We believe what we only see because we\'re too ignorant to know life is a two-edged tool:<br>- of transparency<br>- &amp; of obscurity.&nbsp;<br>.&nbsp;<br>whenever my neighbors turn to gadgets, buzzing unconforming yell.&nbsp;<br>they say it was just our cultural way of saying goodbye&nbsp;<br>I opined it was for those embarking on distant journey - deep &amp; lengthy,&nbsp;<br>because several times I\'ve pat my &nbsp;uncle with goodbyes without my face turning to a battlefield where &nbsp;only tears fall.&nbsp;<br>.&nbsp;<br>then my sense is eclipsed - overshadowed with cloud of mellifluous deceit.<br>but growing up, I knew life is an enigmatic element beyond physical forces.&nbsp;<br>.&nbsp;<br>A woman gloat on an impish child &amp; drain his blood with mere eyes.&nbsp;<br>Sister, in reverie, have the marriage of the year, still nobody has ever woo her<br>brother scream from his dream &amp; become dumb waking up.&nbsp;<br>What of the man that set house ablaze with ordinary words.&nbsp;<br>Someone said she was famished but reject everything offered to her - she needs human flesh &amp; blood.&nbsp;<br>.&nbsp;<br>This is a world of spiritualism<br>.&nbsp;<br>Holiness is what we clamor&nbsp;<br>but not all that preaches it were holy.&nbsp;<br>So many things exist but not to be &nbsp; decipher by all<br>That\'s why we believe only in seeing &amp; not all we hear.</p><p>&nbsp;</p>', 'uploads/15606262252470253IMG_20190615_WA0026.jpg', '1560499238919gltn63o60c5da5reeel3ui', '19:17:06', '2019-06-15', '156062622601ie97cai2m8l3rs2c1colttu2', 'thumb/15606262251788310IMG_20190615_WA0026.jpg', 1),
(140, 'TRUST ( Day 5 of 10)', 'Ariyo Ahmad', '15602440698dah92am6al40doactaroyyrg3ina7else5ie1yrh8ct0elp', 'show', '<p>&nbsp;</p><p>In connection with the tunnel of my mind.<br>Scarcely have I found that sensational moment.<br>To grip myself on hold<br>Against the word TRUST that pricks the inner most part of me.<br>And render it turgid to withstand the sweet promises calved into rotten mouth.</p><p>It trembles my heart at this fading hour of man into dust.<br>In the dungeon of that moment man wants rain.<br>He would beg the sun, the moon and the stars.<br>Please TRUST Me !?</p><p><br>He would build the porthole house of trust in the mind of his trustee.<br>With staggering block of trust.<br>Like a table with no stand<br>And a house devoid of solid foundation.<br>The fall of which is awaited for,<br>like the fall the fall of a heavy rain after a pregnant cloud.</p><p>&nbsp;</p><p>A friend you can\'t hue your secret in his bowel of thought.<br>And a friend he proudly calls himself.<br>Not knowing that within him lies a living beast.<br>That has burn the hut of trust and turn it into harshes of deceit.<br>He sit his friend on a chair with no stand</p><p><br>In a business worth million of dollars.<br>Two friend both make a nest of money.<br>The expectation that will fetch them fledgling of dollars.<br>The worth of the money became a treason to his big headed eye.<br>And he takes to his heels.<br>He dig a hole for his friend trust and walked him into ocean of lost.</p><p><br>Many homes have their virginity defiled..<br>For lack of trust has raped them.<br>In the dark corner where selfish desire lures them.</p><p><br>With tears, it highjack my plane of happiness.<br>And bore holes of fear into my sack of trustful heart.<br>For the plane that will shore man to the their destination,<br>Has been highjacked by lack of trust.<br>TRUST ! A lost property of every selfish soul.</p>', 'uploads/156062869257475IMG_20190615_WA0027.jpg', '1560499238919gltn63o60c5da5reeel3ui', '19:58:14', '2019-06-15', '156062869496rtcrea2lu44t1sit5518', 'thumb/15606286929974843IMG_20190615_WA0027.jpg', 1),
(141, 'UNTITLED (Day 6 of 10)', 'Georgette Kendra Mbale', '1559751687aeytcets5teded9e0blg3g21emn1aehyaireel1po8nrglol1tr9ckra6a', 'show', '<p>&nbsp;</p><p>My dearest gorgeous Lady<br>Your beauty now fades;<br>Like nimbus clouds after a rainy day.<br>You\'ve lost you gorgeous and beautiful physique,<br>Like a hill;<br>Whose soil has been washed away by rain.</p><p>The angel that sleeps besides you,<br>Sees not your beauty.<br>So he makes you look scruffy;<br>Like a beggar.<br>He taunts you so much that<br>He locks your goodness in shackles.</p><p>&nbsp;Your hair;<br>Like a ghetto cat\'s fur.<br>Your teeth;<br>Like pearls buried deep in mud.</p><p>The look in your eyes;<br>Shows the burden on your shoulders.<br>Your lovely &nbsp;big round eyes;<br>Carry to light a world of hurt and sorrows.</p><p>The once beautiful confident and courageous girl,<br>The beauty that glowed in the dark.<br>The heart that healed any broken wing,<br>With character that caressed the soul.</p><p>The prestigious golden calf;<br>That lingered in the herdsman\'s kraal.<br>Sent to a garden of roses;<br>Yet found herself in the lions den.</p><p>Princess In distress.<br>Her cries cannot be heard;<br>For her smile hides her agony.</p><p>What does she do?<br>When the angel mocks her<br>Alongside his elf\'s.<br>When the scratched and beaten back;<br>Is the proof of love she\'s shown.<br>When the angel taunts her amidst the horda<br>Trying to make her seem<br>Like the witch she\'s not.</p><p><br>What does she do?<br>When the angel in the white robe;<br>Is the devil with horns.<br>The sorrow in her eyes,<br>The marks on her face,<br>The scars in her back;<br>Are just but a small piece of the puzzle<br>That shapes her life.</p>', 'uploads/15606433539067804Screenshot_20190616_005829.png', '1560499238919gltn63o60c5da5reeel3ui', '00:02:35', '2019-06-16', '1560643355961l46ia05lite5tctu0rend6', 'thumb/15606433537198089Screenshot_20190616_005829.png', 1),
(142, 'Broken into Rough (Day 6 of 10)', 'Johnson Victor Oluwatobi', '1559751638oio1dr3ectan2lcjanipatarsot0te673weveyy7clsogu8roohnbh8i5ll7', 'show', '<p>&nbsp;</p><p>Eve is pregnant again,<br>But the babies are not for father Adam<br>They are the seed of the serpent&nbsp;<br>Wallowing in our solemn breathe .</p><p>The truth is a women<br>Broken into rough pieces,<br>By men that dares the lie to his face<br>But none ever survive.</p><p>Thou the serpent is gone but his venom do stings,<br>All men have Taste from the seed of darkness&nbsp;<br>And it\'s sweeter than Enoch dream,<br>We are born to be bad.</p><p>Good tree also nurture bad bird,<br>While poison can also be found amidst sweet wine<br>But what shall it profit a man,&nbsp;<br>To eat the Apple and lost his rationale</p>', 'uploads/15606435182000652IMG_20190616_WA0004.jpg', '1560499238919gltn63o60c5da5reeel3ui', '00:05:19', '2019-06-16', '156064351960e4t7ci54ok6866barrnel', 'thumb/15606435184313617IMG_20190616_WA0004.jpg', 1),
(143, 'BULLET OF LOVE (Day 6 of 10)', 'OLUWOLE OLUWATOBI SOLOMON', '15600993580oonbacye1gtousayoa4lnrelr01cioo4t6slolue0w0plltold7ewmai9he1', 'show', '<p>&nbsp;</p><p>See her caught with the bullet of love<br>Thinking in her- men are unfair<br>Not because I am a sharp shooter<br>But I pamper her until she succumbs</p><p>Her utterance everyday is<br>Your masculine charms can\'t pin me down<br>Praying particular prayers per period daily<br>All because of her love in my heart.</p><p>She can never understand the kind of love<br>Which I have for her<br>She tosses me like dice<br>Saying to me, you can\'t win my heart</p><p>I consulted an elderly man<br>Asking him several questions<br>On how to win a damsel\'s heart in love<br>He said to me, be an upright man and&nbsp;<br>Be caring always<br>I appreciated the old man<br>He willingly wished me well in the journey</p><p>I followed what the man told me to letter<br>I over-pamper her with love and care<br>She studies every of my attitude<br>She is closer to me more than before<br>I use my masculine charm of oratory<br>which is the bullet of love<br>At last, I target the hollow of her heart<br>And I finally trigger my gun<br>She echoes, I\'m caught with the bullet of your love.</p><p>&nbsp;</p>', 'uploads/15606437258627168IMG_20190616_WA0005.jpg', '1560499238919gltn63o60c5da5reeel3ui', '00:08:47', '2019-06-16', '1560643727er3la83t2l8tbe33l3u65ic', 'thumb/15606437252459390IMG_20190616_WA0005.jpg', 1),
(144, 'OH DEATH YOU ARE  LIFE (Day 6 of 10)', 'PACIOLO PEN SAINT', '156018203445nt0aiss3nclhny6ceteo9gtraoa6e9a4lipi7ee1playorplc7d', 'show', '<p>&nbsp;</p><p>fog of pains and griefs<br>Night of agonies<br>Under boring moons<br>over dawn<br>Noons of no shade<br>Under sun burning&nbsp;<br>Eventide of perils<br>Days of sorrow&nbsp;<br>Years of gruesome breathe</p><p>Oh death, &nbsp;you are summoned<br>Halt the pandemonium&nbsp;<br>To rest in a blissful peace</p><p>&nbsp;</p>', 'uploads/15606444864590686FB_IMG_15606440855600753.jpg', '1560499238919gltn63o60c5da5reeel3ui', '00:21:27', '2019-06-16', '1560644487ile2troh5a307c36329', 'thumb/15606444861963295FB_IMG_15606440855600753.jpg', 1),
(145, 'My Better Half (Day 6 of 10)', 'Abdulrahmam Soliu', '15601820100bly1ulmorenaer8alita11yepo4sru32i78sltae0c5hnagcdldha', 'show', '<p>&nbsp;</p><p>You are the reason why the moon giggle<br>Like the smile of the thunder.&nbsp;<br>You make the sun my bower<br>Under the scorching of the brutal sun.</p><p>You\'re the marble who solicit with me&nbsp;<br>To help in building our love with mason&nbsp;<br>Even we enjoy the pleasure together&nbsp;<br>In the amidst of our love as mashocist.</p><p>I would have died in my coldest mood<br>If not God who made you as my wrapper<br>To droop the cold that might catch me to ice<br>And that might jumped our ambition to the land of desert.</p><p>Stay here with me, &nbsp;even if the breeze scatter our emotions&nbsp;<br>And made our heart shivering<br>Like an ice_house in winter<br>For thee I pledge to stay with you forever.</p>', 'uploads/15606448456777582FB_IMG_15606445429671645.jpg', '1560499238919gltn63o60c5da5reeel3ui', '00:27:27', '2019-06-16', '1560644847le55i76y4t5cm5a93r1', 'thumb/15606448456711730FB_IMG_15606445429671645.jpg', 1),
(146, 'DEPRESSION (Day 6 of 10)', 'Adeyemi Jamiu Adebayo', '1560163509coadedep0lrecaramea3h2eiab1e3dn4l27siy28ejyougmltayi5yat1', 'show', '<p>SHE AND I AGAIN</p><p>The weather is colder&nbsp;<br>When she knock on my door<br>My gate has be open&nbsp;<br>The door is moving silently</p><p>She came into my room nauded&nbsp;<br>She seduced me &nbsp;<br>to sexualize her&nbsp;<br>But i refused to</p><p>She romanced me from head to toe&nbsp;<br>She labored to lay her poisonous finger &nbsp;on me&nbsp;<br>How long will she came on my way?<br>Like aide but a slayer&nbsp;<br>How long will she wear mask of helper?<br>But she is a killer</p><p>The floor kept slippery &nbsp;<br>Hope ceased to flourish<br>Temptation griped my heart&nbsp;<br>Lust flippant on my ear<br>Like a bird chirping for prey</p><p>While she romancing me constantly<br>The sky came cool&nbsp;<br>The sun stop smiling<br>My blood stop following<br>My brain got &nbsp;frustrating</p><p>Creatine appeared above expected<br>Releasing muscle and energy in joints&nbsp;<br>I got shocked and awake<br>To focus on actions of my hands&nbsp;<br>Then ,i respond to language of my body as human not to lustful</p><p>Suicide is not bravery<br>Or optional but cowardice,<br>Give life second chance&nbsp;<br>To write you this beautiful words<br>I-SAW-AND-I-CONQUER</p><p>&nbsp;</p>', 'uploads/15606456597474665FB_IMG_15606451547382552.jpg', '1560499238919gltn63o60c5da5reeel3ui', '00:41:00', '2019-06-16', '15606456606rdse88ti0ceia10sln52e1por0', 'thumb/15606456592543345FB_IMG_15606451547382552.jpg', 1),
(147, 'Our Father\'s day (6 of 10)', 'Ariyo Ahmad', '15602440698dah92am6al40doactaroyyrg3ina7else5ie1yrh8ct0elp', 'show', '<p>&nbsp;</p><p>&nbsp;</p><p>They are the rain.<br>showered on the soil of our mother.<br>that conceive our seed.</p><p>While we grow continuously<br>they never seize to shower their care.<br>as rain on our dry crop after growth.<br>Without them our growth,<br>will lack basic nutrients to edible growth</p><p><br>Even if they were unable to come together,<br>by struggling cloud to rain peace on us<br>the irrigation our mother will seek after<br>is still out of their preserved water</p><p><br>The roof we calve ourselves into,<br>for the protection against the roaring thunder&nbsp;<br>and frightening wind<br>that lured us into fear</p><p>The one whose energy,<br>in the first place brought us to existence.<br>Like his effort can\'t be massacred.<br>even if we are to sum up<br>the effort of our dear mother</p><p>&nbsp;</p><p>Like the scotching sun he might be,<br>because he is strict in his features<br>but all is in the process to feed our plant&nbsp;<br>to have enough strength to withstand the turbulent wind<br>and to scare the woeful pest<br>that might hinder our growth</p><p>&nbsp;</p><p>He might be stinkingly rich like ocean of rain<br>And showered on us with his capacity.</p><p><br>Likewise he might be happily poor.<br>but never for once has he<br>out of his empty pocket<br>make us lie on the ground<br>like an helpless soul&nbsp;<br>nor &nbsp;does watch us crawl on the ground<br>to have our clothes tattered<br>but he support us with his hand to make us stand</p><p>&nbsp;</p><p>He is the breadwinner of the family.<br>He guide, he support, he cares,&nbsp;<br>He loves , he work hard to earn his daily bread<br>to spray on us like insecticide and he want to see us living in a healthy state.</p><p><br>To those who still have those who they buoyantly&nbsp;<br>and open their mouth to call Father.<br>Happy Father\'s day&nbsp;<br>and to every soul out their<br>who have in one way or the other,<br>Lost their father in this world of scorching troubles that prevail.</p><p><br>Everyday is Father\'s day</p>', 'uploads/15606834349753462IMG_20190616_WA0010.jpg', '1560499238919gltn63o60c5da5reeel3ui', '11:10:36', '2019-06-16', '1560683436o7a408r4c7ie573tl2ur', 'thumb/15606834346720424IMG_20190616_WA0010.jpg', 1),
(151, 'The Promise (Day 6 of 10)', 'Holuwakharyodea Taiwo', '1560102926ra12hacel1ngpraalad6wodtieyaorulcaio67ee37yokl0stw90h5teryh', 'show', '<p>&nbsp;</p><p>Like an umbrella<br>I\'ll stick by your side<br>I\'ll cover your fragile heart<br>Whenever life dwell tormenting pains</p><p><br>Like a shield<br>I\'ll protect your soul<br>Life is a battlefield<br>I\'ll fight for you like a gladiator</p><p>Life is a predator<br>And you\'re it\'s prey<br>Look unto me<br>Your soul shall be saved</p><p>Life is an ocean<br>It rumbles gigantic waves<br>Paddle with me<br>Together we shall sail</p><p>I\'ll be there to make you giggle<br>Whenever life makes you sad<br>I\'ll be to solace you<br>Whenever life howl at you,<br>Like a hungry wolf.</p><p>You\'re a chick<br>While life is an eagle<br>Like a mother hen<br>I\'ll protect you against all birds</p><p>Cunning lies I\'m nurtured with<br>Promies they Never once fulfill<br>Little did I realise they\'re the predators<br>The thorns amidst beautiful petals</p><p>I\'m thrust with sugarcoating Lips dagger<br>Pushed off the cliffs without a ladder<br>I fell for their sweet promises<br>Little did I know it\'s all a sweet lies.</p>', 'uploads/15606864266814573FB_IMG_15606836538649335.jpg', '1560499238919gltn63o60c5da5reeel3ui', '12:00:27', '2019-06-16', '1560686427e88te31h50itcl7ra675', 'thumb/15606864262762590FB_IMG_15606836538649335.jpg', 1);
