(152, 'God\'s Gift (Day 6 of 10)', 'Asika Victor', '1560102058ce2hcod0l31iel77inotya83tay600escgiarvrskret4plaa', 'show', '<p>&nbsp;</p><p>God gave me an awesome gift<br>Which I admire and inspire<br>They call him dad, i call him god<br>The god from God, a blissful gift</p><p>In ocean of sadness&nbsp;<br>You are my river of cheerfulness<br>In my insufferable foible,<br>You make my foible mournful&nbsp;<br>For me to take corrections</p><p>When I grimace at your gry words,<br>which makes the situations<br>unfavourable, unfashionable, regrettable and deplorable<br>Still you held my hand happily gleefully</p><p>When I\'m over--reach<br>When all hope is like dingy objects<br>When all I give is deaf ear to your gray words<br>Never had you given up on me</p><p>You go necked just to see us covered<br>You go Hungary, to see us eat to stupor<br>You became ugly just to see the beauty of us<br>All sons owes his god a millions of debt<br>god gives pleasure and calms tension<br>They are awesome beyond masaure</p>', 'uploads/15606881448348875FB_IMG_15606877712520062.jpg', '1560499238919gltn63o60c5da5reeel3ui', '12:29:06', '2019-06-16', '15606881465eo9g6657lt7i66acs3dr', 'thumb/15606881442627553FB_IMG_15606877712520062.jpg', 1),
(154, 'Delilah of our time (Day 6 of 10)', 'Bello Sodeeq Adekunle', '1560163948uyoesae7laldeeatd51lootpre1beics0ngyn81dkl04qa9l5lreeceh6', 'show', '<p><br>They say anything delilahs are evil barricaded with sumptuous pleasantness&nbsp;<br>but the veil, we are myopic to see<br>&amp; keep giving a cosy embrace.&nbsp;<br>.&nbsp;<br>Not everything sweet replenish our soul,&nbsp;<br>because things that are appealing make us purge sometimes.&nbsp;<br>then tell me how you will sight beauty &amp; eschew it<br>-the only master that turns brave souls to puppet.&nbsp;<br>.&nbsp;<br>beyond intellect are things that save us from delilahs\' snare.&nbsp;<br>.&nbsp;<br>They are planet with<br>moons hung in their sky of lust,&nbsp;<br>- gloomy moons they were, they only lure us to an opaque realm,&nbsp;<br>where nothing is seen, even when they start imbibing our destiny.&nbsp;<br>how do we separate moons that only illumine darkness.&nbsp;<br>.&nbsp;<br>Supernatural strength of valiant men get nullified at the expense of their mollified hills.&nbsp;<br>Samson solely defeat thousands of armored soldiers.&nbsp;<br>but falls at the feet of Delilah that &nbsp;wield no weapon.&nbsp;<br>.&nbsp;<br>She doesn\'t need one, she is a forge where weapons are made.&nbsp;<br>.&nbsp;<br>Anytime you come across a Delilah.&nbsp;<br>Run for the sake of your future<br>if your present doesn\'t worth catering for.&nbsp;<br>But what will we do when signifying them seems wearisome.</p><p>&nbsp;</p>', 'uploads/15607247791430282IMG_20190616_WA0020.jpg', '1560499238919gltn63o60c5da5reeel3ui', '22:39:40', '2019-06-16', '15607247802ra5e47ih37alie1tdl54l2c', 'thumb/1560724779232240IMG_20190616_WA0020.jpg', 1),
(156, 'STALKER (Day 6 of 10)', 'Ogomigo Roland', '1559751748hsgdoca97gl7yt3yeli4re1ratolpe0n5gea8do7lr8iaomcn2o', 'show', '<p>&nbsp;</p><p>I remember the first time her aura walked past me. It was like a fulfilled fantasy.</p><p>You know that moment when your crush sits near you, and suddenly smiles at you. Your heart will bounce in her illumination.</p><p>I adore her physique and lifestyle. She was more of a model, friendly with people and charismatic.</p><p>Sometimes you wish to cultivate that courage to woo her, but that will sink your heart. So I appeared neutral so her spell won\'t make me silly in the process.</p><p>One fateful Tuesday, we happened to shake hands in an official meeting. Her palms were lenient and hypnotic.</p><p>You know you\'re indebted to love when she whispers to you, \'I know you\'ve been trailing me, shy boy\'. Boy, when I heard this, it was heaven on Earth and hell on Earth.</p><p>I was dumbstruck in her statement and discovery. I didn\'t know what step to take next. I was happy and afraid.</p><p>Maybe my fantasy will nascence reality from her assertion. However, I became more intimidated, but kept my head cool.</p><p>\'Imagine she gets half nude to please you erotically\', this thought invaded my leisure time when I was at home.</p><p>I don\'t think I needed to woo her anymore, besides her statement might represent greenlight.</p><p>I rest my case here. Don\'t let me let the cat out of the bag.</p><p>Please don\'t tell me I\'m shy, I just don\'t feel it necessary to woo her.</p><p>Have you ever experienced this? Please share your experience with me.</p><p>&nbsp;</p>', 'uploads/15607251424496482IMG_20190616_WA0021.jpg', '1560499238919gltn63o60c5da5reeel3ui', '22:45:43', '2019-06-16', '1560725143t59sa55tcl4re2ea6ki70lr', 'thumb/15607251423344522IMG_20190616_WA0021.jpg', 1),
(157, 'DEAR DIARY (Day 6 of 10)', 'CHHOTE', '15601637908ypeccotrs6edlncey9e512t28rlotahaial0hgh051e', 'show', '<p><br>Dear diary,&nbsp;<br>I know its been decades and centuries since I last sat down to write and am sorry.&nbsp;<br>Im sorry I\'ve been too caught up in my doings that I forgot to check up on how you were doing.&nbsp;<br>Do you forgive me?&nbsp;<br>Dear diary,&nbsp;<br>Coming to the issue at hand,&nbsp;<br>Iam carrying heavy and painful feelings engraved on my heart,&nbsp;<br>Disturbing thoughts on my mind that haunt my very existence,&nbsp;<br>I can\'t seem to shake them.&nbsp;<br>Dear diary,&nbsp;<br>Im scared!&nbsp;<br>I don\'t &nbsp;know why but lately I feel &nbsp;like am losing everything and its freaking me out.&nbsp;<br>Am having insecurities over and over again i even fear of going to bed coz I might see myself in a casket next.&nbsp;<br>Dear diary,&nbsp;<br>Have you ever loved soo much that the thought of losing that one drives you nuts?&nbsp;<br>Have you ever loved &nbsp;soo much you can\'t tell right from wrong?&nbsp;<br>Have you ever cared soo much that the thought of separation feels like dozens of needles piercing your heart.&nbsp;<br>Have you ever cared soo much that you think your loved one is better off without you?&nbsp;<br>Dear diary,&nbsp;<br>I\'m lost,&nbsp;<br>I\'m hurt,&nbsp;<br>I\'m desperate,&nbsp;<br>I\'m confused.<br>I wish you could respond and talk back at me but then how can you?. You are just a book I get to inscribe my moments and memories in.&nbsp;<br>Goodnight dear diary,please &nbsp;pray I find my way.&nbsp;<br>&nbsp;</p>', 'uploads/15607253583535859IMG_20190616_WA0022.jpg', '1560499238919gltn63o60c5da5reeel3ui', '22:49:19', '2019-06-16', '1560725359ir0atl543c73355deera4', 'thumb/1560725358457599IMG_20190616_WA0022.jpg', 1),
(158, 'Thieves of mercy (Day 7 of 10)', 'Abdulrahmam Soliu', '15601820100bly1ulmorenaer8alita11yepo4sru32i78sltae0c5hnagcdldha', 'show', '<p>&nbsp;</p><p>They are star that moves not but in sphere,&nbsp;<br>Their gathering shows not but appearance of thieves.&nbsp;<br>Their portfolios were so conjuctive to our life<br>as we couldn\'t by them,&nbsp;<br>But all they show us is their fake smile.</p><p>They are filled up in their pockets<br>Over a strong wind of public opinions.&nbsp;<br>Their eyes has contacted with plague<br>And blind to see other world\'s achievements.&nbsp;<br>Their heart were filled with metals<br>And they commit a treachery as a sin.</p><p>Tell them that earth has tired of our crying&nbsp;<br>And our ears are bleeding with rumour<br>That they are all a beast&nbsp;<br>Appeared in form of normal being.</p><p>People tagged them as annual spender<br>Their kindness ends in a seasoning&nbsp;<br>But I tagged them merciful thieves&nbsp;<br>That comes as raining in a season<br>And spend like a minter of the world money&nbsp;<br>Just to change the peoples heart&nbsp;<br>They were suffering in the rest seasoning.</p>', 'uploads/15607270701195398FB_IMG_15607266589700729.jpg', '1560499238919gltn63o60c5da5reeel3ui', '23:17:52', '2019-06-17', '1560727072t44via94e54tlesr4chi2e6', 'thumb/15607270702704929FB_IMG_15607266589700729.jpg', 1),
(159, 'With You (Day 7 of 10)', 'Paciolo Pen Saint', '156018203445nt0aiss3nclhny6ceteo9gtraoa6e9a4lipi7ee1playorplc7d', 'show', '<p>&nbsp;I want to rise,<br>I want to stand,<br>I want to dream,<br>About you.&nbsp;<br>I want our offspring,<br>I want our future union,<br>I want our death,<br>I want you.</p>', 'uploads/15607281408612852FB_IMG_15607272155047602.jpg', '1560499238919gltn63o60c5da5reeel3ui', '23:35:41', '2019-06-17', '156072814118866clwt6eaithi9r704', 'thumb/1560728140347789FB_IMG_15607272155047602.jpg', 1),
(160, 'HIGHER LEVEL (Day 7 of 10)', 'OLUWOLE OLUWATOBI SOLOMON', '15600993580oonbacye1gtousayoa4lnrelr01cioo4t6slolue0w0plltold7ewmai9he1', 'show', '<p><br>How I dream to be great in life&nbsp;<br>I know it takes serious strife<br>Optimism is my daily watchword&nbsp;<br>Even yet I am not a landlord&nbsp;<br>I\'m not tired to go higher&nbsp;<br>And I will never retire</p><p><br>Though I know greatness does not come from neither east nor west<br>But from the heaven above<br>And He said to me not to rest<br>Being that I\'m in His groove<br>I look forward to the maker of the Universe&nbsp;<br>Whom I serve daily<br>In Him my elevation is immerse&nbsp;<br>And he said to me to live my life gaily<br>He shall not hand me over to retrogression&nbsp;<br>Because I delight in his decision</p>', 'uploads/15607436891569650IMG_20190617_WA0000.jpg', '1560499238919gltn63o60c5da5reeel3ui', '03:54:51', '2019-06-17', '156074369140et2riihage87hc44r996l', 'thumb/15607436896675519IMG_20190617_WA0000.jpg', 1),
(161, 'THAT HEART YOU BROKE (Day 7 of 10)', 'Georgette Kendra Mbale', '1559751687aeytcets5teded9e0blg3g21emn1aehyaireel1po8nrglol1tr9ckra6a', 'show', '<p>I want to tell you about<br>That heart you broke<br>My heart.</p><p>The heart that ushered you into its heavenly abode.<br>That heart that chose to see your beauty<br>Way past your short comings and never gave you a red card.<br>That heart that had just one reason to believe In you<br>Despite the hundred billion reasons to leave you.</p><p>Though I a Pisces and you in pieces<br>I chose you over the rest to create the worlds peaces<br>With steady paces we took our bond to greater places.<br>But you tore my heart to pieces.<br>You chose to see a sea of impossibilities&nbsp;<br>when my heart saw a soul with hope and possibilities.</p><p>I don\'t know how I fell for you<br>But I remember how you made me cry<br>How you shattered and scattered the pieces of my heart.</p><p>I loved you<br>So I cared and cried for you<br>Prayed and begged for you<br>I kept following you like d e f<br>Then you played me like a def jam.<br>But I paid no attentions to the rumours,<br>I pretended to be deaf and dumb to it.<br>And maybe,just maybe I was dumb,<br>A real dummy for loving you.</p><p>I sacrificed myself like a lamb,<br>Just to make your light shine on you.<br>I stood by you like a candle&nbsp;<br>Lighting up your darkest days.</p><p>Even so,you seemed to enjoy seeing me crying<br>Always pushing me to the side line<br>Putting me second to other girls<br>Who wished you nothing but I\'ll luck.<br>I buried my feelings<br>Only your scent reminded me of what I must feel.</p><p>Through the storm I stood by you<br>In your worst nightmares<br>I held your hand<br>I gave you my undivided devotion.<br>You hurt me so bad so i<br>Sank my emotions down the ocean deep.</p><p>My heart grew cold<br>But my heart kept in motion with more caution.<br>Through the rags and rains<br>My love sheltered you through it all.<br>But it wasn\'t enough.<br>I put my naked heart into your hands<br>And you tossed it onto the ground&nbsp;<br>Leaving it bare for the vultures to devour.</p><p>I told you I would leave<br>Hoping you would say something and make me stay<br>But you seemed happy<br>As if you had just won the lottery.<br>So I summoned the little dignity and courage I had left<br>Packed up my love like shit<br>And locked it away for good.</p><p>You broke my heart<br>And I had to let you go.<br>Counted you as a misfortune<br>But I wished you all &nbsp;the fortune in blessings<br>And mostly love you could appreciate.</p><p>&nbsp;</p>', 'uploads/15607553015326040IMG_20190617_WA0004.jpg', '1560499238919gltn63o60c5da5reeel3ui', '07:08:22', '2019-06-17', '1560755302ha55atti62ct9le4068r1', 'thumb/15607553014299772IMG_20190617_WA0004.jpg', 1),
(163, 'GOODBYE ( Day 7 of 10)', 'CHHOTE', '15601637908ypeccotrs6edlncey9e512t28rlotahaial0hgh051e', 'show', '<p><br>dont wanna cry but these tears are just too persuasive&nbsp;<br>I dont wana break down infront of all these people coz they may think am weak<br>I dont wanna feel a thing but strong is the pain<br>Irreversible and irresistible is the emotion,&nbsp;<br>Just like zambia appreciates MTN<br>You were in my life a gain<br>As the sun shines bright in the horizon<br>So did you in my life,&nbsp;<br>I might have been dormant in your life but,&nbsp;<br>Your performance &nbsp;was outstanding in mine.</p><p>To the memories we shared i will cling.&nbsp;<br>Share them with my offspring,<br>Treasure them as a wedding ring and,&nbsp;<br>Sing them over and over as a song.&nbsp;<br>As U. S. G would say,&nbsp;<br>You deserve two gold medals.<br>One for being the best and the other incase you lose the first one</p><p>Now that you late<br>Fate i hate<br>Destiny i detaste<br>Death i blame<br>Goodbye is the right word,<br>I dont wanna cry but these tears are just too persuasive&nbsp;<br>I dont wana break down infront of all these people coz they may think am weak<br>I dont wanna feel a thing but strong is the pain<br>Irreversible and irresistible is the emotion<br>&nbsp;</p>', 'uploads/15607611698971008IMG_20190617_WA0008.jpg', '1560499238919gltn63o60c5da5reeel3ui', '08:46:10', '2019-06-17', '1560761170ya60t4rgbc2ei871leood575', 'thumb/15607611697500135IMG_20190617_WA0008.jpg', 1),
(164, 'Mankind Scourge(Day 7 of 10)', 'Botefarm', '1560163828tmootcc7aeet9eab10ld9p7hgyie0lf2nl1ye2rar5rsa', 'show', '<p>My kids wouldn\'t &nbsp;understand this<br>Laying a wreath at his feet<br>Handsome, cute, cut off &nbsp;at age when he\'s in need<br>Quietly he lays now, &nbsp;forever &nbsp;bliss.&nbsp;<br>...<br>...<br>You would &nbsp;have been here<br>Stay, &nbsp;stay, &nbsp;mom then plead&nbsp;<br>Staring &nbsp;at the window, &nbsp;ready to fly<br>Never return, &nbsp;never said the goodbye &nbsp;to him.&nbsp;<br>...<br>...<br>Why bear the scourge, dearth &nbsp;and sorrow<br>To the faint in life that stayed behind<br>Aren\'t they better than the dead brave<br>To what end is bravery that cut men off.&nbsp;<br>...<br>...<br>We\'ve run the earth looking for gold<br>Putting behind man\'s ultimate goal<br>To take care of the earth, nurture and tend<br>Not the way bombing it till the end.&nbsp;<br>...<br>...<br>Aims high, set target, to kill and destroy&nbsp;<br>The deep waters &nbsp;can attest, the land can testify&nbsp;<br>Our bloodshed, &nbsp;all of mankind evil coy<br>And who will one day all mankind unify.&nbsp;<br>...<br>...</p>', 'uploads/15607621437343003IMG_20190617_WA0007.jpg', '1560499238919gltn63o60c5da5reeel3ui', '09:02:24', '2019-06-17', '1560762144n2eiikn99ml14a7r6td18c4a', 'thumb/15607621432610706IMG_20190617_WA0007.jpg', 1),
(166, 'HUMANITY (Day 7 of 10)', 'Adeyemi Jamiu Adebayo', '1560163509coadedep0lrecaramea3h2eiab1e3dn4l27siy28ejyougmltayi5yat1', 'show', '<p><br>Honored animal, placed above all<br>Fancier of glitter,luxurious and above all</p><p>Humanity isn\'t dignity ,<br>\'Cause seemingly.....<br>Were dynamic in nature</p><p>Sleeps and wakes on tranquillity &nbsp;bed<br>Chewing lawful upon tongues as food&nbsp;<br>While drinking a wine filled of sinful</p><p>Yet, yearning for peace&nbsp;<br>After peace is pieced in pieces&nbsp;<br>Through behavior of hearts and minds</p><p>&nbsp;</p>', 'uploads/15607628798648672FB_IMG_15607622121704290.jpg', '1560499238919gltn63o60c5da5reeel3ui', '09:14:40', '2019-06-17', '1560762880nrt74ac88ia3i0lyt3ueh14m4', 'thumb/15607628791704055FB_IMG_15607622121704290.jpg', 1),
(167, 'Immotal (DAY 7 of 10)', 'Bello Sodeeq Adekunle', '1560163948uyoesae7laldeeatd51lootpre1beics0ngyn81dkl04qa9l5lreeceh6', 'show', '<p><br>beyond humanity are some mysteries,<br>that can\'t be decipher by men,<br>that &nbsp;doddle much on the purging sweetness of torso<br>.<br>if there should be someone&nbsp;<br>that knows the real portrait of stranger,<br>that tiptoed into the chamber of a maiden,<br>in the darkest portion of a sombre dusk,<br>scouring for sanctuary in her tabernacle,<br>that will be the strand,passage way,entry ,walls &amp; ceilings of the chamber<br>.<br>just as identifying true immortals is embedded in obscurity,<br>is as replicating the tractable &amp; docile feature of those non vociferous objects,<br>they could attest to the coital symphony of the overlapping baptism,<br>but unable to &nbsp;avowedly tell the crowd,<br>the sin scene seen behind the dais<br>.<br>You might have heard \'bout the resurrection of powerful ancestors,<br>life, death &amp; again life,&nbsp;<br>portraying some intervening pebbles &amp; distorting stones,<br>in the fertile humour of mankind; real or not, one thought against the other<br>like the opposing flexor &amp; extensor muscles,<br>despite they weren\'t immortals<br>.<br>have you heard the tales of the formidable anchorman,<br>killing souls with a strike of his splashing sword,<br>and bragging, that he is a god ,<br>&amp; no one dares to curb his delirious act,<br>he isn\'t immortal but a felon, domineering his subtle people<br>.<br>you might have eavesdrop the story of the gods,<br>they live &amp; only turn to objects - like chain, stone, rod or river,<br>but who knows if death predates them also<br>&amp; transit from these space,<br>in spite of their discrepancies, they weren\'t the true immortals.<br>.<br>being immortals isn\'t judge by possession of incongruous strength or outstanding terrestrial power,<br>but by asserting your deeds in the mind of people,<br>true immortals live,die,rise &amp; fall.<br>transits to the netherworld, but the residue of their initiative<br>will articulate to form the dross of cheerful remembrance,<br>in the heart of their people,<br>revolving from generation to generation<br>.</p>', 'uploads/15608104111168450imo.jpg', 'j90819542aBn72i', '22:26:53', '2019-06-17', '15608104131el4aoil87mac95t837ti1rm', 'thumb/15608104116143733imo.jpg', 1),
(168, 'Men of Men (DAY 7 of 10)', 'Ariyo Ahmad', '15602440698dah92am6al40doactaroyyrg3ina7else5ie1yrh8ct0elp', 'show', '<p>I lost count to the numbers of men that exist &nbsp;like stars in the cloud.<br>But some characters they plant as fruits<br>can be taken from,&nbsp;<br>little by little to fill our hungry eyes.</p><p><br>Some men are carnivorous men who are ready to pull down the sun and have them govern in their barn.<br>Why in the same gasp of breathe some are beast &nbsp;ready to pluck the star to have them as &nbsp;cubes of sugar to their tea.</p><p>In the other gasp of men some wet their faces with the water inside the cold calabash to stay awake and hawl down the moon to make their night glooming.</p><p><br>The flowing honey between the thighs of the bee some men are determined to sip it till it drain.<br>Some are ready to have it unripe and they are ready to have holes bore in it like a pawpaw pecked by the bird that linger on its trunk who has been bitten by hunger.</p><p>In the other realm of it some are humanly struck with good morals that they watch them grow while they also grow.</p><p><br>Some men have their future buried today and their tomorrow has nothing to grow for them to feed their hungry tommy in the morrow.</p><p>While some men plant their future with enough water and proper tilling for their crop to grow edible and be able to withstand the troubling challenge in the morrow and likewise to feed their hungry tommy in the future.</p><p><br>Men of men care for their women like the moon shelter care to the land and its embellishments.<br>Men of men never nurture the thought to bully women at this dilapidating state we are.</p><p>Men of men we are, for if you lack the quality of a good man your quantity will not be weighed</p>', 'uploads/156081094595155377amah.jpg', 'j90819542aBn72i', '22:35:47', '2019-06-17', '156081094707tir291malec7n574e6', 'thumb/156081094584500317amah.jpg', 1),
(170, 'ON THAT EVENING (Day 7 of 10)', 'Lewis Wamwanda', '1559751824300twhsaocetip8dai3enners8lw1myawadre85yac5gal11lel', 'show', '<p><br>That Evening when I picked the phone<br>She poured her heart out<br>And made my eyes flood with tears<br>As I listened to her confessions</p><p>Maria poured her heart out<br>Telling how her life was made in hell<br>And the confessions that she made<br>Made my heart wail in shock</p><p>Her life was made in hell<br>Leading her to do drugs and sell honey<br>And my heart wailed in shock<br>When she said that she had the virus</p><p>She did drugs and sold honey<br>To anyone ready to buy<br>And when she got the virus<br>Her life made a turn towards the pit</p><p>She sold honey to anyone ready to buy<br>I listened, my eyes flooding with tears<br>On how her life had made a turn<br>On that evening when I picked the phone</p>', 'uploads/1560828892564058IMG_20190618_WA0000.jpg', '1560499238919gltn63o60c5da5reeel3ui', '03:34:53', '2019-06-17', '1560828893i5cl67e8012n2to66ra', 'thumb/15608288929292042IMG_20190618_WA0000.jpg', NULL),
(174, 'What If We Love Each Other (Day 7 of 10)', 'Asika Victor', '1560102058ce2hcod0l31iel77inotya83tay600escgiarvrskret4plaa', 'show', '<p>&nbsp;</p><p>What if we love each other in this rigorous world?<br>Where peace is war<br>Brother destroys brother<br>Sister drives pleasure in hurting sister</p><p>Day in and out<br>One meets disaster<br>Tears endlessly showing its greatness<br>What a painful pleasure,<br>one have for another</p><p>What if we love each other ?<br>and together we build a settled mind<br>What if we love one another?<br>and together we meet a peaceful demand</p><p>Hold me like you need me<br>Let\'s build our crumbling home<br>Feel me like the air you breath<br>Let us not worsen our pain</p><p>Why not, we both be fools?<br>For that called foolishness promotes peace</p>', 'uploads/15608297865568210FB_IMG_15608294603193451.jpg', '1560499238919gltn63o60c5da5reeel3ui', '03:49:47', '2019-06-17', '1560829787rtl1a14t5e2771hiaw8c2', 'thumb/15608297863849105FB_IMG_15608294603193451.jpg', 1),
(175, 'A RUN FOR ALMIGHTY DOLLARS (Day 8 of 10)', 'Paciolo Pen Saint', '156018203445nt0aiss3nclhny6ceteo9gtraoa6e9a4lipi7ee1playorplc7d', 'show', '<p>&nbsp;</p><p>Listen how the story began,<br>How deep inside me a broken heart.</p><p>I have my head in the cloud,<br>Facing severe phases,<br>Different phases of destiny.</p><p>My friends were riding their romantic rides,<br>I never wanted to believe my time was yet to come,<br>I just wanted my rides,<br>Even not by the seam of my pants,<br>But by cloaks and daggers job.<br>I sang the song of wealth all day,</p><p>Oh wealth, don\'t beat pant off me,<br>Don\'t bore the pant off me,<br>Send me not on errand, for I am tough as old boots.</p><p>I went into deep thought for days,<br>Finally, I made my decision pellucid;Ã¯Â¿Â½</p><p>To pay devil a visit,<br>To give devil is due,<br>To become devil\'s bones and dice.<br>Devil threw in the air his arms and embraced me,<br>He gave me all I wanted,<br>But his warnings put me in between deep sea and devil.<br>For many years have seen better days,<br>Have won and gained good days,<br>Dwelt in halcyon days.<br>Not until I forgot devil\'s due,<br>Evil days started to strike,<br>I held horns of dilemma,<br>Worse superlative was more than worst,<br>I went back to my old shoes.<br>Thanks,that wasn\'t all,<br>Devil lost his bearings over me,<br>He took his bit between his teethÃ¯Â¿Â½<br>Dead beat, dead broke were mere torments from him,<br>He made me a peer to waste, an outcast.<br>I lost in the power of insanity,<br>Till eternity.</p><p>&nbsp;</p>', 'uploads/15608303218880901FB_IMG_15608297998224412.jpg', '1560499238919gltn63o60c5da5reeel3ui', '03:58:42', '2019-06-18', '15608303227rl06e993i33atc57a', 'thumb/15608303211654694FB_IMG_15608297998224412.jpg', NULL),
(176, 'Virus delipitates men (Day 8 of 10)', 'Abdulrahman Soliu', '15601820100bly1ulmorenaer8alita11yepo4sru32i78sltae0c5hnagcdldha', 'show', '<p>Theme: Inequality&nbsp;<br>&nbsp;</p><p>A plague that delibitates men<br>Like an heartbroken&nbsp;<br>And that can detriment&nbsp;<br>The qualities of men.</p><p>A mischief act<br>That makes men<br>Getting into some<br>Devilry, &nbsp;and wind up&nbsp;<br>The kindness in men.</p><p>Inequality of creators<br>Make creatures to<br>Create enormous enmity&nbsp;<br>That arouse from envy.</p><p>Some part subjected&nbsp;<br>As the richer<br>Some claim to remain&nbsp;<br>In the center of the two concept&nbsp;<br>And some subjected&nbsp;<br>As the poorer.</p><p>The mad in men madness&nbsp;<br>Which makes them un fitted&nbsp;<br>To hold the tittles of a great quality.</p>', 'uploads/15608307045361388FB_IMG_15608302584726425.jpg', '1560499238919gltn63o60c5da5reeel3ui', '04:05:06', '2019-06-18', '1560830706tr2s31r1i89e5c4uliav50', 'thumb/15608307043335192FB_IMG_15608302584726425.jpg', NULL),
(177, 'TAX COLLECTORS (Day 8 of 10)', 'Lewis Wamwanda', '1559751824300twhsaocetip8dai3enners8lw1myawadre85yac5gal11lel', 'show', '<p><br>Ding dong, goes the bell<br>The door opens wide<br>They Rush in and out<br>Like busy bees on errands</p><p>They flood the gates<br>With big round bellies<br>Like big ripe pumpkins&nbsp;<br>Collecting notes and cents</p><p>They stink of filth<br>Flies for followers<br>Buzzing hymns of hunger<br>To devour the cents collected</p><p>Tax collectors,<br>Collecting taxes from husbands<br>And sometimes leave change&nbsp;<br>Seen nine months later</p><p>Ding Dong, goes the bell<br>They flood in the open bars<br>Carrying empty hungry bellies<br>Later filled with taxed booze</p><p>&nbsp;</p>', 'uploads/15608430548894699IMG_20190618_WA0006.jpg', '1560499238919gltn63o60c5da5reeel3ui', '07:30:56', '2019-06-18', '1560843056c106e22alt50i1r0xt2a', 'thumb/15608430542211150IMG_20190618_WA0006.jpg', 1),
(178, 'WALKING DEAD (Day 8 of 10)', 'Georgette Kendra Mbale', '1559751687aeytcets5teded9e0blg3g21emn1aehyaireel1po8nrglol1tr9ckra6a', 'show', '<p>&nbsp;</p><p>I died way before my grave<br>I lost the life inside of me while I was still breathing&nbsp;<br>You never knew.<br>Coz you never took time to be with me.</p><p>Remember those days you said I was moody<br>Its coz i had been crying all night<br>I tried to tell you but you where too busy.</p><p>You called it a phase<br>But I was dying and you didn\'t care<br>I tried to get close to you and pour myself out<br>But you phone was of more value<br>So I let you be.</p><p>When I was at my lowest and cried for help<br>You said I needed to grow up and be less dramatic.&nbsp;<br>I had no hope or love in me<br>I was a walking corpse.<br>Suicide thoughts where much more arousing than watching pornography.<br>Erected in me was a castle in darkness&nbsp;<br>A place where dead men told tales.</p><p>I traveled to the land of the dead<br>Where broken hearts dwell<br>Atleast I could see shadows n I wasn\'t alone<br>The pesence of demons was more indulging.</p><p>Reality was hell<br>Hell was paradise.<br>So I tied a rope to a tree and made a swing<br>Only I wasn\'t sitting on it<br>I tied it to my neck.<br>The ghosts stood by me to witness<br>Coz you weren\'t there like always<br>And I gave up on breathing&nbsp;<br>For i had been dead a long time.&nbsp;<br>I hope you never break your phone&nbsp;<br>Coz i died with a broken heart.</p>', 'uploads/15608441163651173IMG_20190618_WA0002.jpg', '1560499238919gltn63o60c5da5reeel3ui', '07:48:38', '2019-06-18', '15608441186wa5ickle418ti25lng9ar04', 'thumb/15608441164582227IMG_20190618_WA0002.jpg', 1),
(180, 'SALUTE TO THE LEADERS (Day 8 of 10)', 'OLUWOLE OLUWATOBI SOLOMON', '15600993580oonbacye1gtousayoa4lnrelr01cioo4t6slolue0w0plltold7ewmai9he1', 'show', '<p><br>Salute to the leaders<br>Who have in minds to serve their people&nbsp;<br>But the terrain of atmosphere<br>In the Federal Chambers<br>In the States\' Chambers<br>In the Locals\' Chambers<br>Have bedevilled your reasoning faculties<br>To hurt the citizens\' enjoyment.</p><p><br>Salute to the leaders<br>Who drag the rights of the masses on floor<br>Thinking nothing about the masses<br>You concur to the laws that enrich your purse<br>You sideline the laws that people will benefit from.</p><p><br>Salute to the leaders<br>Who cajoled the masses with their sugarcoated mouths<br>You\'re all tenants of the house<br>Your days are numbered,<br>You\'re remembered today<br>How time flies<br>You\'re about to ruin your political career<br>Till when will you be considerate to the masses?<br>We salute you all!</p>', 'uploads/15608629459416501IMG_20190618_WA0001.jpg', '1560499238919gltn63o60c5da5reeel3ui', '13:02:27', '2019-06-18', '1560862947u5s1eraateil217733ltc94', 'thumb/15608629451933689IMG_20190618_WA0001.jpg', 1),
(181, 'From a long way (Day 8 of 10)', 'Ariyo Ahmad', '15602440698dah92am6al40doactaroyyrg3ina7else5ie1yrh8ct0elp', 'show', '<p>&nbsp;</p><p>We came from a long way before we emerge in the furrow train of life.<br>Our driver would have thrown us out of the journey train.<br>And we are determined to cross through the ocean,<br>And to withstand the wave that might quiver.<br>How I came to this train is far from what my eyes can see<br>The bend tree ahead is neither a sign of end to our journey.<br>Just that we have a task to get straighten ahead of us.</p><p><br>I came from a long way before my driver to this world<br>Could bring me to this world I am at the fresh of the leaf.<br>The one who fuel the land rover &nbsp;that make the driver kick the engine have come a long way to fuel the car.<br>The earth that shake do not metamorphosis that the end is near our door.<br>But that we should stand firm to overcome the trembling earth shake and the train.</p><p><br>We came from a long way<br>but getting here has been with great battle in the battlefield of my mothers womb.<br>Millions of us that was delivered be my Father is not a sign that the door is close,<br>But for me to strive hard amidst the stars and shine bright.</p><p><br>I came from a long way for a temporal visit to this world that it\'s stay can not me measured by the blood that flows through my vein.<br>We came from a long journey,<br>A journey that can\'t be covered by our leg nor by our heart that pumps blood nor by our breathe but my our Creator.</p>', 'uploads/15608680002230679IMG_20190618_WA0018.jpg', '1560499238919gltn63o60c5da5reeel3ui', '14:26:41', '2019-06-18', '156086800153ai7ferl00t6m9ro7c0', 'thumb/15608680008048595IMG_20190618_WA0018.jpg', 1),
(182, 'BEAST (DAY 8 of 10)', 'Chhote', '15601637908ypeccotrs6edlncey9e512t28rlotahaial0hgh051e', 'show', '<p>Once upon a time i fell inlove with a beautiful princess<br />\r\nfit to be called her royal highness<br />\r\nShe was a spectrum of beautiful flowers<br />\r\na reflection of God&#39;s existence<br />\r\nthe prettiest being man had ever seen<br />\r\nthe finest piece of art God had ever created<br />\r\nthat being on whom everyone&#39;s eyes were laid<br />\r\non whose laps everyone wished to lay their head<br />\r\nshe was a masterpiece,<br />\r\na goddess among the many queens,<br />\r\na golden necklace among rubies,</p>\r\n\r\n<p>at her feet men came kneeling<br />\r\neveyday day when she sang,<br />\r\non the walls of their hearts,her face used to hang<br />\r\non the other hand ,<br />\r\ni was just a begger<br />\r\na poor lonly writer&nbsp;<br />\r\nowning nothing but a pen and paper<br />\r\ndressed in rags,nothing to expect from the future</p>\r\n\r\n<p>in public i would recite my poetry pieces,<br />\r\nin secrecy i told and read my stories<br />\r\nuntil that day&nbsp;<br />\r\nthat day when she got hold of my diary&nbsp;<br />\r\nread my pieces and fell inlove with me<br />\r\nor so &nbsp;she said<br />\r\n&quot;will you please &nbsp;be my man and let me be your woman?<br />\r\nill only be &nbsp;yours and you will be mine<br />\r\ni will &nbsp;forever love you,<br />\r\ntreat and please you like the man you are,<br />\r\nyou shall never lack or starve&quot;</p>\r\n\r\n<p>we were the best couple<br />\r\nin bed we would always cuddle<br />\r\nalways romancing never a tussle<br />\r\nunfortunatly,<br />\r\nshe grew tired of me and began seeing other men<br />\r\na thousand times she hurt ,me knowingly<br />\r\na billion times i died inside willingly<br />\r\na million times she called me a fool that i started thinking the same way too<br />\r\nwhen time had come,she broke my poetic heart and i became beast<br />\r\nnow all i can do is hurt<br />\r\nfor evil motives i date<br />\r\nfor they all plead guilty and none innocent<br />\r\ni nolonger love,like or miss<br />\r\ncoz,love is just a weakness<br />\r\nso contagious as an airbone sickness<br />\r\nweakening as a first love&#39;s kiss</p>\r\n\r\n<p>no more do i cry,<br />\r\nno more is my judgement blurry,<br />\r\nno more<br />\r\nno more do i feel hurt<br />\r\nno more do i feel played<br />\r\nno more do i see myself a fool<br />\r\nno more do i feel a thing,why?<br />\r\n&quot;IAM A BEAST!&quot;<br />\r\n#CHHOTE_THEE_POET</p>', 'uploads/15608975967021013beaset.jpg', 'j90819542aBn72i', '22:39:59', '2019-06-18', '156089759954064trbtsai8e0cal494e', 'thumb/15608975968100589beaset.jpg', 1),
(183, 'Sorry (DAY 8 of 10)', 'Bello Sodeeq Adekunle', '1560163948uyoesae7laldeeatd51lootpre1beics0ngyn81dkl04qa9l5lreeceh6', 'show', '<p>This agony I have endured<br>This peril I have fathomed<br>This cascade I have trodden<br>For my trust you have forever shattered<br>With your infidelity shards of lust.</p><p>Your forgiveness I have always granted<br>And your fascinating beauty I always chanted<br>Just for this love my voice is a city of silences<br>For those sigh-lens couldn\'t aid my insight.</p><p>For you, I paddled this ocean of misery<br>Ignoring what might be written in the blank space of history<br>But you refuse to be neither contrite nor penitent<br>Have repentance become a restricted phenomenon?</p><p>Despite all the endurance I have embrace<br>All you could do is setting my heart ablaze<br>With your fiery fire sprouts flame of deceit<br>And your barbaric lies that thrust and pierce through my porous pores&nbsp;<br>To flinch out the affectionate part of my ego.</p><p>No more sorry<br>No more plead<br>For this has gone beyond mistakes<br>It is the breaking of trust.</p>', 'uploads/15608978679385874bello8.jpg', 'j90819542aBn72i', '22:44:29', '2019-06-18', '156089786976r8rlte2o57s710yci9ar', 'thumb/15608978685782442bello8.jpg', 1),
(185, 'AM A POET (Day 8 of 10)', 'Adeyemi Jamiu Adebayo', '1560163509coadedep0lrecaramea3h2eiab1e3dn4l27siy28ejyougmltayi5yat1', 'show', '<p>&nbsp;</p><p>Am a poet not pastor&nbsp;<br>Wrapping motion faces in lines &nbsp;<br>Translates feelings into stanza&nbsp;<br>Flipping grouns on pen surface&nbsp;<br>&nbsp; &nbsp; As poet ,<br>While, It rumbling upon ink is gulp<br>Yet, mending some tattered clothes as healing&nbsp;<br>&nbsp; &nbsp; &nbsp;<br>Deeply, trances were losing&nbsp;<br>Pooping Hopes at loaded vessels weighed down in this deeply sea</p><p>Am a poet not pastor&nbsp;<br>Poem is my altar,<br>lines and stanzas are ushers<br>I baptized souls in streaming inks</p><p>Poems wearing poetic are sermon to feeds ears<br>A temple filled of words to wetsuits hearts<br>No limitation of members&nbsp;<br>Come one , come all&nbsp;<br>You shall all anonted by poetry</p>', 'uploads/15609000345154307FB_IMG_15608912197402263.jpg', '1560499238919gltn63o60c5da5reeel3ui', '23:20:36', '2019-06-18', '156090003688435ml10ricta84e6a', 'thumb/15609000342592517FB_IMG_15608912197402263.jpg', 1),
(186, 'Just Me(Day 8 of 10)', 'Asika Victor', '1560102058ce2hcod0l31iel77inotya83tay600escgiarvrskret4plaa', 'show', '<p>&nbsp;</p><p>If it\'s just me,<br>it will be a glob of no anxieties<br>Never will they be bitter pill<br>Never will they be caursure strip&nbsp;<br>Never in my dealings</p><p>If it\'s just me&nbsp;<br>others to me will be apathy<br>Never will i look back<br>Looking back for what<br>And what will look back for you</p><p>If it just me<br>never will i be altruist<br>Domineering we be mine<br>never will all be done<br>And the done will never be done</p><p>If its just me<br>meticulously will not be<br>All will be open desecrate<br>Anxiety for voracious will elop<br>Never will there be desecrate</p><p>If it just me<br>yes if it\'s just me<br>There will be no sedentary<br>The sedentary will not be pacify<br>All dark and light long nothing aesthetic seen</p><p>If it\'s just me,<br>In absence of sun hlurious stays<br>In absence of moon hlurious stays&nbsp;<br>Never will they be delusion<br>neither will they be illusion</p><p>If it\'s just me,<br>Yes only me, &nbsp;no pessimism<br>Pessimism will now be optimism<br>Optimism will now be melancholism&nbsp;<br>Melancholism the capital city of loneliness</p><p>If it\'s just me,<br>one will be embracing loneliness<br>Living in capital city of sadness<br>Missing the need for needness, wantness and oneness</p><p>But as it\'s not just me,<br>all the just, written<br>Will not just be</p>', 'uploads/15609005817893283FB_IMG_15609000533136891.jpg', '1560499238919gltn63o60c5da5reeel3ui', '23:29:43', '2019-06-18', '1560900583ta1er89c1i30l18jtu6s4', 'thumb/15609005814604839FB_IMG_15609000533136891.jpg', 1),
(187, 'MONEY (Day 9 of 10)', 'Paciolo Pen Saint', '156018203445nt0aiss3nclhny6ceteo9gtraoa6e9a4lipi7ee1playorplc7d', 'show', '<p>War<br>Battling the&nbsp;<br>Soldiers of Poverty</p><p>&nbsp;</p>', 'uploads/15609034995095902FB_IMG_15609025522708078.jpg', '1560499238919gltn63o60c5da5reeel3ui', '00:18:21', '2019-06-19', '1560903501417a5emi1oly8e8t178rnc', 'thumb/15609034995249659FB_IMG_15609025522708078.jpg', 1),
(188, 'Tribute to my pen (Day 9 of 10)', 'Abdulrahman Soliu', '15601820100bly1ulmorenaer8alita11yepo4sru32i78sltae0c5hnagcdldha', 'show', '<p>Theme: My pen</p><p><br>Permit me to change your heart<br>Let me pour the blessing of my pen on earth&nbsp;<br>With my pen, you shall become a rebirth&nbsp;<br>And with it, the earth shall hollow defect.</p><p>Let my pen eulogize you<br>With its suitable sound like chirup<br>Surely, your head shall feel its honored,&nbsp;<br>Your legs shall feel its tuneful,&nbsp;<br>And thee shall mummify your life\'s agonies.</p><p>My pen, my only confidant&nbsp;<br>That kept my secrecy secretly,&nbsp;<br>The only tools to rid the traumatic&nbsp;<br>Which might perch in the tent of my heart.</p><p>My pen, The spring springing<br>My future\'s victory<br>As the dream revealed its strength&nbsp;<br>And the ink exposed its mighty.</p><p>My pen, &nbsp;my pain killer<br>The co_habitant of my soul<br>That fly away my sorrow.&nbsp;<br>My agitator of my freedom and right&nbsp;<br>From thebcaptive of the oppressor.</p><p>Hear my scream not, but only inside my pen<br>Through it, my fame explode<br>Like the dissolution of a gas<br>And with it, I became a gentle hero<br>And people tagged me as Hero of Truth seeker.</p>', 'uploads/15609038166033674FB_IMG_15609034963135910.jpg', '1560499238919gltn63o60c5da5reeel3ui', '00:23:37', '2019-06-19', '1560903817196ta49ei3c8teubirrl8t53', 'thumb/15609038167052000FB_IMG_15609034963135910.jpg', 1),
(189, 'THE DOWNFALL OF A WARRIOR (Day 9 of 10)', 'Adeyemi Jamiu Adebayo', '1560163509coadedep0lrecaramea3h2eiab1e3dn4l27siy28ejyougmltayi5yat1', 'show', '<p>&nbsp;</p><p>The giant warrior shall plead the dwarfs,&nbsp;<br>Dawn is the embryo bride of sunny days<br>Brightish wave kudos to his rays<br>While mid-day accolade his shines &nbsp;</p><p>The battle shall end like serene<br>Neither permitted or vitiate<br>A warrior shall fall like a tree</p><p>Sooner or later a champion will survive&nbsp;<br>Then , will drink wins in a cup of wine<br>And blow a victory trumpetlike &nbsp;</p><p>The weather bid a goodbye like rebellions<br>Dusk acted buddy role,but dodging shames&nbsp;<br>Through the daylight\'s fadeness<br>His strengths is insipid and dull as faceless</p><p>Eve-ing set a poisonous arrow on his chest&nbsp;<br>He fell down on surface of moon&nbsp;<br>Darkness claimed on his back to pledge him a farewell<br>While sparkling stars mourn and bleeding for a falling warrior</p>', 'uploads/15609090569882760FB_IMG_15609082433988057.jpg', '1560499238919gltn63o60c5da5reeel3ui', '01:50:57', '2019-06-19', '15609090573ita576cetr997755elh', 'thumb/15609090564938522FB_IMG_15609082433988057.jpg', 1),
(190, 'THE INESTIMABLE JEWEL (Day 9 of 10)', 'OLUWOLE OLUWATOBI SOLOMON', '15600993580oonbacye1gtousayoa4lnrelr01cioo4t6slolue0w0plltold7ewmai9he1', 'show', '<p><br>See her walking majestically<br>As if she is the only one made gorgeously<br>Tell me not what I know<br>That they are delicate vessels<br>Undisputable reality from the source<br>Why are they meant to be adored?<br>A mystery unknown to any creature.</p><p><br>Though created from man<br>But more gorgeous than man<br>How does this happen?<br>Still a mystery many men mind to know<br>In them lie unending joy<br>In them lie eternal bitterness<br>Unto man who knows what is right&nbsp;<br>Who sees them as an adorable being<br>Enjoys the right proportion from them.</p><p><br>If you care to know<br>You need to know<br>Women are not gem of trouble<br>Men instigate in them the abnormal attitudes<br>Which later leads to catastrophe</p><p><br>Many men minds manoeuvre<br>To the secret of woman creation<br>That they are inestimable jewels,<br>What do they deserve?<br>They are to be idolized and cared for<br>They are not to be despised<br>They are not not to be bullied<br>They are not to be maltreated<br>They are not to be victimized<br>They are not to be malnourished<br>They are not to be enslaved<br>They are not to be embittered in hearts<br>They are not to be deceived.</p><p><br>Men, hear this well<br>Women are to be adored<br>Guide them jealously<br>The way you treat them&nbsp;<br>determine your outcome in life<br>Your attitudes to them<br>Either make or mar your destinies<br>Women are nothing but inestimable jewels.</p><p>&nbsp;</p>', 'uploads/15609258777520884IMG_20190619_WA0000.jpg', '1560499238919gltn63o60c5da5reeel3ui', '06:31:19', '2019-06-19', '1560925879cr0e2l1t8t8i300ea8h4', 'thumb/15609258774882293IMG_20190619_WA0000.jpg', 1),
(191, 'HUSH AND KEEP SILENT (Day 9 of 10)', 'Georgette Kendra Mbale', '1559751687aeytcets5teded9e0blg3g21emn1aehyaireel1po8nrglol1tr9ckra6a', 'show', '<p>&nbsp;</p><p>Dear diary<br>Do you know how it feels&nbsp;<br>To have life flash before your eyes<br>Pretend to be physically fine<br>Be broken and live with a void inside.</p><p>Do you know how it feels<br>To live in the Devils abode<br>Watching him feed you to his demons<br>Cleansing you in his burning erotic desires<br>As he strips you off your innocence.</p><p>I am a child in limbo<br>Life snatched from me before I could distinguish&nbsp;<br>Black from gray,spring from winter or life from death.</p><p>Cursed with the death of my parents<br>Left in my uncle\'s care<br>But he was a monster in a suit<br>Calling upon the name of the Lord&nbsp;<br>On Sunday morning&nbsp;<br>Defiling and tearing me apart&nbsp;<br>On a Sunday evening&nbsp;<br>Treated like a slave&nbsp;<br>Sunday to Sunday<br>From spring winter till summer.</p><p>I cannot utter a word<br>For i am a helpless hopeless child<br>A rat against cats.<br>Living in Sodom painted like Canaan.</p><p>I am just a child&nbsp;<br>I know not why they hate me<br>I wish to escape from this hurt.</p><p>Dearest diary I\'m not allowed to have friends&nbsp;<br>Keep my secrets like the pillow keeps my tears<br>The Dutch and Dutchess should not find out or<br>This haunted mansion will turn to a ghost nation<br>Good night.</p><p><br>Date: Third day/summer/years of darkness</p>', 'uploads/15609260755470515IMG_20190619_WA0001.jpg', '1560499238919gltn63o60c5da5reeel3ui', '06:34:36', '2019-06-19', '1560926076s2ul7ct42r18h5a05ieh2', 'thumb/15609260752062412IMG_20190619_WA0001.jpg', 1),
(192, 'WHO KNOWS TOMORROW {TalomÃƒÂ³la} (Day 9 of 10)', 'Ariyo Ahmad', '15602440698dah92am6al40doactaroyyrg3ina7else5ie1yrh8ct0elp', 'show', '<p>&nbsp;</p><p>My town crier has come again to calve the tone of my iron bell into your silent ears,<br>And to make the message penetrate into your mind like the scary dream that awakens Balogun this morning.</p><p>&nbsp;</p><p>The question triggers my mind &nbsp;and hearts and render it restless that even the food have been envisaging eagerly brandishing my mouth to devour has become enemy to my mouth.</p><p><br>The question beat heavily into my mind like Ilu Bata and my body could not hold but shake towards its heftiness like the mountain stagger to brake into pieces at the sight of its enemy. &nbsp;</p><p><br>Oba Aleyeluwa ask me to ring the bell of these words to your hearings that every children and elders should watch their deeds and divorce involving &nbsp;lustfully into one vices or the other that most importantly no one knows tomorrow and who knows tomorrow ??</p><p>&nbsp;</p><p>The beautiful daughter of Oba Aremu whose beads honours her waist by clapping due to her legs that kept changing position when she walks and her face treasure &nbsp;by the garment of smile she adorn on her face.<br>Hers whose love is enslaved in the heart of omo ode.<br>I secretly tell you to tell oba that the Oracle will be angry if their iron refuse to melt in love and happiness.</p><p>Who knows tomorrow ??</p><p><br>When you have stomach filled do not chest out to show off for this life no one knows tomorrow.</p><p>If a man is pauper today that in fact is not the end of his journey in this world as long as he breathe&nbsp;<br>And if your stomach is half filled remember those will appreciate you even you share to them your from your leftover food.</p><p><br>Ã‚Â©Gent soul</p>', 'uploads/15609264588803670Screenshot_20190619_073724.png', '1560499238919gltn63o60c5da5reeel3ui', '06:40:59', '2019-06-19', '15609264596h1otra54w631c565eil', 'thumb/15609264581929017Screenshot_20190619_073724.png', 1),
(193, 'PASSION (Day 9 of 10)', 'Bello Sodeeq Adekunle', '1560163948uyoesae7laldeeatd51lootpre1beics0ngyn81dkl04qa9l5lreeceh6', 'show', '<p><br><br>how long do i have to wander,<br>how long do i have to glide on its\' lake like a gander,<br>for philosophers has taught me about its\' multiple edges<br>for it has intimidate me amidst distinguished facial pledges<br>dumping me in a state of pusillanimity.<br>the strong emotion one has for a person,thing or career,<br>aesthetically believe as an emotional feature indeed,<br>that contribute to future to be candid,<br>how can a man speak of passion,<br>when he embraces none on his mission,<br>blur like the sight of snake undergoing ecdysis was his vision.<br>emphasizing your lineage is incomplete,<br>when distress,fear,lust &amp; delight are not mentioned,<br>for they are your progeny in a patriarchal community.<br>they come in pair:delight and distress,fear and lust.<br>for distress in loving is some kind of absurdity,<br>and delight in this scenario makes it a want-to-experience passion,<br>a certain distress that culminate fear,<br>fear that leads to consternation,<br>and lust,an irrational passion<br>merges its most devastating morph.</p><p>&nbsp;</p>', 'uploads/15609266882921147IMG_20190619_WA0003.jpg', '1560499238919gltn63o60c5da5reeel3ui', '06:44:49', '2019-06-19', '1560926689otiap7l417749n7eascri9s', 'thumb/1560926688974611IMG_20190619_WA0003.jpg', 1),
(194, 'I WILL WAIT (Day 9 of 10)', 'Lewis Wamwanda', '1559751824300twhsaocetip8dai3enners8lw1myawadre85yac5gal11lel', 'show', '<p><br>I will wait until dawn<br>I will not let you down</p><p>When dusk falls again<br>I will stay not in vain</p><p>In the fields you fight<br>The dark will turn light</p><p>My belly is growing<br>I feel him kicking</p><p>Don\'t fail my love<br>You are the one I have</p><p>You are stronger than all<br>And I don\'t expect a fall</p><p>I will wait until dawn<br>I will not let you down</p><p>&nbsp;</p>', 'uploads/15609268669379260IMG_20190619_WA0004.jpg', '1560499238919gltn63o60c5da5reeel3ui', '06:47:47', '2019-06-19', '156092686791cir678tle5ai6508', 'thumb/15609268665274679IMG_20190619_WA0004.jpg', 1);
INSERT INTO `insight` (`id`, `title`, `author`, `category`, `visibility`, `body`, `image_1`, `created_by`, `time_created`, `date_created`, `hash_id`, `thumbnail`, `notification_status`) VALUES
(195, 'Umbrella (Day 9 of 10)', 'Holuwakharyodea Taiwo', '1560102926ra12hacel1ngpraalad6wodtieyaorulcaio67ee37yokl0stw90h5teryh', 'show', '<p><br>Form: Blank space</p><p><br>when your world is crashing down&nbsp;<br>right now you think its gonna end<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;With you I\'ll be there<br>like matches&nbsp;<br>to ignite your smiles&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; which has been lost in life&nbsp;<br>when pains couldn\'t depart from you<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; your days ain\'t bright but gloom&nbsp;<br>smiles was far distanced from you<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;I\'ll always be there for you<br>look up to the sky<br>hope you see the smile<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;from the moon at night<br>its smiling at you<br>&nbsp; &nbsp; &nbsp; &nbsp; telling you it\'ll be alright<br>look up once more<br>did you see the scorching sun<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;lucidly it shine<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; despite the black dark night<br>did you see the ocean waves<br>not the one from your face<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; though it rumble hard<br>sometimes like a graveyard&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; it calm<br>I\'ll be there like an umbrella<br>to cover you while pain rains hard<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;through it all<br>I\'ll sacrifice my all<br>for the sake of love<br>&nbsp;</p>', 'uploads/15609278045488087FB_IMG_15609274284826457.jpg', '1560499238919gltn63o60c5da5reeel3ui', '07:03:26', '2019-06-19', '15609278066a68t72bcr2eemu1lrll40i8a', 'thumb/15609278048761785FB_IMG_15609274284826457.jpg', 1),
(197, 'DAYS (Day 9 of 10)', 'CHHOTE', '15601637908ypeccotrs6edlncey9e512t28rlotahaial0hgh051e', 'show', '<p><br>Leo dauty simukoko once w<br>Leo dauty simukoko once wrote,</p><p><br>\"I\'ve seen days darker than shaka\"<br>Well I would like to agree<br>and I quote,<br>I\'ve seen days darker than the black bull of Africa,<br>Days where the sun only sets and never rises<br>Days when our lives are filled with nothing but ecliptical shadows&nbsp;<br>Like the dirty water we drink from shallow wells.<br>I dont wanna believe my mind but it Seems God has forsaken us,<br>Coz Life in the ghetto ain\'t just sweet<br>You see,<br>I come from a society,<br>Where graduates are looked down upon<br>No school fees and so in our minds is porn<br>Youths by &nbsp;our own leaders being tossed all around.<br>A society where young boys are gangsters and girls are slay queens,<br>Mothers &nbsp;and fathers are drunkards,<br>And Children are bastards.<br>A society Where life is so hard that all our sisters had to become prostitutes.<br>A society where gunshots are heard on a daily basis<br>They have become music to our ears.<br>It may sound funny but,<br>We\'ve Been crying since day one&nbsp;<br>our tear ducts &nbsp;have run out of tears.<br>imiti ikula empanga you say<br>But why not conserve us?<br>Why not water us until we are fully grown?<br>Why uproot us by hiking your school fees?<br>Why instill violence,anger and pain in us?<br>Get me right,<br>get me right I say!<br>I ain\'t blaming society or anyone concerned,<br>I ain\'t saying the government hasnt done enough,<br>Neither am I saying every nut &nbsp;in the ghetto is rotten,<br>All I wanna say is i know life is hard cozI\'ve been there too!<br>I\'ve also lived in chains of poverty,<br>Fed myself out of immorality,<br>Wished for death tho it never came.<br>But know this,<br>Know this,<br>If I survived in the ghetto,<br>I know I can survive anywhere,<br>If I was able to endure and become a somebody I know you can too,<br>If I was able to reach this far I know you will<br>As Joy comes in the morning,<br>So does night before dawn.<br>Down before up,<br>And low before high.<br>Endurance and hope and we shall surely overcome</p><p>Because we are strong and together we stand&nbsp;<br>rote,</p><p><br>\"I\'ve seen days darker than shaka\"<br>Well I would like to agree<br>and I quote,<br>I\'ve seen days darker than I black bull of Africa,<br>Days where the sun only sets and never rises<br>Days when our lives are filled with nothing but ecliptical shadows&nbsp;<br>Like the dirty water we drink from shallow wells.<br>I dont wanna believe my mind but it Seems God has forsaken us,<br>Coz Life in the ghetto ain\'t just sweet<br>You see,<br>I come from a society,<br>Where graduates are looked down upon<br>No school fees and so in our minds is porn<br>Youths by &nbsp;our own leaders being tossed all around.<br>A society where young boys are gangsters and girls are slay queens,<br>Mothers &nbsp;and fathers are drunkards,<br>And Children are bastards.<br>A society Where life is so hard that all our sisters had to become prostitutes.<br>A society where gunshots are heard on a daily basis<br>They have become music to our ears.<br>It may sound funny but,<br>We\'ve Been crying since day one&nbsp;<br>our tear ducts &nbsp;have run out of tears.<br>imiti ikula empanga you say<br>But why not conserve us?<br>Why not water us until we are fully grown?<br>Why uproot us by hiking your school fees?<br>Why instill violence,anger and pain in us?<br>Get me right,<br>get me right I say!<br>I ain\'t blaming society or anyone concerned,<br>I ain\'t saying the government hasnt done enough,<br>Neither am I saying every nut &nbsp;in the ghetto is rotten,<br>All I wanna say is i know life is hard cozI\'ve been there too!<br>I\'ve also lived in chains of poverty,<br>Fed myself out of immorality,<br>Wished for death tho it never came.<br>But know this,<br>Know this,<br>If I survived in the ghetto,<br>I know I can survive anywhere,<br>If I was able to endure and become a somebody I know you can too,<br>If I was able to reach this far I know you will<br>As Joy comes in the morning,<br>So does night before dawn.<br>Down before up,<br>And low before high.<br>Endurance and hope and we shall surely overcome</p><p>Because we are strong and together we stand&nbsp;<br>&nbsp;</p>', 'uploads/15609301728420537IMG_20190619_WA0010.jpg', '1560499238919gltn63o60c5da5reeel3ui', '07:42:53', '2019-06-19', '15609301733dc4i6rla5te98say6785', 'thumb/15609301725288752IMG_20190619_WA0010.jpg', 1),
(201, 'A Settled. Heart Â  (DAY 9 of 10)', 'Asika Victor', '1560102058ce2hcod0l31iel77inotya83tay600escgiarvrskret4plaa', 'show', '<p><br><br>Why can\'t we let our heart settle,&nbsp;<br>must we always wrestle&nbsp;<br>Why can\'t we build a settled mind,&nbsp;<br>must we always have a deadly mind&nbsp;<br><br>Why am i your enemy&nbsp;<br>Just because of my colour&nbsp;<br>Molding a mountain of fear in me&nbsp;<br>Deep inside hurting in quiver&nbsp;<br><br>Why can\'t we allow to be fooled&nbsp;<br>Have you ever seen peace between two tortoise&nbsp;<br>Why not allow to be defeated&nbsp;<br>Have ever seen peace among two wise &nbsp;<br><br>Why not hold me like you can\'t do without me&nbsp;<br>Why not we build our crumbling home&nbsp;<br>Let not worsen our pain &nbsp;<br>Why not come together for we are one&nbsp;<br><br>What if we love each other &nbsp;<br>and together we build a settled mind&nbsp;<br>Why not we both be fools,&nbsp;<br>for foolishness brings peace</p>', 'uploads/15610107698284568asika_9.jpg', 'j90819542aBn72i', '06:06:11', '2019-06-20', '1561010771tl1982041eri7a21ca', 'thumb/15610107696336947asika_9.jpg', NULL),
(202, 'SPEAK DON\'T HIT   (DAY 10 of 10)', 'Georgette Kendra Mbale', '1559751687aeytcets5teded9e0blg3g21emn1aehyaireel1po8nrglol1tr9ckra6a', 'show', '<p>Listen to the voice in my heart<br>I\'m hurt and bruised<br>Listen to the voice of a thousand emotions.<br>There\'s no abuse in love<br>And no love in abuse<br>Love me right.</p><p>I am your angel&nbsp;<br>Cut not my wings.<br>With each bruise&nbsp;<br>You awaken disgust not passion<br>Hate not love<br>You shatter my heart&nbsp;<br>Kill my happiness.<br>Love me don\'t hurt me<br>Violence is cowardice&nbsp;<br>Be my hero not my villain&nbsp;<br>Speak don\'t hit me<br>Listen to my voice.</p><p>You wish us to play house<br>Pretending we play in the snow<br>And sleep on a bed of roses.<br>You wish our lives to be a William Shakespeare drama play&nbsp;<br>Like Romeo and Juliet you say<br>This isn\'t the itanic scenario<br>Nor is it the beauty and the beast.</p><p>Do you wish me to go MI5<br>Because this union is a mission impossible&nbsp;<br>If you don\'t treat me right.</p><p>How many times can I forgive and forget&nbsp;<br>How many times can I cry and not be heard<br>How many times can I try and not be hurt.<br>The beatings and scars you leave me with<br>Are a well painted picture that lives in my head<br>A tattoo engraved on my heart.</p><p>I am crying and pleading before you<br>Listen to my voice&nbsp;<br>And make a choice<br>Violence isn\'t the point<br>Gender based violence<br>Should never be an option<br>Speak to me and I\'ll listen<br>Listen to my voice and let\'s make peace.</p>', 'uploads/1561016889281168310gorge.jpg', 'j90819542aBn72i', '07:48:11', '2019-06-20', '15610086970aa2l3i2011tc4prse78ke', 'thumb/1561016889403132610gorge.jpg', NULL),
(203, 'WE WERE NOT TOLD (DAY 10 of 10)', 'OLUWOLE OLUWATOBI SOLOMON', '15600993580oonbacye1gtousayoa4lnrelr01cioo4t6slolue0w0plltold7ewmai9he1', 'show', '<p>Life is full of mysteries<br>Life has several sides<br>Life is good to some&nbsp;<br>Life is tortuous to some<br>We see life as it unveils its sides to an individual<br>We were not told</p><p><br>Life is attached to our destinies<br>Our destinies are attached to life<br>Why is it that different people do same things in life but with different outcomes?<br>Life is good&nbsp;<br>Life is cruel<br>We work to make it in life,<br>We strive day in day out to be great<br>Our struggles in life do not determine our greatness<br>We were not told</p><p><br>Let it be written in the tablet of our hearts<br>To unveil what life does to people,<br>We were not told<br>Our unborn generations should not encounter&nbsp;<br>What we are experiencing nowadays<br>For how long shall we say we were not told?</p><p><br>If we have in mind to relate how life is to our unborn generations,<br>How do we start the narration?<br>Do we understand the mysteries of life?<br>Will this not repeat itself?<br>When our unborn generations shall ask us questions<br>Shall we have relevant answers to their questions?<br>So that we shall not keep saying<br>We were not told as well.</p><p>Written by: Ã‚Â©OLUWOLE OLUWATOBI SOLOMON</p>', 'uploads/15610088709715039IMG_20190619_WA0006.jpg', 'j90819542aBn72i', '07:51:13', '2019-06-20', '1561008871c1e45e9l3t5w8a86ir', 'thumb/15610088705606711IMG_20190619_WA0006.jpg', NULL),
(204, 'LOVE BIRDS  (DAY 10 of 10)', 'Ariyo Ahmad', '15602440698dah92am6al40doactaroyyrg3ina7else5ie1yrh8ct0elp', 'show', '<p>On this pendulum of Love<br>I move to and fro<br>Searching for her breeze<br>To penetrate into my heart</p><p><br>I lay down on my sofa<br>Reminiscing her glowing face<br>That pour on me like rain<br>I reincarnate her smiling face.</p><p><br>Sparkling endowed beauty<br>Rising like the sun<br>That rise like flame at north<br>Giving my flower strength</p><p><br>Our love &nbsp;of bird<br>Striving like yam strands<br>Searching for tree stands<br>To make our love grow firm</p><p><br>The birds strengthening our love<br>With melodious love song<br>Coming from the forest.<br>Where love emanated from</p><p>&nbsp;</p><p>Let the bird hang on,<br>My shoulder to sing<br>Sonorously to my ears</p><p><br>For today is getting hooked up.<br>And the birds&nbsp;<br>Are singing love song<br>To send hatred on exile</p>', 'uploads/1561017175445510410amad.jpg', 'j90819542aBn72i', '07:52:56', '2019-06-20', '1561009069077l741roie0lvce5t74a', 'thumb/15610090681193246IMG_20190620_WA0000.jpg', NULL),
(205, 'METAPHORS OF LIFE  (DAY 10 of 10)', 'Paciolo Pen Saint', '156018203445nt0aiss3nclhny6ceteo9gtraoa6e9a4lipi7ee1playorplc7d', 'show', '<p>I enter her world not knowing a B from a bulls foot,&nbsp;<br>I shall leave her world without my back.&nbsp;<br><br>Although life is comical, &nbsp;many mysteries about her remain unravelled, especially the mystery on how she was able to give birth.&nbsp;<br><br>Although life is ridiculous, many mysteries about her remain undivulged , especially the mystery on how she was delivered of. &nbsp;<br><br>Although life is a game, &nbsp;many mysteries about her remain winless, especially the mystery of playing an unknown game in her field.&nbsp;<br><br>Although life is a puzzle, many mysteries about her remain unsolved, &nbsp;especially the mystery of solving what you know not. &nbsp;<br><br>Although life is a book, &nbsp;many mysteries about her remain enveloped, especially the mystery of reading and learning what thee can\'t decipher. &nbsp;<br><br>Although life is a riddle, &nbsp;many mysteries about her remain holed up, &nbsp;especially the mystery of peregrinating round the wisp of her dimensional part. &nbsp;<br><br>Although life is a classroom, many mysteries about her remain unlearned, especially the mystery of learning new things daily.&nbsp;<br><br>Although life is a gaol, many mysteries about her remain locked up, &nbsp;especially the mystery of dwelling in her abode with freedom. &nbsp;<br><br>Although life is a war, many things about her remain unconquered, &nbsp;especially the mystery of fighting unknown invisible war. &nbsp;<br><br>Although life is a dream, &nbsp;many mysteries about her remain unaccomplished, &nbsp;especially the mystery of chasing the uncertainty. &nbsp;<br><br>Although life is a goal, many mysteries about her remain scoreless, especially the mystery of setting and scoring the ball in the wrong net. &nbsp;<br><br>Although life is everything, &nbsp;many mysteries about her remain unknown, &nbsp;especially the mystery of not knowing what she means, &nbsp;especially the mystery of not knowing who she is.&nbsp;<br><br>Paciolo Pen Saint</p>', 'uploads/156101862233574910paci.jpg', 'j90819542aBn72i', '08:17:04', '2019-06-20', '1561018624948aope16e7s6i02t9rmhraclt', 'thumb/1561018622654339710paci.jpg', 1),
(206, 'Once!    (DAY 10 of 10)', 'Abdulrahman Soliu', '15601820100bly1ulmorenaer8alita11yepo4sru32i78sltae0c5hnagcdldha', 'show', '<p><br>Once I top the highest pillar of success&nbsp;<br>My passion of touching the moon&nbsp;<br>Will illume the ladder of my success&nbsp;<br>And the earth shall handsake my heart. &nbsp;<br><br>Once I raised my hands&nbsp;<br>Like the statue in my home town, &nbsp;<br>Above the other, to help them&nbsp;<br>My heart shall congratulate my hands&nbsp;<br>And filled my heart, the louder of my actions. &nbsp;<br><br>Once I actualized my dream&nbsp;<br>The sun shall pay visit to the moon&nbsp;<br>And broadcast my success ahead the heaven &nbsp;<br>And the rainbow shall peep to my heart&nbsp;<br>To appreciate me as a dream actualizer. &nbsp;<br><br>Once I succeeded in agitating &nbsp;<br>The peace and freedom of my oppressed men&nbsp;<br>Victory, determination shall comes to hug me&nbsp;<br>And sobriquet me as a true agitator. &nbsp;<br><br>Once I completed my mission&nbsp;<br>To make life of those common men &nbsp;<br>Completed like those of the rich men&nbsp;<br>The dawn of the coming day&nbsp;<br>Shall bow for my activeness.</p>', 'uploads/1561018736783050910abdu.jpg', 'j90819542aBn72i', '08:18:57', '2019-06-20', '156101873793rce6l363t1ican26oe', 'thumb/1561018736400170910abdu.jpg', 1),
(207, 'LOSING OUR THE TREASURE LAND    (DAY 10 of 10)', 'MR\'TINO', '1560163509coadedep0lrecaramea3h2eiab1e3dn4l27siy28ejyougmltayi5yat1', 'show', '<p>The tears of a wailing land has grice lottan soul,&nbsp;<br>Some followed years ago there were a fairly lady introduced to faces of this nation as our serviour&nbsp;<br><br>After some streamed of waters &nbsp;<br>The faces mobilized troops of soldiers to assassinated her &nbsp;<br><br>After her death, she written a beautiful song down as a predecessor, the faces charged her predecessor to court as rebel &nbsp;<br><br>A beautifully song that dies betwixt our lips years ago, now &nbsp;grouped an assassin gang to visited each door of Nigerians&nbsp;<br><br>That &nbsp;abondone project of operation feed the nation came has aide, but slaughter her neck with our greediness and civilization with morden &nbsp;<br><br>Ears were deaf and doom to the wails of farming like deaf dog ignoring the called of a hunter&nbsp;<br><br>Those cultivated lands were treasure filled of gold and silver &nbsp;<br><br>Farmers are poor but not poorer as a salary\'s earners or daily hawker &nbsp;<br><br>Farmer were a region of people well served of carbohydrates and proteins &nbsp;<br><br>Africa is golden soil rated as numinous in categories of agriculture , why were the whites colonized our forefathers? Obviously is our treasury land founded of manioc and fertility&nbsp;<br><br>MR\'TINO THE LOVER BOY</p>', 'uploads/1561018872435871510mrt.jpg', 'j90819542aBn72i', '08:21:13', '2019-06-20', '1561018873a66cl98giisnl5140rteo03', 'thumb/1561018872243918610mrt.jpg', 1),
(208, 'SLAVE_TO_LIFE (DAY 10 of 10)', 'Chhote', '15601637908ypeccotrs6edlncey9e512t28rlotahaial0hgh051e', 'show', '<p><br>Shame,disgrace,pain is all shes ever gained<br>All she\'s ever received are Scars on her once beaitiful body<br>Tears ever flowing,in her eyes they never dry<br>\"Why cant i just die?\"<br>She wonders</p><p><br>Just a little girl,<br>An Innocent girl forced to grow before her time.<br>In the name of marriage,<br>Sold off as a property by her own parents.<br>Denied childhood and her basic rights<br>Isolated from her peers and mates<br>Emotionally,physically,and mentally abused by her so called husband.</p><p>She is a slave in the morning<br>A maid in the afternoon<br>A punching bag in the evening and,<br>A sex toy each and every time he wishes.<br>Day after day,&nbsp;<br>Stripped naked of her dignity,pride and purity,&nbsp;<br>Insulted daily in view of society Battered to the point of insanity<br>Last time I checked,&nbsp;<br>She had developed hills of pain on her face,<br>Depressions of sadness on her skin,<br>Desserts of shame on her head,&nbsp;<br>Her eyes swollen red as those of &nbsp;a proffesional smoker.<br>She believes she\'s is a slave to life.&nbsp;<br>So every day when he leaves, she goes to the bedroom and writes<br>Dear diary,&nbsp;<br>Like every other day, yesterday was painful.&nbsp;<br>As usual Pitcher came back home drunk,&nbsp;<br>He\'s boots and clothes drenched in wine, his breath worse. ahhh<br>That reminds me,&nbsp;<br>How much &nbsp;his touch I loathe,&nbsp;<br>How disgusted of my own body I\'ve come to be as he Brutally he gets hold of my neck, beat box me from &nbsp;left to right as I refused to lie with him.&nbsp;<br>As usual, x, &nbsp;I foolishly tried to fight but all my strength vanished like my school dreams.&nbsp;<br>Dear diary,</p><p><br>She wishes she was never born,&nbsp;<br>She thinks she is cursed with a curse that leaves probably left by her ancestors<br>Life she hates,<br>Destiny she detastes<br>Poverty she blames,<br>Her parents decision she understands but,<br>\"why doesnt society help?\"<br>\"why Is there no one wanting to take a stand ?\"<br>Dear little girl,&nbsp;<br>I know you are broken, lost,and you &nbsp;feel forgotten.&nbsp;<br>&nbsp;today I stand on this God forsaken stage,</p><p><br>\"Am i not humrthq TVan as everyone els<br>\"Am i not?\"&nbsp;<br>\"Are there any other victims of early marriages?\"<br>\"Do they also suffer same humilliation as i do?\"<br>\"Were they also Not given an opportunity to say i do?\"<br>\"Who can i run to?\"</p><p>\"Who can help me carry this load?\"out loud she cries,<br>For death she always &nbsp;prays,<br>Nothing she can do except watch because,<br>SHE IS A SLAVE TO LIFE!&nbsp;<br>#CHHOTE_THEE_POET</p>', 'uploads/1561042396817236710chhote.jpg', 'j90819542aBn72i', '14:53:18', '2019-06-20', '1561042398afolts125elivlct1878e2ai1r1e', 'thumb/1561042396496726010chhote.jpg', 1),
(209, 'Servitude (DAY 10 of 10)', 'Bello Sodeeq Adekunle', '1560163948uyoesae7laldeeatd51lootpre1beics0ngyn81dkl04qa9l5lreeceh6', 'show', '<p><br>.&nbsp;<br>In the pamphlet of country like mine&nbsp;<br>words akin servitude are accentuate by the masses&nbsp;<br>even the huge land mass could attest to my county\'s dilemma<br>.&nbsp;<br>Whenever we belch, we emit the aura of servitude.&nbsp;<br>we breath toxic air,&nbsp;<br>&amp; the hazy cloud of bondage looms everywhere&nbsp;<br>.&nbsp;<br>We work tirelessly to survive&nbsp;<br>but our blood &amp; sweat<br>is the repast our leaders dine with&nbsp;<br>toiling the soil of hardships,&nbsp;<br>only for our table to be occupied with meals of sufferance&nbsp;<br>.&nbsp;<br>Someone labor arduously for his boss<br>fetching bulgy cash into his purse&nbsp;<br>yet chomping on stale pastries&nbsp;<br>&amp; still flutters around with cheers.&nbsp;<br>what is he than a goat<br>rejoicing at the prospect of been taken&nbsp;<br>to a beautiful abattoir<br>.&nbsp;<br>When a pauper causes chaos, we say he has start again&nbsp;<br>but if wealthy people become violent, then we call it a short-term madness<br>.&nbsp;<br>hypocrite is our cognomen<br>.&nbsp;<br>Anytime i see people overshadowed with the spirit of monetary.&nbsp;<br>I knew they were appointed demon&nbsp;<br>&amp; we are crazy patriots &nbsp; garnishing their massive territory&nbsp;<br>.&nbsp;<br>Bewildered, if this is our own notion of democracy&nbsp;<br>.&nbsp;<br>Here, our sun sear hellishly<br>moon keeps gloaming&nbsp;<br>&amp; star abhor his light<br>.&nbsp;<br>My country is a varsity&nbsp;<br>&amp; servitude is a core course,&nbsp;<br>we dare not rerun.</p>', 'uploads/1561042518792450310bello.jpg', 'j90819542aBn72i', '14:55:19', '2019-06-20', '156104251984r7cairesliv41u12td40ee8t', 'thumb/1561042518530434510bello.jpg', 1),
(210, 'A living legend   (DAY 10 of 10)', 'HOLUWAKHARYORDAE TAIWO', '1560102926ra12hacel1ngpraalad6wodtieyaorulcaio67ee37yokl0stw90h5teryh', 'show', '<p><br><br>My bag was heavily loaded with armors &nbsp;<br>My cheeks were distanced away from humour &nbsp;<br>Hot tears danced off my paled eyes&nbsp;<br>I heartily bid you all a goodbye &nbsp;<br><br>\"He was once a warrior &nbsp;<br>He hail from the hood of horrors&nbsp;<br>To win he strives hard &nbsp;<br>He wish he could become a great DAD\"&nbsp;<br><br>Is that the story you gonna tell my kids? &nbsp;<br>Whenever my soul got cultivated like weeds.&nbsp;<br><br>I\'m a sojourner, &nbsp;<br>I was caged in a cell like a prisoner&nbsp;<br>I fight so hard to be set free&nbsp;<br>my freedom was labeled with huge fee. &nbsp;<br><br>I once rise like the morning sun&nbsp;<br>life prickled my foot, repeatedly I fall&nbsp;<br>I once smiled like an infant boy&nbsp;<br>Wished life never deprive my joy&nbsp;<br><br>I\'m a warrior, I strikes with force &nbsp;<br>A loner, no allies no forces&nbsp;<br>Remember I once existed,&nbsp;<br>I was once a hero before I got defeated &nbsp;<br><br>I\'m a living legend &nbsp;<br>To the upcoming, I\'m like a rare gem&nbsp;<br>I\'ll walk by and leave thousand footprints&nbsp;<br>Even if death push me of life\'s cliff, &nbsp;<br>my soul will forever live. &nbsp;<br><br>#iamteazhy</p>', 'uploads/1561042678923176910hol.jpg', 'j90819542aBn72i', '14:57:59', '2019-06-20', '15610426790r283c8li22te5a57a', 'thumb/1561042678109981310hol.jpg', 1),
(211, 'THAT MAGIC CALLED MARRIAGE (DAY 10 of 10)', 'Asika Victor', '1560102058ce2hcod0l31iel77inotya83tay600escgiarvrskret4plaa', 'show', '<p>Have you ever seen&nbsp;<br>a married woman,&nbsp;<br>taking it up with her husband?&nbsp;<br>Try helping her bad&nbsp;<br>and see how lovely and precious&nbsp;<br>her husband is.&nbsp;<br>That\'s the magic called marriage.&nbsp;<br><br>Have you not seen a whore,&nbsp;<br>who become a better wife.&nbsp;<br>Than that Virgin sister,&nbsp;<br>whose holiness is higher than the star.&nbsp;<br>That\'s the magic called marriage.&nbsp;<br><br>Haven\'t you seen&nbsp;<br>the most powerful man,&nbsp;<br>being so weak and respectful&nbsp;<br>towards his wife and home&nbsp;<br>Or the weakling\'s wife being his punching bag.&nbsp;<br>Still she will be the one to beg.&nbsp;<br>That\'s magic called marriage.&nbsp;<br><br>Marriage is not a bed of rose,&nbsp;<br>There is always some hard times.&nbsp;<br>There is sometimes he will be a beast,&nbsp;<br>And sometimes he will be the best.&nbsp;<br>Their sometimes she will be the devil,&nbsp;<br>And sometimes she will be the angel.&nbsp;<br>That\'s the magic called marriage.&nbsp;<br><br>Marriage is never a bed of rose,&nbsp;<br>It has its up and downs.&nbsp;<br>Have you ever been in same room and same house,&nbsp;<br>with same person for ten or more years.&nbsp;<br>That feelings you got waking up to see same face.&nbsp;<br>That\'s why marriage was never ment for boys.&nbsp;<br>It\'s for the real men and matured mind&nbsp;<br><br>Dear husband,&nbsp;<br>Can you still remember your promise.&nbsp;<br>Can you still love me without end&nbsp;<br>Without the best version of me, &nbsp;<br>when my face grows old&nbsp;<br>When that nipples stop pointing at you&nbsp;<br>When that big and bouncing hip wither &nbsp;<br>That\'s why this magic is not for boys or girls&nbsp;<br>But for matured mind, able men and women&nbsp;<br><br>Dear wife&nbsp;<br>Can you still remember your promise&nbsp;<br>Can you still love me without end&nbsp;<br>When that six packs change to pot belly&nbsp;<br>When that six cars change to leggedis Benz&nbsp;<br>When that muscles is too weak to carry you&nbsp;<br>Can you borrow me yours to stand&nbsp;<br>Marriage is never for boys and girls&nbsp;<br><br>Dear husband and wife&nbsp;<br>Don\'t forget that first promise&nbsp;<br>That love that can move mountains&nbsp;<br>That love that quench burning fires&nbsp;<br>That first love that can dry oceans &nbsp;<br>She is there before that child&nbsp;<br>He is there before those children&nbsp;<br>Never you prefer them before her&nbsp;<br>Neither are you to, before him&nbsp;<br>Don\'t forget those sweet words,&nbsp;<br>that makes her mad over you&nbsp;<br>Don\'t forget those silly behaviors,&nbsp;<br>that makes him want to kill a lion for you&nbsp;<br><br>Don\'t give up yet&nbsp;<br>Don\'t be tired&nbsp;<br>Marriage is ment to be renewed &nbsp;<br>Renew it every day, every minutes and every seconds&nbsp;<br>The magic is not getting married but staying married&nbsp;<br><br>Love, fight, shout at each other&nbsp;<br>but most of all never you stop believing each other&nbsp;<br>That magic called marriage is always a mystery &nbsp;<br>It is not easy and never will it be easy</p>', 'uploads/1561069280343564610asika.jpg', 'j90819542aBn72i', '22:21:22', '2019-06-20', '15610692826r72et38l3ih4aa22tt7c', 'thumb/156106928077815410asika.jpg', 1);
