(892, 'added', 'IDENTIFY MY HEROES.   If you have these traits, you are my hero. Even when I don\'t know you.  So disheartening that I do not meet bilal, we shares the same skin, he is my blooda with flesh. I wanna share beans and bread with with muaz bn Jabbal, he understand interest and fraud more than professor, but my man left more than 300years ago.. Where abdullah bn mas\'ud the man that can recite Qur\'an without a single error. Where is Khalid bn walid, the fighter that can fight those who beef. Do not abuse my poetry kindly ask hassan bn thabit how he came about its words, I wanna have a best friend like abubakr, A mentor like umor, uthman will be my confidant if I can just copy him while Ali will be my ally if I do not allow muawiyyah to face him, I wanna have a class with abdullah bn Abbas, perhaps I can be a legend like ibn teymiha and mohammad bn Abdul wahab.  I need a wife like khodijah, the mother of believer and supporter, where is Aisha the scholar that can not be compare with Ngozi chimamanda. I have missed thumayah, the brave woman that stood with the truth. Oh! What of nusaybah the gallant niqobite that faced the world that are against her, she never felt oppressed that will lead to depressed. If you wanna these heroes. Please use your google and learn more. If you can just imitate them you gonna feel glad till Jesus the son of Mary come back home.  All those with these attributes are my heroes. I missed them.  May Allah put more light on their graves.', 'article', '481q21454i8ais9', '18:53:15', '2018-08-20', 'logdn60f7yei88t360i42'),
