(1729, 'added', 'I DREAMT A DREAM I dreamt a dream that our blissful love was curved into lust, I dreamt a dream that all our dreams and wants were lost. I dreamt a dream that our kisses and pecks were hidden locks of lips that has locked our virginity. I dreamt a dream that those horny nights when we screamed and rolled on skin to skin, will soon be haunty days that shall make us regret! I dreamt a dream, a bitter dream that those days when in dark secret places our hearts labor for, will soon vanish and then return to punish us! I dreamt a dream there I saw our eyes being red in regret! our tongue turned blue in lamentation orchestration! I dreamt a dream, there I saw all our filthy cares and lust, those ones we could not fear but trust! I saw them being broken down, from a vase laid with chains! I dreamt a dream that someday we came to realise that all worldly love is lust, that all our cares will lead us to tears! I dreamt a dream that our worldly dreams of tomorrow won\'t come into the morrow except through sorrow! I dreamt a dream that we\'ll soon regret ever falling in Love\'s trap, then like a crab we hid our watery feelings into our shells. I dreamt a dream that someday we\'ll be given a second chance to amend our worldly ways.', 'article', '15604268922iido935cn6e14le9grat64', '20:58:25', '2019-06-19', '1560977905log91545677i'),
